(439, 'Kayla Athalah Dinandra', 'kayla.athalah@gmail.com', '', 'Assalamualaikum warahmatullahi wabarakatuh,########## selamat pagi Ibu/Bapak Humas.##########\n\nMohon maaf mengganggu waktunya.##########\nPerkenalkan,########## saya Kayla Athalah Dinandra mahasiswi Program Studi D4########## Manajemen Perkantoran Digital,########## Fakultas Vokasi,########## Universitas Airlangga.##########\n\nDengan hormat,########## saya ingin menyampaikan maksud terkait rencana kegiatan Office Goes To School,########## yaitu agenda tahunan berupa kunjungan ke sekolah-sekolah yang diselenggarakan oleh Himpunan Mahasiswa Program Studi D4########## Manajemen Perkantoran Digital.########## Kegiatan ini bertujuan untuk berbagi informasi dan pengalaman mengenai dunia perkuliahan,########## khususnya terkait program studi kami,########## dalam bentuk talkshow interaktif dan beberapa sesi permainan edukatif bersama siswa-siswi SMA.##########\n\nSehubungan dengan hal tersebut,########## kami berharap dapat menjalin kerja sama dengan pihak sekolah untuk menyelenggarakan kegiatan ini.########## Apabila diperkenankan,########## mohon kiranya Ibu/Bapak dapat menginformasikan kepada saya siapa yang dapat saya hubungi lebih lanjut terkait perizinan dan koordinasi kegiatan ini.########## Atau,########## apakah saya dapat langsung datang ke sekolah dan bertemu dengan perwakilan Humas?##########\n\nDemikian yang dapat saya sampaikan.########## Atas perhatian dan waktunya,########## saya ucapkan terima kasih.########## Mohon maaf apabila terdapat kekeliruan dalam penyampaian.##########\n\nWassalamualaikum warahmatullahi wabarakatuh.##########\n\nHormat saya,##########\nKayla Athalah Dinandra\nHumas ##########\nHima D4########## Manajemen Perkantoran Digital\nUniversitas Airlangga', NULL, '2025-07-18 09:14:12', '158.140.171.46', 'private'),
(440, 'Clarissa', 'info@clayton.bangeshop.com', 'https://www.bbc.com', 'Morning,########## \r##########\n\r##########\nI hope this email finds you well.########## I wanted to let you know about our new BANGE backpacks and sling bags that just released.##########\r\n##########\r\nThe bags are waterproof and anti-theft,########## and have a built-in USB cable that can recharge your phone while you\'re on the go.##########\r\n##########\r\nBoth bags are made of durable and high-quality materials,########## and are perfect for everyday use or travel.##########\r\n##########\r\nOrder yours now at ##########50##########% OFF with FREE Shipping:########## http:##########//bangeshop.com\r##########\n\r##########\nEnjoy,##########\r\n##########\r\nClarissa', NULL, '2025-07-25 23:28:59', '199.187.211.231', 'private'),
(441, 'Ana', 'info@sman3surabaya.sch.id', 'https://www.bbc.com', 'Hello there ##########\r\n##########\r\nI wanted to reach out and let you know about our new dog harness.########## It\'s really easy to put on and take off ##########- in just ##########2 seconds ##########- and it\'s personalized for each dog.########## \r##########\nPlus,########## we offer a lifetime warranty so you can be sure your pet is always safe and stylish.##########\r\n##########\r\nWe\'ve had a lot of success with it so far and I think your dog would love it.########## \r##########\n\r##########\nGet yours today with ##########50##########% OFF:########## https:##########//caredogbest.com\r##########\n\r##########\nFREE Shipping ##########- TODAY ONLY!########## \r##########\n\r##########\nMany Thanks,########## \r##########\n\r##########\nAna', NULL, '2025-07-30 18:24:33', '23.83.135.234', 'private'),
(442, 'Laurence Fineltain', 'laurencefineltain@augroup.it.com', '', 'Hi Sman ##########3surabaya Sch Id,##########\r\n##########\r\n########## Im Laurence Fineltain with AU Group Inc.########## Were currently evaluating potential partners for an upcoming opportunity and would like to confirm:##########\r\n##########\r\nYour availability for new projects in Q3########## 2##########02##########5.##########\r\n##########\r\nYour interest in receiving project details\r##########\n\r##########\nScope information will be shared upon your confirmation of availability and interest.##########\r\n##########\r\nThanks and best regards\r##########\nLaurence Fineltain\r##########\nBusiness development/########## General Counselor\r##########\nhttps:##########//au-group.com/en', NULL, '2025-08-06 21:08:50', '156.233.95.227', 'private'),
(443, 'TUBAGUS ALVIN ARDIANSYAH', 'alvinardiansyah1076@gmail.com', '', 'Assalamualaikum wr wb,########## Saya Alvin perwakilan dari CIVIL EXPO ITS ##########20##########25########## yang tadi sempat datang kemarun dan membicarakan terkait Roadshow Offline ##########.\nSaya izin bertanya lebih lanjut ketersediaan SMAN ##########3 KOTA SURABAYA dengan agenda Roadshow offline ini Bu,########## apabila berkenan dilakukan Roadshow offline dari tanggal ##########28########## Agustus ##########- ##########5 September kira-kira bisa di tanggal berapa bu?##########\nTerima kasih sebelumnya ????????', NULL, '2025-08-28 13:38:43', '103.94.190.25', 'private'),
(444, 'Cesar de Godoy', 'hey@omniexistence.com', '', 'Hello,##########\r\nWe run a digital shop with tools that help businesses scale:########## automation flows,########## AI prompt packs,########## verified business lists,########## and step-by-step knowledge guides.##########\r\nExplore the catalog here:########## https:##########//omniexistens.com\r##########\nBest regards,##########\r\n##########\r\nThe Omniexistens Team', NULL, '2025-08-29 08:46:41', '81.161.50.123', 'private');
