INSERT INTO `kata_motivasi` (`id`, `content`, `author`) VALUES
(1, 'Pendidikan adalah senjata paling mematikan di dunia, karena dengan itu Anda dapat mengubah dunia', 'Nelson Mandela'),
(2, 'Jika anda mendidik seorang pria, maka seorang pria akan terdidik. Tapi jika anda mendidik seorang wanita, sebuah generasi akan terdidik', 'Brigham Young'),
(3, 'Hiduplah seolah engkau mati besok. Belajarlah seolah engkau hidup selamanya', 'Mahatma Gandhi'),
(4, 'Adalah baik untuk merayakan kesuksesan, tapi hal yang lebih penting adalah untuk mengambil pelajaran dari kegagalan', 'Bill Gates'),
(5, 'Orang-orang yang berhenti belajar akan menjadi pemilik masa lalu. Orang-orang yang masih terus belajar, akan menjadi pemilik masa depan', 'Mario Teguh'),
(7, 'Keberhasilan adalah kemampuan untuk melewati dan mengatasi dari satu kegagalan ke kegagalan berikutnya tanpa kehilangan semangat.', 'Winston Chuchill'),
(8, 'Apabila di dalam diri seseorang masih ada rasa malu dan takut untuk berbuat suatu kebaikan, maka jaminan bagi orang tersebut adalah tidak akan bertemunya ia dengan kemajuan selangkah pun.', 'Presiden RI-1 : Soekarno'),
(9, 'Kita mengajarkan disiplin untuk giat, untuk bekerja, untuk kebaikan, bukan agar anak-anak menjadi loyo, pasif, atau penurut.', 'Maria Montessori'),
(10, 'Jadilah orang yang dermawan tapi jangan menjadi pemboros. Jadilah orang yang hidup sederhana, tetapi jangan menjadi orang yang kikir.', 'Ali bin Abi Thalib'),
(11, 'Maafkanlah diri sendiri yang tengah gagal meraih mimpi, percayalah akan ada banyak mimpi yang lebih besar dan lebih baik dari mimpi yang tidak pernah kamu rancang sebelumnya.', 'No Name'),
(14, 'Pendidikan adalah kunci untuk membuka pintu emas kebebasan.', 'George Washington Carver'),
(15, 'Saat kamu terjatuh, tersenyumlah. Karena orang yang pernah jatuh adalah orang yang sedang berjalan menuju keberhasilan', 'masda'),
(16, '\"Dengan budi pekerti, tiap-tiap manusia berdiri sebagai manusia merdeka (berpribadi), yang dapat memerintah atau menguasai diri sendiri. Inilah manusia beradab dan itulah maksud dan tujuan pendidikan dalam garis besarnya.\"', 'Ki Hajar Dewantara');
