(13, 'sambutan_kepala_sekolah', '<p style=\"text-align:justify\"><em><strong>Assalamualaikum.Wr.Wb.</strong></em></p>\r\n\r\n<p style=\"text-align:justify\">Puji syukur kami panjatkan ke hadirat Allah SWT atas berkat, rahmat serta hidayah-Nya sehingga SMA Negeri 3 Surabaya telah dapat menjadi bagian dari komponen pendidikan yang dapat melangkah memenuhi tuntutan era globalisasi serta mempersiapkan diri untuk menghadapi berbagai tantangannya. Dunia pendidikan sudah seharusnya mengikuti pesatnya perkembangan ilmu pengetahuan informasi dan teknologi. Tahap demi tahap,SMA Negeri 3 Surabaya berupaya ingin menggapai cita-citanya, yakni meningkatkan kualitas anak didiknya yang berarti pula meninggikan derajat manusia Indonesia agar setara dengan bangsa lain. Dalam rangka menunjang upaya itu semua stakeholders SMA Negeri 3 Surabaya bermaksud mengembangkan sistem pembelajaran dengan media berbasis Teknologi Informasi: Internet (WiFi Area), E-Learning, Multimedia dan untuk membuka akses dengan masyarakat luar, SMA Negeri 3 Surabaya telah membuka layanan website. Tujuannya, selain memberikan informasi, juga ingin menyerap berbagai masukan positif dari berbagai pihak demi kemajuan SMA Negeri 3 Surabaya.Melalui pengadaan fasilitas website diharapkan dapat menjadi media informasi dan komunikasi berbagai pihak yang berkaitan dengan eksistensi SMA Negeri 3 Surabaya dan menjadi sumber belajar bagi semua komponen pendidikan di SMA Negeri 3 Surabaya.</p>\r\n\r\n<p style=\"text-align:justify\">Ucapan terimakasih kami sampaikan kepada semua pihak yang telah berperan aktif dalam keberadaan website ini. Saran dan kritik yang sifatnya membangun demi kesempurnaan website ini senantiasa kami tunggu melalui e-mail dan kritik saran yang kami sediakan. Kita buka jendela dunia , kita intip kemegahan, kebesaran Sang Pencipta walau hanya sebagian kecil melalui teknologi informasi. Akhir kata kami ucapkan selamat datang di situs SMA Negeri 3 Surabaya. Semoga layanan ini dapat bermanfaat bagi kita semua.&nbsp;</p>\r\n\r\n<p style=\"text-align:justify\"><em><strong>Wassalamu&#39;alaikum Wr. Wb.<a href=\"https://drive.google.com/file/d/1SJCjtqOKnSqdVdB3IoGOd07Ng6KLCO4o/view?usp=share_link\"><img alt=\"\" src=\"https://drive.google.com/file/d/1SJCjtqOKnSqdVdB3IoGOd07Ng6KLCO4o/view?usp=share_link\" /></a></strong></em></p>'),
