(2, 'Surat Edaran Lomba Menulis Cerpen', '2016-07-28', 'pengumuman', '<p>Dalam rangka mengisi liburan semester genap serta dalam rangka menumbuhkembangkan minat bakat siswa-siswi dalam bidang jurnalistik, Dinas Pendidikan Kota Surabaya mengadakan <strong>&rdquo;Lomba Menulis Cerpen&rdquo;</strong>.&nbsp;</p>\r\n\r\n<p><a href=\"https://drive.google.com/file/d/0B0aOE9xo9kuGUGI2ck9BZC12dWM/view?usp=sharing\">Download Surat (Revisi)</a></p>\r\n\r\n<p><a href=\"https://drive.google.com/file/d/0B0aOE9xo9kuGM1RfWlZFRDNyVFE/view?usp=sharing\">Download Pernyataan Orisinalitas</a></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>NB: </strong></p>\r\n\r\n<p><strong>1. Pernyataan orisinalitas dibuat 1 untuk cerpen yang mewakili sekolah di tingkat Kota.</strong></p>\r\n\r\n<p><strong>2. Deadline Pendaftaran dan Pengumpulan Cerpen ke Dinas Pendidikan maju menjadi Kamis, tanggal 4&nbsp;Agustus 2016</strong></p>\r\n\r\n<p><strong>3. Pendaftaran/Pengumpulan ke Sekretariat Lantai 2 ke Eno (</strong><strong>082244441646</strong>)<strong>/ Tika (082131707654)</strong></p>', 1, 0, NULL, '65c5d0d69a9322db96711750854e9dcb.jpg', 0, NULL, 2860),
(3, 'Lomba Cheerleader', '2016-07-28', 'prestasi_siswa', 'Diselenggarakan pada tahun 2011 oleh Indonesian Cheerleading Community (ICC) Tingkat Nasional', 1, 0, NULL, '82a86b211bff1473b66ee4ec98aefa9b.jpg', 0, NULL, 2),
(4, 'Profil', '2016-07-28', 'page', '<p style=\"text-align: justify;\"><span style=\"font-size:18px\">Dunia pendidikan sudah seharusnya mengikuti pesatnya perkembangan ilmu pengetahuan informasi dan teknologi. Tahap demi tahap,SMA Negeri 3 Surabaya berupaya ingin menggapai cita-citanya, yakni meningkatkan kualitas anak didiknya yang berarti pula meninggikan derajat manusia Indonesia agar setara dengan bangsa lain. Dalam rangka menunjang upaya itu semua stakeholders SMA Negeri 3 Surabaya bermaksud mengembangkan sistem pembelajaran dengan media berbasis Teknologi Informasi: Internet (WiFi Area), E-Learning, Multimedia dan untuk membuka akses dengan masyarakat luar, SMA Negeri 3 Surabaya telah membuka layanan website. Tujuannya, selain memberikan informasi, juga ingin menyerap berbagai masukan positif dari berbagai pihak demi kemajuan SMA Negeri 3 Surabaya.Melalui pengadaan fasilitas website diharapkan dapat menjadi media informasi dan komunikasi berbagai pihak yang berkaitan dengan eksistensi SMA Negeri 3 Surabaya dan menjadi sumber belajar bagi semua komponen pendidikan di SMA Negeri 3 Surabaya.</span></p>', 1, 0, NULL, NULL, 1, 'profil', 8795),
(5, 'Sarana dan Prasarana', '2016-07-28', 'page', '<p>Berbagai sarana dan prasarana serta fasilitas yang dimiliki SMAN 3 Surabaya untuk menunjang kegiatan belajar mengajar. Fasilitas tersebut antara lain:</p>\r\n\r\n<ul>\r\n	<li>Kelas</li>\r\n	<li>Perpustakaan</li>\r\n	<li>Laboratorium Biologi</li>\r\n	<li>Laboratorium Fisika</li>\r\n	<li>Laboratorium Kimia</li>\r\n	<li>Laboratorium Komputer</li>\r\n	<li>Ruang UKS (Usaha Kesehatan Sekolah)</li>\r\n	<li>Aula</li>\r\n	<li>Gazebo</li>\r\n	<li>Lapangan Basket</li>\r\n	<li>Lapangan Futsal</li>\r\n	<li>Lapangan Voli</li>\r\n	<li>Tempat Parkir</li>\r\n	<li>Kantin Sekolah</li>\r\n	<li>Masjid</li>\r\n</ul>', 1, 4, NULL, NULL, 4, 'sarana-dan-prasarana', 9821),
(6, 'Sejarah Singkat', '2016-07-28', 'page', '<p><strong><span style=\"font-size:18px\">Sejarah Singkat SMA Negeri 3 Surabaya</span></strong></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px\">SMA Negeri 3 Surabaya pertama kali berada di Jl. Genteng Kali No. 33, kemudian dikarenakan kebijakan pemerintah pusat, maka SMA Negeri 3 Surabaya berubah statusnya menjadi SMPP yang kemudian berlokasi di Jl. Panjang Jiwo. Bangunan SMA Negeri 3 yang ada di Jl. Genteng Kali dijadikan kantor Dinas Pendidikan propinsi Jawa Timur. Sehubungan dengan perubahan satus ini, segala urusan yang berkaitan dengan SMA Negeri 3 dipusatkan di SMA Negeri 9 Surabaya. Pada tahun 1980 SMA Negeri 3 Surabaya memiliki gedung sendiri yang terletak di Komplek TNI AL Kenjeran, yaitu di Jl. Memet Sastrowiryo Komplek TNI AL, Kenjeran, Surabaya.</span></p>\r\n\r\n<p style=\"text-align:justify\">&nbsp;</p>\r\n\r\n<p><strong><span style=\"font-size:18px\">Akreditasi</span></strong></p>\r\n\r\n<ul>\r\n	<li><span style=\"font-size:16px\">Nilai Akreditasi &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;: 92.00</span></li>\r\n	<li><span style=\"font-size:16px\">Peringkat Akreditasi &nbsp; &nbsp;: A</span></li>\r\n	<li><span style=\"font-size:16px\">Tanggal Penetapan &nbsp; &nbsp; : 30 september 2022</span></li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h2><strong><span style=\"font-size:18px\">Daftar Kepala Sekolah</span></strong></h2>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<table class=\"wikitable\">\r\n	<tbody>\r\n		<tr>\r\n			<th>\r\n			<p><span style=\"font-size:16px\">Nama Kepala Sekolah</span></p>\r\n			</th>\r\n			<th>\r\n			<p><span style=\"font-size:16px\">Periode</span></p>\r\n			</th>\r\n		</tr>\r\n		<tr>\r\n			<td><span style=\"font-size:16px\">1. &nbsp; Drs. Simbardjo Sastrowijoto&nbsp;</span></td>\r\n			<td><span style=\"font-size:16px\">01 Juli 1978 &nbsp;s.d. &nbsp;07 September 1980</span></td>\r\n		</tr>\r\n		<tr>\r\n			<td><span style=\"font-size:16px\">2. &nbsp; Moehadji Reksodidjojo, BA</spa