(7, 'Struktur Organisasi', '2016-07-28', 'page', '<p style=\"text-align:center\"><span style=\"font-size:24px\"><strong>Berikut Struktur Organisasi SMA Negeri 3 Surabaya, </strong></span></p>\r\n\r\n<p style=\"text-align:center\"><span style=\"font-size:24px\"><strong>Periode Tahun 2025&nbsp;- 2026, sebagai berikut :&nbsp;</strong></span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p style=\"text-align:center\"><span style=\"color:#0000CD\"><span style=\"font-size:24px\"><strong>KEPALA SMA NEGERI 3 SURABAYA</strong></span></span></p>\r\n\r\n<p style=\"text-align:center\"><span style=\"font-size:24px\">Agus Dwi Pamungkas, S.Si., M.Pd</span></p>\r\n\r\n<p style=\"text-align:center\">&nbsp;</p>\r\n\r\n<p style=\"text-align:center\"><span style=\"color:#0000CD\"><span style=\"font-size:22px\"><strong>WAKIL KEPALA SEKOLAH BIDANG KURIKULUM</strong></span></span></p>\r\n\r\n<p style=\"text-align:center\"><span style=\"font-size:24px\">Hadi Sunyoto, S.Sos.</span></p>\r\n\r\n<p style=\"text-align:center\">&nbsp;</p>\r\n\r\n<p style=\"text-align:center\"><span style=\"color:#0000CD\"><span style=\"font-size:24px\"><strong><span style=\"font-size:22px\">WAKIL KEPALA SEKOLAH BIDANG KESISWAA</span>N</strong></span></span></p>\r\n\r\n<p style=\"text-align:center\"><span style=\"font-size:24px\">Agus Setiadi, S.Pd</span></p>\r\n\r\n<p style=\"text-align:center\">&nbsp;</p>\r\n\r\n<p style=\"text-align:center\"><span style=\"color:#0000CD\"><span style=\"font-size:22px\"><strong>WAKIL KEPALA SEKOLAH BIDANG SARANA DAN PRASARANA</strong></span></span></p>\r\n\r\n<p style=\"text-align:center\"><span style=\"font-size:24px\">Aries Afandri, S.Pd</span></p>\r\n\r\n<p style=\"text-align:center\">&nbsp;</p>\r\n\r\n<p style=\"text-align:center\"><span style=\"color:#0000CD\"><span style=\"font-size:22px\"><strong>WAKIL KEPALA SEKOLAH BIDANG HUMAS</strong></span></span></p>\r\n\r\n<p style=\"text-align:center\"><span style=\"font-size:24px\">Theo. Gunawan Wahana, S.S., M.Pd</span></p>\r\n\r\n<div style=\"text-align: center;\">&nbsp;</div>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>', 1, 4, NULL, NULL, 3, 'struktur-organisasi', 11996),
(8, 'Visi - Misi', '2016-07-28', 'page', '<p><span style=\"font-size:26px\"><strong>VISI SEKOLAH</strong></span></p>\r\n\r\n<p><span style=\"font-size:22px\">Unggul, Berakhlak Mulia, Berintegritas, Kritis, Kreatif, dan Peduli Lingkungan serta Berpijak pada Budaya Bangsa.</span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style=\"font-size:26px\"><strong>MISI SEKOLAH</strong></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:22px\">1. Meningkatkan penghayatan dan pengamalan terhadap </span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:22px\">&nbsp; &nbsp; ajaran agama yang dianutnya.</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:22px\">2. Meningkatkan sikap jujur, adil dan bertanggungjawab.</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:22px\">3. Melaksanakan pembelajaran kritis, kreatif, komunikatif </span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:22px\">&nbsp; &nbsp; dan kolaboratif.</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:22px\">4. Meningkatkan budaya literasi.</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:22px\">5. Membudidayakan sikap gotong royong.</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:22px\">6. Melaksanakan pelestarian lingkungan, mencegah </span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:22px\">&nbsp; &nbsp; kerusakan&nbsp;lingkungan dan mencegah&nbsp;pencemaran</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:22px\">&nbsp; &nbsp; lingkungan.</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:22px\">7. Membudidayakan senyum, sapa dan salam sesama warga </span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:22px\">&nbsp; &nbsp; sekolah di lingkungan sekolah.</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:22px\">8. Meningkatkan jiwa nasionalisme.</span></p>', 1, 4, NULL, NULL, 1, 'visi-misi', 11348),
(12, 'Program Sekolah', '2016-07-30', 'page', '<table class=\"table\" style=\"width:100%\">\r\n	<tbody>\r\n		<tr>\r\n			<th>&nbsp;</th>\r\n			<th>\r\n			<p><span style=\"font-size:24px\">PROGRAM NON KURIKULER UNGGULAN SEKOLAH</span></p>\r\n\r\n			<p>&nbsp;</p>\r\n			</th>\r\n		</tr>\r\n		<tr>\r\n			<td><span style=\"font-size:26px\">1</span></td>\r\n			<td><span style=\"font-size:26px\">Bahasa Jepang</span></td>\r\n		</tr>\r\n		<tr>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n	</tbody>\r\n</table>', 1, 4, NULL, NULL, 5, 'program-sekolah', 9968),
(13, 'Pelatihan Paskibraka Kota Surabaya 2016', '2016-07-31', 'pengumuman', '<div>\r\n<p>Kepada kepala SMA / SMK Negeri / Swasta</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Berdasarkan hasil rapat perihal persiapan pelatihan paskibraka Kota Surabaya tahun 2016 di Pemerintah Kota Surabaya, mohon bantuan Saudara memberikan dispensasi kepada :</p>\r\n\r\n<p>Nama &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; : <strong>Terlampir</strong></p>\r\n\r\n<p>Asal Sekolah &nbsp;: <strong>Terlampir</strong>&nbsp;</p>\r\n\r\n<p>Untuk mengikuti acara dengan jadwal sebagai berikut :</p>\r\n\r\n<p>a. Pembukaan oleh Walikota Surabaya tgl 3 Agustus 2016 pukul 7&nbsp;</p>\r\n\r\n<p>b. Tahap Pra Pelatihan tgl 30-31 Juli 2016 pukul 13 di Taman Surya</p>\r\n\r\n<p>c. Tahap Pelatihan tgl 3-12 Agustus 2016 pukul 6-20 di Taman Surya</p>\r\n\r\n<p>d. Pengukuhan paskibraka tgl 15 Agustus 2016 pukul 6</p>\r\n\r\n<p>e. Tahap karantina tgl 14-17 Agustus 2016 di STIESIA</p>\r\n\r\n<p>f. Upacara bendera 17 Agustus 2016 di Taman Surya</p>\r\n\r\n<p>Demikian terima kasih.</p>\r\n\r\n<p><a href=\"https://drive.google.com/open?id=0B89xYVwAslWcMjVyQVgwS3h5SE0\" target=\"_blank\">Download surat</a></p>\r\n\r\n<p><a href=\"https://drive.google.com/open?id=0B89xYVwAslWca082MTFyVm5LcjA\" target=\"_blank\">Download lampiran 1</a></p>\r\n\r\n<p><a href=\"https://drive.google.com/open?id=0B89xYVwAslWcSHJuWDJTTGsxNVE\" target=\"_blank\">Download lampiran 2</a></p>\r\n</div>', 5, 0, NULL, '487799f2dce73a2bc6b9d9e8a2b3a23b.JPG', 0, NULL, 2894),
(35, 'KELULUSAN SMA NEGERI 3 SURABAYA', '2017-05-03', 'pengumuman', '<p style=\"text-align:justify\"><span style=\"color:#000000\"><span style=\"font-size:16px\"><span style=\"font-family:times new roman,times,serif\">Pengumuman hasil Ujian Sekolah Berstandar Nasional (USBN) dan Ujian Nasional Berstandar Komputer (UNBK) Sekolah Menengah Atas (SMA) khususnya SMA Negeri 3 Surabaya, rencananya bakal diumumkan pada Selasa, 2 Mei 2017.</span></span></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"color:#000000\"><span style=\"font-size:16px\"><span style=\"font-family:times new roman,times,serif\">Untuk mekanisme pengumuman kelulusan tersebut nantinya akan dilakukan usai pelaksanaan Upacara Hari Pendidikan Nasional (Hardiknas). Namun, untuk menghindari euforia berlebih dari siswa, maka pengumuman kelulusan akan disampaikan sore hari. &ldquo;Ini untuk menghindari konvoi berkepanjangan, maka pengumuman Kelulusan Siswa Kelas XII bisa di lihat di Website Sekolah, dan website sekolah selalu di pantau.&rdquo; kata Bapak Kepala Sekolah - Drs. Shohib, MM.</span></span></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"color:#000000\"><span style=\"font-size:16px\"><span style=\"font-family:times new roman,times,serif\">Meskipun nilai UNBK ditentukan pusat, namun bukan menjadi penentu kelulusan siswa, karena ujian sekolah dan USBN yang menentukan nilai kelulusan. UNBK SMA dan SMK sederajat sendiri dilangsungkan pada 20 hingga 23 Maret sedangkan USBN pada 10 hingga 13 April 2017.</span></span></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"color:#000000\"><span style=\"font-size:16px\"><span style=\"font-family:times new roman,times,serif\">Terkait dengan jumlah kelulusan, Bapak Drs. Shohib, MM mengakui hal itu merupakan kewenangan pihak sekolah. Karena sejak tahun lalu, hasil ujian nasional tidak lagi menjadi penentu kelulusan. Kelulusan siswa sepenuhnya ditentukan oleh sekolah. &ldquo;Sekarang ini yang menentukan kelulusan, pihak sekolah. Provinsi tidak bisa mengintervensi karena kelulusan itu hasil ujian sekolah, bukan hasil ujian nasional,&rdquo; jelas Kepala Sekolah.</span></span></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"color:#000000\"><span style=\"font-size:16px\"><span style=\"font-family:times new roman,times,serif\">Dikatakan lagi, untuk tahun pelajaran 2016/2017 siswa - siswi SMA Negeri 3 Surabaya, alhamdulillah semua LULUS 100%. &quot;SELAMAT ATAS KELULUSAN SISWA - SISWI SMA NEGERI 3 SURABAYA, TAHUN PELAJARAN 2016/2017, ALHAMDULILLAH SEMUA LULUS 100%&quot;, ungkap Kepala Sekolah.&nbsp;</span></span></span></p>\r\n\r\n<p style=\"text-align:justify\">&nbsp;</p>', 1, 0, NULL, '400e7306427d9ae792ee295d1199976b.jpg', 0, NULL, 3513),
(41, 'Simulasi 2 UNBK 2018', '2018-01-08', 'pengumuman', '<p style=\"text-align: justify;\"><strong>Jadwal UNBK Simulasi 2 dari puspendik</strong>&nbsp;- Seperti pada info tentang UNBK sebelumnya, bahwa dalam pelaksanaan UNBK terdiri dari beberapa tahap penting, yaitu simulasi 1, simulasi 2, simulasi 3 atau disebut geladi bersih, dan UNBK utama disusul UNBK susulan bagi yang berhalangan mengikuti UNBK utama.<br />\r\n<span style=\"background-color:rgb(254, 254, 254); color:rgb(0, 0, 0); font-family:roboto,sans-serif; font-size:15px\">Tahapan pelaksanaan tersebut diikuti oleh seluruh jenjang pendidikan baik dari SMP/MTs, SMA/MA, dan SMK sederajat. Adapun simulasi UNBK dilaksanakan dengan tujuan untuk memberi gambaran kepada siswa-siswi tentang prosedur mengerjakan soal UNBK serta bagaimana bentuk soal UNBK. Dengan adanya simulasi, diharapkan siswa-siswi mampu memahami bagaimana sistem pelaksanaan hingga bagaimana cara melaksanakan ujian berbasis komputer dengan baik dan benar.</span><br />\r\n<span style=\"background-color:rgb(254, 254, 254); color:rgb(0, 0, 0); font-family:roboto,sans-serif; font-size:15px\">Selain itu, simulasi UNBK juga sangat penting dipahami oleh proktor dan teknisi beserta panitia penyelenggara UNBK dalam mengenal dan memahami proses UNBK, mulai dari tahap instalasi server, sinkronisasi, hingga upload jawaban siswa ke server pusat. Adanya tahapan simulasi ini diharapkan para proktor dan teknisi mampu menganalisa dan memecahkan problem selama proses UNBK berlangsung.</span></p>\r\n\r\n<p style=\"text-align: center;\"><strong><span style=\"font-size:22px\">Kapan Pelaksanaan Simulasi 2 UNBK?</span></strong></p>\r\n\r\n<p style=\"text-align: justify;\"><span style=\"background-color:rgb(254, 254, 254); color:rgb(0, 0, 0); font-family:roboto,sans-serif; font-size:15px\">Nah, sampai saat ini, tahapan UNBK telah selesai melaksanakan Simulasi 1 dan akan memasuki tahap Simulasi 2. Mungkin salah satu diantara kalian, baik pelajar ataupun panitia ujian, ingin segera mengetahui kapan pelaksanaan simulasi 2. Namun perlu kita ketahui hingga saat ini juga, belum ada informasi resmi tentang jadwal pelaksanaan simulasi 2 dari puspendik, yang ada hanya informasi HOAX yang dibuat berdasarkan pelaksanaan simulasi 2 tahun sebelumnya, yakni tahun 2017.</span><br />\r\n<br />\r\n<span style=\"background-color:rgb(254, 254, 254); color:rgb(0, 0, 0); font-family:roboto,sans-serif; font-size:15px\">Jika kita aktif di media sosial, seperti facebook, twitter, terutama di group whatsapp, atau mungkin kita lebih aktif di internet untuk mencari berbagai informasi. Maka kita akan banyak menjumpai informasi jadwal pelaksanaan UNBK 2018 mulai dari simulasi 1 hingga jadwal pelaksanaan UNBK utama.</span><br />\r\n<br />\r\n<strong>Ingat! Itu adalah informasi yang tidak benar</strong><span style=\"background-color:rgb(254, 254, 254); color:rgb(0, 0, 0); font-family:roboto,sans-serif; font-size:15px\">. Sebab informasi tersebut hanya dibuat berdasarkan jadwal pelaksanaan UNBK tahun 2017 yang kemudian hanya tahunnya saja yang dirubah menjadi 2018. Untuk hari dan tanggal masih mengacu dan sama dengan UNBK tahun 2017.</span><br />\r\n<br />\r\n<span style=\"background-color:rgb(254, 254, 254); color:rgb(0, 0, 0); font-family:roboto,sans-serif; font-size:15px\">Entah apa tujuan penyebar info tersebut, apakah memang untuk kepentingan pribadi ataukah bertujuan hanya untuk sebagai dasar persiapan saja, yang artinya info jadwal tersebut hanya bersifat rencana saja supaya kita lebih siap menghadapi UNBK.&nbsp;</span></p>', 1, 0, NULL, 'c46c70004b7ac7ebbe460659c92af27d.jpg', 0, NULL, 2372),
(42, 'Bijak Dalam Bersosial Media Ala SMAN-3 Surabaya', '2018-01-08', 'sekilas_info', 'Sosial media bukanlah hal yang baru lagi bagi masyarakat Indonesia, bahkan bukan hanya dari golongan remaja saja yang menggunakan sosial media namun juga sudah merambah ke usia anak-anak dan orang tua. Bagaimana manfaat sosial media sebenarnya tergantung bagaimana individu-individu itu sendiri dalam memanfaatkannya dalam kehidupan mereka. Sebab pada zaman modern ini penggunaan ponsel, internet sudah tidak lagi menjadi suatu hal yang sulit untuk ditemukan, jika dulu penggunaan gadget hanya ada di lapisan masyarakat kalangan atas, sekarang ini hampir seluruh lapisan masyarakat Indonesia sudah tersentuh oleh perkembangan teknologi ini.\r\n\r\nYang patut menjadi perhatian adalah bagaimana efek dari penggunaan sosial media tersebut oleh individu-individu seringkali sudah melenceng jauh dari manfaat sosial media itu sendiri yang sejatinya sangat berguna untuk hal yang positif seperti menjalin tali silahturahmi dan sebagainya. Hari ini kita dapat melihat banyak sekali pihak-pihak yang memanfaatkan sosial media untuk sarana melancarkan aksi-aksi propaganda, fitnah, bahkan yang bertujuan memecah belah banyak disebar luaskan melalui sosial media.\r\nTentu hal ini menuntut kebijaksanaan masing-masing individu dalam menggunakan sosial media. Di bawah ini ada beberapa tips untuk Anda agar dapat mewujudkan hal tersebut :\r\n\r\n1. Filter pertemanan Anda\r\nHal ini dimaksudkan untuk tidak asal menambahkan atau menerima pertemanan yang kemungkinan membawa efek negatif bagi sikap Anda dalam menggunakan media sosial. Selain itu juga melindungi diri Anda dari tindak-tindak kejahatan yang saat ini banyak sekali terjadi seperti penculikan atau pun pemerasan yang kebanyakan bermula dari sosial media.\r\n\r\n2. Pasang identitas asli namun tidak bersifat pribadi\r\nDengan memasang identitas asli Anda di akun milik Anda, selain membantu Anda tetap berada pada fungsi utama sosial media untuk menjalin talli silahturahmi dengan banyak sahabat, hal ini juga akan mempermudah orang lain menemukan Anda yang mungkin saja sudah lama tidak berkomunikasi dengan Anda.\r\n\r\n3. Tidak perlu berbagi nomor telepon dan informasi pribadi lainnya\r\nKembali lagi dengan banyaknya kasus kriminal yang berawal di media sosial, akan sangat bijaksana bila Anda tidak membagikan informasi pribadi Anda pada akun media sosial milik Anda untuk menghindari segala hal yang mungkin akan dimanfaatkan oleh orang yang tidak bertanggung jawab. Kecuali jika memang Anda memanfaatkan akun Anda untuk keperluan usaha dan berbisnis Anda dapat menyediakan satu nomor khusus yang bukan nomor pribadi Anda sendiri.\r\n\r\n4. Pasang foto profil yang sewajarnya\r\nFoto profil merupakan hal pertama yang dilihat orang lain di sosial media, foto inilah yang mengidentifikasikan Anda dan akan memudahkan orang lain atau sahabat Anda untuk menemukan Anda. Selain itu gunakan foto profil yang wajar tanpa hal-hal negatif.\r\n\r\n5. Pikir dahulu sebelum membuat status\r\nSebaiknya memang tidak membuat status yang memancing pihak lain untuk merespon negatif, banyak sekali hal-hal bermanfaat yang dapat dijadikan status atau mungkin hanya sekedar berkomunikasi dengan sahabat.\r\n\r\n6. Jauhi perdebatan\r\nPerdebatan yang membawa kegunaan atau dapat menambah wawasan mungkin masih bersifat positif, namun jika sudah mengarah pada hal yang tidak sehat segera abaikan saja.\r\n\r\n7. Pastikan akun Anda memiliki proteksi yang baik\r\nAnda pastinya pernah melihat atau mungkin juga mengalami sendiri akun yang diretas oleh orang tidak bertanggung jawab. Nah, pastikan akun Anda terproteksi dengan baik dengan kata sandi yang hanya Anda yang mengetahui, atau dapat juga Anda tambahkan lapisan keamanan lain agar Anda bisa nyaman dan aman menggunakan media sosial.', 1, 0, NULL, NULL, 0, NULL, 3250),
(43, 'KELULUSAN SISWA - SISWI SMA NEGERI 3 SURABAYA TAHUN 2018', '2018-05-03', 'pengumuman', '<p style=\"text-align:justify\"><span style=\"font-size:14pt\">Lelah, letih, jenuh, dan mungkin membosankanbagi anak &ndash; anak Kelas XII ini, hampir setiap hari diberi materi ujian, guna untuk menghadapi USBN dan UNBK 2018 ini.</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:14pt\">Mulai dari berbagai try out baik tulis maupun online, dan simulasi. &ldquo;Kami sudah berupaya sebaik &ndash; baiknya, dan mengerahkan segala kemampuan kami hanya untuk mencerdaskan anak bangsa, serta hanya untuk kesuksesan anak didik kami&rdquo; imbuh Bapak Shohib selaku Kepala SMAN 3 Surabaya. </span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:14pt\">Tahap 1 telah kita selesaikan bersama anak &ndash; anak, USBN dan UNBK 2018 telah tuntas sudah, kerja keras dan iringan doa telah kita lakukan bersama, hanya menunggu hasil pengumuman kelulusan yang selalu di nanti.</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:14pt\">Pada Hari Pendidikan Nasional tahun ini terasa lebih istimewa karena bertepatan dengan pengumuman kelulusan UN SMA/SMK/sederajat. Kabar tersebut dibagikan oleh Kemendikbud melalui akun Instagram resmi mereka, Selasa (1/5). Dalam unggahannya tersebut Kemendikbud juga menjelaskan bahwa siswa nantinya bisa melihat pengumuman kelulusan di sekolah masing-masing, tidak melalui internet. </span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:14pt\">Maka dengan ini saya selaku Kepala SMAN 3 Surabaya menyatakan &ldquo; Seluruh Siswa &ndash; Siswi SMA Negeri 3 Surabaya &ndash; LULUS 100 %&rdquo;. &ldquo;bagi siswa semuanya saya atas nama sekolah mengucapkan selamat atas Kelulusannya di tingkat / jenjang SMA, semoga ilmu yang didapat berguna, bermanfaat, dan berkah untuk kalian semua&rdquo; imbuh Bapak Shohib.</span></p>\r\n\r\n<p style=\"text-align: center;\"><span style=\"font-family:arial,sans-serif\">&nbsp;</span><span style=\"font-family:arial,sans-serif; font-size:11pt\">***SELAMAT BERKARYA DAN BERPRESTASI DI TEMPAT LAIN***</span></p>', 1, 0, NULL, 'b185db3dfb70faf4aec77a8a5c01879d.jpg', 0, NULL, 2986),
(45, 'TRY OUT SMAN 3 SBY', '2018-10-03', 'sekilas_info', 'SMAN 3 SBY - Sejauh mana persiapanmu dalam menghadapi UNBK dan SBMPTN? Masih pemanasan? Atau sudah siap perang? Mendekati waktu-waktu ujian seperti saat ini, kamu pasti udah disibukkan dengan berbagai macam try out, entah try out mandiri ataupun try out dari sekolah. Dari banyaknya persiapan  menjelang ujian, kadang try out menjadi pilihan akhir ketika seseorang sudah merasa siap menghadapi ujian. Sampai saat ini berapa kali kamu mengikuti try out khususnya try out SBMPTN?\r\n\r\nNah selain latihan kamu juga harus mengukur kemampuanmu. Salah satu caranya adalah lewat try out. Try out merupakan simulasi ujian dan sebagai sarana yang bisa digunakan untuk mengetahui dan mengukur kemampuan dalam menghadapi ujian yang sebenarnya. Try out juga sebenarnya sangat menguntungkan dan dapat melengkapi performa dalam menghadapi ujian. \r\n\r\nJika baru sekali atau dua kali maka kamu perlu mengikuti tulisan ini hingga akhir. Ini karena try out sebenarnya sangat penting dalam mendukung proses belajarmu, dan bukan hanya pilihan akhir setelah selesai persiapan saja. \r\n\r\nSebenarnya apa sih pentingnya try out ini ?\r\n\r\n1.	Sebagai evaluasi untuk memetakan dan mengukur kemampuan diri\r\nSejauh mana kemampuanmu dalam memahami materi? Jika belum tahu, kamu bisa menggunakan hasil try out sebagai salah satu acuan untuk memetakan kelebihan dan kelemahanmu. Oleh karena itu mulai sekarang jangan sepelekan try out dan hasil yang didapat. Meski hanya sebatas latihan namun hasil try out yang dikerjakan dengan sungguh-sungguh akan memberi gambaran langsung sejauh mana kamu mempersiapkan diri menyambut ujian. \r\n\r\nTry out membantumu untuk memberikan gambaran materi apa saja yang sebaiknya diperdalam. Dengan try out, kamu bisa tau apakah persiapan yang sudah dilakukan selama ini berhasil atau malah kamu harus mengubah gaya belajarmu. \r\n\r\n\r\n2.	Mendapat tambahan referensi soal\r\nKita tak akan tahu seperti apa bentuk soal yang akan diujikan. Ya iyalah namanya aja ujian, soalnya pasti juga dirahasiakan. Nah sebagai persiapan dalam menghadapi ujian, kamu bisa mengakalinya dengan berlatih soal yang berbeda setiap harinya. Soal-soal tersbeut bisa didapat dari guru, bimbel, internet bahkan try out. Try out? Iya try out. \r\n\r\nSering mengikuti try out selain bisa menambah pengalaman juga bisa menambah koleksi dan referensi soal. Para penyedia jasa try out tetunya lebih tau dan berpengalaman dalam membuat soal ujian. Nah hal ini bisa kamu manfaatkan sebagai salah satu strategi dalam mempersiapkan diri menjelang ujian. Percaya gak kalo soal-soal yang diujikan saat try out biasanya malah lebih susah dari ujian asli itu sendiri ?\r\n\r\nNah hal ini bisa jadi salah satu keuntungan karena kamu nggak perlu pusing-pusing lagi cari soal yang relevan. Selesai try out, soal-soal tersebut bisa jadi referensi dan bahan belajar yang sesuai kan?\r\n\r\n3.	Membiasakan diri dengan durasi ujian\r\nPernah ngalamin kehabisan waktu saat ujian atau ulangan harian? Nah hal inilah yang sering dikeluhkan oleh para peserta Ujian Nasional saat mengerjakan soal ujian. \r\n\r\nTry out mampu membuatmu mengerti materi apa saja yang membutuhkan perhatian lebih. Jika kamu lemah dalam materi bahasa Inggris namun kuat di matmatika, maka dengan try out kamu mmapu mengukur seberapa lama waktu yang diperlukan untuk menyelesaikan soal bahasa Inggris dibanding dengan matematika. Nah trik-trik seperti ini yang seharusnya bisa diterapkan ketika berhadapan dengan soal-soal ujian. \r\n\r\nSeperti yang kita tahu bahwa soal Ujian Nasional yang banyaknya ampun-ampunan itu harus bisa dikerjakan dalam waktu kurang dari dua jam per sesinya. Setiap peserta dituntut untuk berpikir cepat. Nah hal inilah yang biasanya menjadi batu sandungan banyak peserta karena mereka tidak terbiasa dengan durasi waktu ujian yang super cepat. Para peserta biasanya belum terbiasa karena sebelumnya pikiran mereka masih terbiasa dengan rentang Ujian Nasional yang memiiki durasi yang lebih panjang.\r\n\r\nAnak-anak yang terbiasa mengerjakan try out dengan durasi yang sama pun tentu lebih unggul karena mereka pikiran mereka terbiasa untuk menyelesaikan soal dalam waktu singkat. Disinilah sebenarnya manfaat try out yang sebenarnya. Kamu yang belum pernah atau jarang ikut try out akan kewalahan menghadapi ujian sebenarnya. \r\n\r\n4.	Melatih fokus dan konsentrasi\r\n\r\nPanik saat ujian juga bisa menghilangkan konsentrasimu loh. Itulah sebabnya banyak berlatih khususnya dengan try out bisa menghindarkanmu dari serangan panik ketika ujian. Panik ini sendiri bisa terjadi karena beberapa faktor, salah satunya adalah tekanan yang diterima. Seluruh latihan dan persiapan yang dilakukan selama satu tahun ke belakang akhirnya ditentukan selama kurang dari seleksi yang berlangsung kurang dari satu hari. Bisa bayangin gak gimana panik dan kalutnya seseorang yang merasa dirinya belum siap ?\r\nInilah fungsinya try out diadakan. Selain menyiapkan diri dengan durasi dan strategi, try out yang sering dilakukan akan mengubah mindset dan menyingkirkan tekanan yang terjadi selama ujian. Latihan ujian yang sering dilakukan akan membuat tubuh dan pikiran beradaptasi dengan lingkungan dan suasana ujian. Jadi gak ada tuh serangan panik karena merasa belum siapa atau merasa gak bisa ngerjain soal.\r\n5. Hasil try out bisa jadi referensi dalam memilih kampus dan jurusan kuliah\r\nSebelum memilih untuk masuk ke suatu jurusan kamu sudah harus tahu tingkat persaingan dan kemampuan diri apakah sanggup mengikuti perkuliahan di jurusan tersebut atau gak. Nah hasil dari try out bisa kamu jadikan referensi untuk memilih jurusan yang sesuai dengan kemampuanmu. Ingat memilih jurusan selain berdasarkan minat juga harus berdasarkan kemampuanmu. Gak mau kan berhenti di tengah jalan karena merasa gak sanggup menjalani dunia perkuliahan atau ngerasa salah jurusan ?\r\nTapi ingat hasil try out sebaiknya hanya dijadikan referensi dan bukannya patokan mutlak dalam memilih jurusan. Jika kamu merasa sanggup dan mampu bersaing maka sah-sah saja memilih jurusan yang persaingannya sangat ketat, asal sudah dipikirkan matang-matang sebelumnya.', 1, 0, NULL, NULL, 0, NULL, 3584),
