(47, 'PENGUMUMAN KELULUSAN - TAHUN PELAJARAN 2018/2019', '2019-05-13', 'pengumuman', '<p style=\"text-align:justify\"><span style=\"color:rgb(0, 0, 0)\"><span style=\"font-size:16px\"><span style=\"font-family:times new roman,times,serif\">Pengumuman hasil Ujian Sekolah Berstandar Nasional (USBN) dan Ujian Nasional Berstandar Komputer (UNBK) Sekolah Menengah Atas (SMA) khususnya SMA Negeri 3 Surabaya, akan diumumkan pada Senin, 13&nbsp;Mei 2019.</span></span></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"color:rgb(0, 0, 0)\"><span style=\"font-size:16px\"><span style=\"font-family:times new roman,times,serif\">Untuk menghindari euforia berlebih dari siswa, maka pengumuman kelulusan akan disampaikan sore hari. &ldquo;Ini untuk menghindari konvoi berkepanjangan, maka pengumuman Kelulusan Siswa Kelas XII bisa di lihat di Website Sekolah, dan website sekolah selalu di pantau.&rdquo; kata Bapak Kepala Sekolah - Drs. Shohib, MM.</span></span></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"color:rgb(0, 0, 0)\"><span style=\"font-size:16px\"><span style=\"font-family:times new roman,times,serif\">Terkait dengan jumlah kelulusan, Bapak Drs. Shohib, MM mengakui hal itu merupakan kewenangan pihak sekolah. Karena hasil ujian nasional tidak lagi menjadi penentu kelulusan. Kelulusan siswa sepenuhnya ditentukan oleh sekolah. &ldquo;Sekarang ini yang menentukan kelulusan, pihak sekolah. Provinsi tidak bisa mengintervensi karena kelulusan itu hasil ujian sekolah, bukan hasil ujian nasional,&rdquo; jelas Kepala Sekolah.</span></span></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"color:rgb(0, 0, 0)\"><span style=\"font-size:16px\"><span style=\"font-family:times new roman,times,serif\">Dikatakan lagi, untuk tahun pelajaran 2018/2019&nbsp;siswa - siswi SMA Negeri 3 Surabaya, alhamdulillah semua LULUS 100%. &quot;SELAMAT ATAS KELULUSAN SISWA - SISWI SMA NEGERI 3 SURABAYA, TAHUN PELAJARAN 2018/2019, ALHAMDULILLAH <span style=\"font-size:20px\"><strong>SEMUA LULUS 100%</strong></span>&quot;, ungkap Kepala Sekolah.&nbsp;</span></span></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px\">SELAMAT SEKALI LAGI, JANGAN BERHENTI DI SINI, RAIH SEMUA IMPIANMU DAN SELALU KAU KENANG ALMAMATERMU.</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px\">Untuk Mengetahui Hasil Nilai UN, akan di beritahukan di Web Sekolah pada Hari : Selasa, Tgl : 14 Mei 2019, Jam : 13.00 Wib</span></p>\r\n\r\n<p style=\"text-align:justify\">&nbsp;</p>\r\n\r\n<div>&nbsp;</div>', 1, 0, NULL, 'b6d6371a4c1aac7273fa33975e60f82b.jpg', 0, NULL, 5588),
(50, 'PERSIAPAN UJIAN KLAS XII......AYO SIAP', '2020-01-23', 'sekilas_info', 'Sebagai bahan persiapan, pertama, penting buat mengetahui gambaran apa aja kegiatan penting yang akan alami selama kurang lebih sampai Juli tahun depan. Nah berikut ini gambaran kegiatan kelas 12 yang disusun dengan acuan kegiatan tahun ajaran 2018/2019. Kalo ga ada perubahan, harusnya sih jadwal kegiatan tahun ajaran 2019/2020 ga akan berbeda jauh, mungkin cuma selisih 1-2 minggu.\r\n\r\n1. Kegiatan Belajar Mengajar\r\nKegiatan Belajar Mengajar di sekolah efektif dilaksanakan selama 8 bulan, yaitu mulai akhir Juli / awal Agustus sampai dengan Maret. Bila dikurangi dengan libur kenaikan semester dan pelaksanaan UTS dan UAS, maka praktis tinggal sekitar 7 bulan (ini juga belum dikurangi libur sekolah). Jadi belajar dengan ngandelin materi dari sekolah sangat-sangat mepet. Usahakan belajar dan ngulik-ngulik materi sendiri.\r\n2. UTS dan UAS Semester Ganjil\r\nUTS Semester Ganjil akan dilaksanakan sekitar bulan September, sedangkan UAS akan dilaksanakan sekitar bulan Desember. UTS dan UAS ini sangat penting sebagai bahan penilaian.\r\n3. Pendaftaran SNMPTN\r\nPendaftaran SNMPTN biasanya dilaksanakan pada bulan Februari sampai dengan awal Maret. Setelah pendaftaran ditutup, berkas pendaftaran SNMPTN akan dikirim ke PTN pilihan I untuk diseleksi. Waktu seleksi di PTN pilihan I selama sekitar sebulan. Lalu apabila tidak diterima di PTN pilihan I, maka berkas pendaftaran akan diseleksi di PTN pilihan II selama sekitar sebulan juga. Jadi total waktu seleksi di PTN adalah dua bulan sampai dengan awal bulan Mei. Lalu sekitar pertengahan Mei, hasil SNMPTN akan diumumkan di website SNMPTN.\r\n4. Bimbingan UN Sekolah\r\nNah bimbingan UN di sekolah ini adalah awal dari semua masa super sibukmu di kelas 12 SMA. Tiap sekolah punya kebijakan berbeda-beda tentang bimbingan ini, namun biasanya sih diadakan selama sekitar 2-3 bulan sekitar Januari  Maret. Bimbingan ini biasanya menambah sekitar 2 jam, di luar sekolah. Jadi kalo sekolah lo biasanya pulang jam 3 siang, maka setelah adanya bimbel ini maka lo akan pulang sekitar jam 4 atau setengan 5 sore. Belum lagi kalo lo ikut bimbel di luar, bisa tiap hari pulang jam 8 malem (setidaknya itu yang gue alamin dulu, hehehe). Jadi kebayang kan kalo lo ga mulai nyicil materi dari sekarang? Fisik lo dituntut bekerja keras, otak lo dijejeli materi terus dari pagi sampai malem. Selain bikin capek juga materi yang keserap jadi ga maksimal.\r\n5. Try Out UN dari Dinas Pendidikan Masing-Masing\r\nBiasanya sekitar bulan Februari akan dilaksanakan TO UN yang diselenggarakan oleh masing-masing dinas pendidikan daerah. Tiap daerah bisa beda-beda waktu penyelenggaraannya.\r\n6. UAS Semester \r\nUAS semester 6 biasanya dilaksanakan bulan Januari - Februari sebelum Ujian Sekolah dan Praktikum. Namun nilai UAS Semester 6.\r\n7. Ujian Nasional\r\nSaat ini belum ada info apapun terkait dengan UN 2020. Sebagai gambaran, tahun ajaran 2019, UNBK SMA dilaksanakan pada tanggal 1 April 2019.\r\nUjian Nasional ini tidak menentukan kelulusan siswa dan masih belum jelas pula apakah dijadikan penilaian di SNMPTN.\r\n8. SBMPTN\r\nPasca UN, ada waktu lowong sekitar sebulan. Di pertengahannya, ada pengumuman hasil SNMPTN. Sebulan berlalu semenjak UN, saatnya para pejuang yang ditolak di SNMPTN bertempur matia-matian di SBMPTN. SBMPTN 2019 berbeda cukup signifikan dibandingkan dengan tahun-tahun lalu. Kalau tahun-tahun sebelumnya, definisi SBMPTN adalah ujian yang diselenggarakan secara nasional untuk menyaring siswa-siswa masuk PTN.', 1, 0, NULL, NULL, 0, NULL, 3559),
(51, 'PENGUMUMAN KELULUSAN SISWA KELAS XII - Tahun Pelajaran 2019/2020', '2020-05-02', 'pengumuman', '<p>Pengumuman Hasil Kelulusan Sekolah Menengah Atas (SMA) khususnya SMA Negeri 3 Surabaya, akan diumumkan pada Sabtu, 02&nbsp;Mei 2020, tepat Pukul : 12.00 Wib.</p>\r\n\r\n<p>Untuk menghindari euforia berlebih dari siswa, dan mengingat jumlah Kasus Positif <strong>Virus Corona</strong> (Covid-19) di Indonesia per Kamis (30/4) secara kumulatif mencapai 10.118 orang. Dari jumlah itu, sebanyak 792 orang meninggal dunia dan&nbsp;1.522 orang lainnya dinyatakan sembuh, maka pengumuman kelulusan akan disampaikan di Web Sekolah &ldquo;Ini untuk menghindari konvoi berkepanjangan, dan Penularan di luar masih terus terjadi, batasi aktivitas sosial di luar. Berdisiplin di rumah, dan tidak mudik adalah pilihan terbaik untuk mencegah penularan, maka pengumuman Kelulusan Siswa Kelas XII bisa di lihat di Website Sekolah.&rdquo; kata Bapak Kepala Sekolah - Drs. MOH. ZAINURI, M.Si.</p>\r\n\r\n<p>Terkait dengan jumlah kelulusan, Bapak Drs. MOH. ZAINURI, M.Si. mengakui hal itu merupakan kewenangan pihak sekolah. Karena hasil ujian nasional tidak lagi menjadi penentu kelulusan (UN DIBATALKAN akibat Pandemi Covid-19). Kelulusan siswa sepenuhnya ditentukan oleh sekolah. &ldquo;Sekarang ini yang menentukan kelulusan, pihak sekolah. Provinsi tidak bisa mengintervensi karena kelulusan itu hasil ujian sekolah&rdquo; jelas Kepala Sekolah.</p>\r\n\r\n<p>Serta pada masa &ndash; masa pandemic covid-19 ini, siswa diharapakan selalu STAY AT HOME - &nbsp;selalu dirumah, jangan berkeluar rumah jika tidak sangat &ndash; sangat penting sekali, hindari keramaian, selalu menjaga kebersihan dengan cara selalu mencuci tangan. Mari kita bersama &ndash; sama dan saling mengingatkan selalau tetap di dalam rumah.</p>\r\n\r\n<p>Dikatakan lagi, untuk tahun pelajaran 2019/2020&nbsp;siswa - siswi SMA Negeri 3 Surabaya, alhamdulillah semua LULUS 100%. &quot;SELAMAT ATAS KELULUSAN SISWA - SISWI SMA NEGERI 3 SURABAYA, TAHUN PELAJARAN 2019/2020, ALHAMDULILLAH&nbsp;<strong>SEMUA LULUS 100%</strong>&quot;, ungkap Kepala Sekolah.&nbsp;</p>\r\n\r\n<p>SELAMAT SEKALI LAGI, JANGAN BERHENTI DI SINI, RAIH SEMUA IMPIANMU DAN SELALU KAU KENANG ALMAMATERMU, JAGA KEBERSIHAN, JAGA JARAK, SELALU HINDARI KERUMUNAN/KERAMAIN, JANGAN KELUAR RUMAH JIKA TIDAK SANGAT URGENT, DAN SELALU MENCUCI TANGAN.</p>\r\n\r\n<p style=\"text-align: center;\">***** <em>STAY AT HOME</em> *****</p>', 1, 0, NULL, '5dc10009f1127bdf69201785966a2f4b.jpg', 0, NULL, 3747);
