(52, 'PPDB 2020 - Ditengah Pandemi Covid-19', '2020-06-15', 'sekilas_info', 'Sebagai salah satu Penanggungjawab Pembangunan Manusia di Jawa Timur, Dinas Pendidikan Provinsi Jawa Timur terus berupaya untuk meningkatkan kualitas pendidikan masyarakat. Untuk mempercepat pencapaian sasaran pembangunan pendidikan, Dinas Pendidikan Provinsi Jawa Timur telah melakukan banyak terobosan yang dilaksanakan secara menyeluruh dan berkesinambungan. \r\n\r\nSalah satunya adalah Penerimaan Peserta Didik Baru (PPDB) jenjang SMA, SMK, dan SLB Negeri Provinsi Jawa Timur tahun pelajaran 2020/2021. Hal ini sejalan dengan amanah Undang-Undang Nomor 23 Tahun 2014 tentang Manajemen Pengelolaan SMA, SMK dan SLB Negeri yang menjadi kewenangan Pemerintah Provinsi Jawa Timur. \r\n\r\nSistem seleksi PPDB dilaksanakan secara daring penuh (Full Online) dan cukup berbeda dengan pelaksanaan di tahun-tahun sebelumnya. Hal ini bertujuan untuk mempermudah masyarakat sehingga tidak perlu keluar rumah untuk mendaftar di sekolah tujuan selama masih diberlakukannya Masa Darurat Penyebaran Corona Virus Disease (COVID-19) di Jawa Timur.\r\nPPDB merupakan langkah awal kegiatan di bidang pendidikan khususnya pada pendidikan menengah, pendidikan khusus dan layanan khusus yang menjadi kewenangan Pemerintah Provinsi. Pelaksanaan PPDB Tahun Pelajaran 2020/2021 perlu dipersiapkan secara matang dengan prinsip nondiskriminatif, objektif, transparan, akuntabel dan berkeadilan. \r\nPendaftaran PPDB tahun pelajaran 2020/2021 dilaksanakan melalui jalur zonasi, afirmasi, perpindahan tugas orang tua, dan/atau prestasi. Sistem layanan PPDB dilaksanakan dalam dua mekanisme moda yaitu luar jaringan (offline) dan dalam jaringan (daring) atau Online sebagai pertimbangan untuk kemudahan masyarakat dalam proses pendaftaran dan sekaligus pemantauan hasil. Agar semua proses penyelenggaran PPDB tahun pelajaran 2020/2021 dapat berjalan dengan baik maka dalam penyelenggaraan PPDB Tahun Pelajaran 2020/2021 perlu disusun Petunjuk Teknis Pelaksanaan Penerimaan Peserta Didik Baru Jenjang SMA Negeri, SMK Negeri, dan SLB Negeri Provinsi Jawa Timur Tahun Pelajaran 2020/2021 yang selanjutnya disingkat Juknis PPDB. Juknis PPDB dimasudkan sebagai dasar acuan semua pihak yang terlibat pada semua proses PPDB.', 1, 0, NULL, NULL, 0, NULL, 3580),
(53, 'DATA ONLINE', '2020-06-17', 'page', '<p>Data Online</p>', 1, 0, NULL, NULL, 2, 'data-online', 5059),
