(59, 'Jadwal Kegiatan Akhir Tahun Pelajaran 2019/2020', '2020-06-18', 'pengumuman', '<p>Kepada:</p>\r\n\r\n<p>Yth : Bapak /Ibu Peserta Didik</p>\r\n\r\n<p>Kelas X, dan XI</p>\r\n\r\n<p>SMA Negeri 3 Surabaya</p>\r\n\r\n<p>Di &ndash;</p>\r\n\r\n<p><u>SURABAYA</u></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Diberitahukan kepada Orang Tua / Wali Peserta Didik kelas&nbsp; X, dan&nbsp; XI SMA Negeri 3 Surabaya, bahwa dalam rangka persiapan akhir tahun pembelajaran siswa di semester genap akan kami laporkan sebagai berikut : Silakan Klik Link dibawah ini.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><a href=\"https://drive.google.com/file/d/1HCHlenyz8L8rx14VJaivx_lm1A8d5wI5/view?usp=sharing\">https://drive.google.com/file/d/1HCHlenyz8L8rx14VJaivx_lm1A8d5wI5/view?usp=sharing</a></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Selama liburan pengawasan putra &ndash; putri Bapak / Ibu kami serahkan sepenuhnya dan menjadi tanggung jawab orang tua / wali murid.</p>\r\n\r\n<p>Demikian atas perhatiannya Bapak / Ibu / Sdr Orang Tua / Wali Peserta Didik disampaikan terima kasih.</p>', 1, 0, NULL, '91142e256813396f04e018976a865852.jpg', 0, NULL, 1977),
(60, 'FORM ISIAN PPDB 2020', '2020-06-18', 'pengumuman', '<p><span style=\"font-size:12px\">Kepada,</span></p>\r\n\r\n<p><span style=\"font-size:12px\">Yth : Orang Tua / Wali Murid Siswa Baru</span></p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; SMA Negeri 3 Surabaya</p>\r\n\r\n<p>di&nbsp; &nbsp; Tempat</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Diberitahukan kepada Orang Tua / Wali Peserta Didik Baru (PPDB 2020) SMA Negeri 3 Surabaya, bahwa dalam rangka Penerimaan Peserta Didik Baru (PPDB) 2020, maka kami memerlukan data yang Benar dan Valid, untuk pengisian data siswa&nbsp;-&nbsp;Silakan Klik Link dibawah ini.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><a href=\"https://forms.gle/5JQCwFYrj7csWG1j8\">https://forms.gle/5JQCwFYrj7csWG1j8</a></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Bilamana Terjadi Kendala Hubungi, Chat WA :&nbsp; 081554038599. Disertai dengan Foto Bukti Penerimaan PPDB 2020.</p>\r\n\r\n<p><span style=\"font-family:open sans,lucida grande,georgia,arial,sans-serif\">Demikian atas perhatiannya Orang Tua / Wali Murid&nbsp;Penerimaan Peserta Didik Baru 2020 disampaikan terima kasih.</span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><u><strong><span style=\"color:rgb(23, 23, 23); font-family:open sans,lucida grande,georgia,arial,sans-serif\">Keterangan :&nbsp;</span></strong></u></p>\r\n\r\n<p>1. Pengisian Data Siswa, Paling Akhir pada, Hari : Selasa, 30 Juni 2020</p>\r\n\r\n<p>2. Untuk Informasi tentang PPDB 2020 yang Berkaitan dengan Daftar Ulang (TAHAP 2) akan di Umumkan Lebih Lanjut.</p>', 1, 0, NULL, 'ad1b0721e941f48c148f0e121f349018.png', 0, NULL, 3463),
(61, 'Tata Tertib dan Surat Pernyataan Sekolah PPDB 2020', '2020-06-19', 'pengumuman', '<p><span style=\"color:rgb(23, 23, 23); font-size:12px\">epada,</span></p>\r\n\r\n<p><span style=\"color:rgb(23, 23, 23); font-size:12px\">Yth : Orang Tua / Wali Murid Siswa Baru</span></p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; SMA Negeri 3 Surabaya</p>\r\n\r\n<p>di&nbsp; &nbsp; Tempat</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Diberitahukan kepada Orang Tua / Wali Peserta Didik Baru (PPDB 2020) SMA Negeri 3 Surabaya, bahwa dalam rangka Penerimaan Peserta Didik Baru (PPDB) 2020, maka kami memerlukan data yang Benar dan Valid, untuk pengisian data siswa&nbsp;-&nbsp;Silakan Klik Link dibawah ini.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><a href=\"http://bit.ly/TATIBSMAN3-SURATPERNYATAAN-ANGKET\">http://bit.ly/TATIBSMAN3-SURATPERNYATAAN-ANGKET</a></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Password : SMAN3</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Tata Cara :</p>\r\n\r\n<p>1. Buka Chrome dan Masuk Web SMA Negeri 3 Surabaya, yaitu : sman3surabaya.sch.id</p>\r\n\r\n<p>2. Masuk Pengumuman - pilih &quot; Tata Tertib dan Surat Pernyataan Sekolah PPDB 2020&quot;</p>\r\n\r\n<p>3. Klik Link-nya : dia atas</p>\r\n\r\n<p>4. Stelah Link-nya terbuka masuk-kan passwordnya</p>\r\n\r\n<p>5. Stelah Surat Pernyataan dan Tatib Terbuka - File-nya di download dl (klik icon anak panah kebawah - posisi kanan atas)</p>\r\n\r\n<p>6. stelah file di download - di buka file-nya dan di isi dengan benar, lalu di cetak</p>\r\n\r\n<p>7. Terima Kasih</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style=\"color:rgb(23, 23, 23); font-family:open sans,lucida grande,georgia,arial,sans-serif\">Demikian atas perhatiannya Orang Tua / Wali Murid&nbsp;Penerimaan Peserta Didik Baru 2020 disampaikan terima kasih.</span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong><u>KETERANGAN :</u></strong></p>\r\n\r\n<p>1. Pengumpulan Berkas dimulai pada Hari : Senin - Selasa, 29 - 30 Juni 2020</p>\r\n\r\n<p>2. Untuk Informasi tentang PPDB 2020 yang Berkaitan dengan Daftar Ulang (TAHAP 2) akan di Umumkan Lebih Lanjut.</p>', 1, 0, NULL, 'ad1628c73d44021d66cf616fd41e1fb6.png', 0, NULL, 5251),
(62, 'Ralat Tes Penjurusan Sekolah Kelas X', '2020-07-04', 'pengumuman', '<p>Kepada</p>\r\n\r\n<p><span style=\"color:rgb(23, 23, 23); font-size:12px\">Yth : Orang Tua / Wali Murid Siswa Baru</span></p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; SMA Negeri 3 Surabaya</p>\r\n\r\n<p>di&nbsp; &nbsp; Tempat</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Diberitahukan kepada Orang Tua / Wali Peserta Didik Baru (PPDB 2020) SMA Negeri 3 Surabaya, bahwa dalam rangka Tes Penjurusan Siswa untuk semestara di <span style=\"font-size:20px\">TUNDA</span> menunggu informasi lebih lanjut dari Pihak Sekolah.</p>\r\n\r\n<p>Jadi di mohon Bapak / Ibu dan Siswa untuk selalu mengecek Web SMAN 3 Surabaya.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Terima Kasi.</p>\r\n\r\n<p>&nbsp;</p>', 1, 0, NULL, NULL, 0, NULL, 3050),
(63, 'Pengumuman Tes Penjurusan', '2020-07-10', 'pengumuman', '<p><strong>Kepada</strong></p>\r\n\r\n<p><strong>Yth : Orang Tua / Wali Murid Siswa Baru</strong></p>\r\n\r\n<p><strong>SMA Negeri 3 Surabaya</strong></p>\r\n\r\n<p><strong>di&nbsp; &nbsp; Tempat</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Diberitahukan kepada Peserta Didik Baru SMA Negeri 3 Surabaya, bahwa dalam rangka Pelaksanaan Tes Penjurusan Peserta Didik Baru kelas 10 akan diselenggarakan berdasarkan jadwal berikut.</p>\r\n\r\n<p>KLIK LINK DI BAWAH INI UNTUK JADWAL PELAKSANAAN</p>\r\n\r\n<p><span style=\"font-size:16px\"><a href=\"https://tinyurl.com/jadwal-pelaksanaan\">https://tinyurl.com/jadwal-pelaksanaan</a></span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Pelaksanaan Ujian Penjurusan akan dilaksanakan dalam 2 sesi. Untuk mengetahui SESI diharapkan siswa membuka link dibawah ini (terlampir).</p>\r\n\r\n<p>KLIK LINK DI BAWAH INI UNTUK KARTU UJIAN</p>\r\n\r\n<p><span style=\"font-size:16px\"><a href=\"https://tinyurl.com/kartupeserta\">https://tinyurl.com/kartupeserta</a></span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Untuk tahapan atau cara mengikuti pelaksanaan ujian dapat dilihat pada link berikut</p>\r\n\r\n<p>KLIK LINK DI BAWAH INI UNTUK TAHAPAN PELAKSANAAN UJIAN</p>\r\n\r\n<p><span style=\"font-size:16px\"><a href=\"https://tinyurl.com/tahap-pelaksanaan\">https://tinyurl.com/tahap-pelaksanaan</a></span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Dimohon Orang Tua / Wali Peserta Didik selalu mengingatkan siswa untuk pelaksanaan Ujian Penjurusan. Selain itu Informasi tentang Kegiatan Sekolah lainnya akan di informasikan lebih lanjut melalui WEBSITE SMA Negeri 3 Surabaya.</p>\r\n\r\n<p><strong>Terima kasih atas perhatian dan kerjasamanya.</strong></p>', 1, 0, NULL, '6fb167104d21490446afeaf2ff47d93b.png', 0, NULL, 6877),
(64, 'Contact Person', '2020-07-10', 'pengumuman', '<p>Kepada</p>\r\n\r\n<p>Yth : Orang Tua / Wali Murid Siswa Baru</p>\r\n\r\n<p>SMA Negeri 3 Surabaya</p>\r\n\r\n<p>di&nbsp; &nbsp; Tempat</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Diberitahukan kepada Orang Tua / Wali Peserta Didik baru SMA Negeri 3 Surabaya untuk memberitahukan kepada putra-putrinya yang namanya tercantum dibawah ini, agar segera menghubungi salah satu Pengurus Osis SMA Negeri 3 Surabaya untuk melakukan koordinasi berkaitan dengan kegiatan Penjurusan dan Kegiatan MPLS.<br />\r\nberikut nama-nama dari Peserta Didik Tersebut :</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 1. MUHAMMAD&nbsp;WILDAN&nbsp;PRADANA&nbsp;PUTRA</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 2. KHARISMA WIRATNA</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 3. ACHMED NAZRIEL LESMONO</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 4. AMELIA BULAN CAHYATI</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 5. NAFLAH SALSABILA FIYANTO</p>\r\n\r\n<p><strong>Cp. Pengurus Osis : 082301667844</strong></p>\r\n\r\n<p>Dimohon Orang tua / wali dan peserta didik untuk selalu mengecek Website SMA Negeri 3 Surabaya, Terima kasih atas perhatian.</p>', 1, 0, NULL, 'cea2741ca1fb86657ffb0902f3a8843d.png', 0, NULL, 2865),
(65, 'JADWAL DARING SISWA SMAN 3 SBY - Tahun Pelajaran 2020/2021', '2020-07-18', 'pengumuman', '<p><span style=\"font-size:14px\"><strong>Kepada</strong></span></p>\r\n\r\n<p><span style=\"font-size:14px\"><strong>Yth : Orang Tua / Wali Murid Kelas X, XI, dan XII</strong></span></p>\r\n\r\n<p><span style=\"font-size:14px\"><strong>SMA Negeri 3 Surabaya</strong></span></p>\r\n\r\n<p><span style=\"font-size:14px\"><strong>di&nbsp; &nbsp; Tempat</strong></span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:14px\">Diberitahukan kepada Peserta Didik Baru SMA Negeri 3 Surabaya, bahwa dalam rangka Pelaksanaan Kegiatan Belajar Mengajar (KBM) selama Pandemi Covid-19 ini, maka sistem <strong>KBM akan dilaksanakan secara DARING</strong>, maka dari itu kami lampirkan Jadwal Daring SMA Negeri 3 Surabaya - Tahun Pelajaran 2020/2021.</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:14px\">KLIK LINK DI BAWAH INI UNTUK JADWAL DARING SMAN 3 SBY.</span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style=\"font-size:16px\"><a href=\"https://drive.google.com/file/d/1GEvOOSuTDnk8jNMs54dNyPPsTX_-5EaV/view?usp=sharing\">https://drive.google.com/file/d/1GEvOOSuTDnk8jNMs54dNyPPsTX_-5EaV/view?usp=sharing</a></span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-family:open sans,lucida grande,georgia,arial,sans-serif\">Dimohon kepada&nbsp;Orang Tua / Wali Peserta Didik&nbsp; dan para siswa smua, Kelas X, XI dan XII, agar selalu mengecek jadwal Daring setiap saat, atau dicetak dan ditempelkan agar selalu ingat Jadwal Daring SMAN 3 SBY&nbsp;.</span></p>\r\n\r\n<p style=\"text-align:justify\">&nbsp;</p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:18px\"><strong><span style=\"font-family:open sans,lucida grande,georgia,arial,sans-serif\">UNTUK PENGUMUMAN HASIL TES PENJURUSAN SISWA BARU, akan di umumkan pada&nbsp;</span></strong></span><span style=\"font-size:18px\"><strong><span style=\"font-family:open sans,lucida grande,georgia,arial,sans-serif\">Hari : Senin, 20 Juli 2020.&nbsp;</span></strong></span></p>\r\n\r\n<p style=\"text-align:justify\">&nbsp;</p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-family:open sans,lucida grande,georgia,arial,sans-serif\">Selain itu Informasi tentang Kegiatan Sekolah lainnya akan di informasikan lebih lanjut melalui WEBSITE SMA Negeri 3 Surabaya.</span></p>\r\n\r\n<p style=\"text-align:justify\">&nbsp;</p>\r\n\r\n<p><span style=\"font-family:open sans,lucida grande,georgia,arial,sans-serif\">TERIMA KASIH.</span></p>', 1, 0, NULL, NULL, 0, NULL, 4771),
