(73, 'Pembagian Rapot dan Informasi Sistem Seleksi Masuk PTN (Klas XII)', '2020-12-17', 'pengumuman', '<p><span style=\"color:rgb(23, 23, 23); font-size:14px\"><strong>Kepada</strong></span></p>\r\n\r\n<p><span style=\"color:rgb(23, 23, 23); font-size:14px\"><strong>Yth : Orang Tua / Wali Murid Kelas X, XI, &amp; XII</strong></span></p>\r\n\r\n<p><span style=\"color:rgb(23, 23, 23); font-size:14px\"><strong>SMA Negeri 3 Surabaya</strong></span></p>\r\n\r\n<p><span style=\"color:rgb(23, 23, 23); font-size:14px\"><strong>di&nbsp; &nbsp;Tempat</strong></span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"color:rgb(23, 23, 23); font-size:14px\">Diberitahukan kepada Peserta Didik Baru SMA Negeri 3 Surabaya, bahwa dalam rangka Pembagian Nilai Rapot Semester 1 (Ganjil) akan dibagikan secara online melalui Wali Kelas masing - masing, guna mencegah&nbsp;penyebaran Covid - 19. di Khusus-kan Bagi Siswa Kelas XII dan Orang Tua, berikut kami kirimkan Link Program Kerja Siswa Kelas XII, Mohon Bapak Ibu Orang Tua Siswa Kelas XII ;</span></p>\r\n\r\n<p style=\"text-align:justify\">&nbsp;</p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"color:rgb(23, 23, 23); font-size:14px\">KLIK LINK DI BAWAH INI UNTUK&nbsp;</span><span style=\"font-size:14px\"><strong>PROGRAM KERJA KELAS XII</strong></span><span style=\"color:rgb(23, 23, 23); font-size:14px\">&nbsp;</span><span style=\"color:rgb(23, 23, 23); font-size:14px\">- SMAN 3 SBY.</span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong><span style=\"font-size:20px\"><span style=\"font-family:tahoma,geneva,sans-serif\"><a href=\"https://drive.google.com/file/d/1oTaMGg49IX3DpTC4OzLVxhWykCKnnPb-/view?usp=sharing\">https://drive.google.com/file/d/1oTaMGg49IX3DpTC4OzLVxhWykCKnnPb-/view?usp=sharing</a></span></span></strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"color:rgb(23, 23, 23); font-size:14px\">KLIK LINK DI BAWAH INI UNTUK&nbsp;</span><span style=\"font-size:16px\"><strong>Informasi Sistem Seleksi Masuk PTN Tahun 2021 KELAS XII</strong></span><span style=\"color:rgb(23, 23, 23); font-size:14px\">&nbsp;</span><span style=\"color:rgb(23, 23, 23); font-size:14px\">- SMAN 3 SBY.</span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong><span style=\"font-size:20px\"><a href=\"https://drive.google.com/file/d/1dBxWfRcngRU1_ex1mYYTUGrtvIQf35XU/view?usp=sharing\">https://drive.google.com/file/d/1dBxWfRcngRU1_ex1mYYTUGrtvIQf35XU/view?usp=sharing</a></span></strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:14px\"><span style=\"color:rgb(23, 23, 23); font-family:open sans,lucida grande,georgia,arial,sans-serif\">Atas perhatian dan kerjasamanya Bapak / Ibu Wali Murid dan semua siswa Kelas X, XI, dan XII&nbsp;&nbsp;kami ucapkan terima kasih .</span></span></p>\r\n\r\n<p style=\"text-align:justify\">&nbsp;</p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"color:rgb(23, 23, 23); font-family:open sans,lucida grande,georgia,arial,sans-serif\">Selain itu Informasi tentang Kegiatan Sekolah lainnya akan di informasikan lebih lanjut melalui WEBSITE SMA Negeri 3 Surabaya.</span></p>\r\n\r\n<p style=\"text-align:justify\">&nbsp;</p>\r\n\r\n<p><span style=\"color:rgb(23, 23, 23); font-family:open sans,lucida grande,georgia,arial,sans-serif\">TERIMA KASIH.</span></p>', 1, 0, NULL, NULL, 0, NULL, 1982),
(74, 'PPDB 2021 - SMA NEGERI 3 SURABAYA', '2021-04-19', 'pengumuman', '<p>SAMBUTAN&nbsp;</p>\r\n\r\n<p>Sebagai salah satu penanggung jawab pembangunan manusia di Jawa Timur, Dinas Pendidikan Provinsi Jawa Timur terus berupaya untuk meningkatkan kualitas pendidikan masyarakat. Untuk mempercepat pencapaian sasaran pembangunan pendidikan, Dinas Pendidikan Provinsi Jawa Timur telah melakukan banyak terobosan yang dilaksanakan secara menyeluruh dan berkesinambungan.</p>\r\n\r\n<p>Salah satu terobosan tersebut adalah Penerimaan Peserta Didik Baru (PPDB) jenjang SMA, SMK, dan SLB Negeri Provinsi Jawa Timur tahun pelajaran 2021/2022. Terobosan ini sejalan dengan amanah Undang-Undang Nomor 23 Tahun 2014 tentang Manajemen Pengelolaan SMA, SMK dan SLB Negeri yang menjadi kewenangan Pemerintah Provinsi Jawa Timur.</p>\r\n\r\n<p>Sistem seleksi PPDB dilaksanakan secara daring penuh dan cukup berbeda dengan pelaksanaan di tahun-tahun sebelumnya. Pelaksanaan ini bertujuan untuk mempermudah masyarakat agar tidak perlu keluar rumah guna mendaftar ke sekolah tujuan selama masa darurat penyebaran Corona Virus Disease (COVID-19) di Jawa Timur.</p>\r\n\r\n<p>Berikut Link - Ketentuan PPDB 2021 :&nbsp;<a href=\"https://drive.google.com/file/d/1sHsRMBDZyCL8WbzqKFCMpFXX-GIfpgJQ/view?usp=sharing\">https://drive.google.com/file/d/1sHsRMBDZyCL8WbzqKFCMpFXX-GIfpgJQ/view?usp=sharing</a></p>\r\n\r\n<p>Berikut Link - Tata Cara Pengambilan PIN PPDB 2021 :&nbsp;<a href=\"https://drive.google.com/file/d/1U-XXfloM_1x2OZ1utwx2UsMZX6IkNLeX/view?usp=sharing\">https://drive.google.com/file/d/1U-XXfloM_1x2OZ1utwx2UsMZX6IkNLeX/view?usp=sharing</a></p>\r\n\r\n<p>Berikut Link - Tata Cara Pendaftara PPDB 2021 :&nbsp;<a href=\"https://drive.google.com/file/d/1HVamytouG9h9rk8pe9kpMQOQETU7BWzI/view?usp=sharing\">https://drive.google.com/file/d/1HVamytouG9h9rk8pe9kpMQOQETU7BWzI/view?usp=sharing</a></p>\r\n\r\n<p>Berikut Link - Tata Cara Pemilihan Sekolah :&nbsp;<a href=\"https://drive.google.com/file/d/1kjVd4rzJPsjx-S-iNCtkPDu0ZdzfUJuv/view?usp=sharing\">https://drive.google.com/file/d/1kjVd4rzJPsjx-S-iNCtkPDu0ZdzfUJuv/view?usp=sharing</a></p>\r\n\r\n<p>Berikut Link - Kriteria Pemeringkatan Jalur PPDB 2021 :&nbsp;<a href=\"https://drive.google.com/file/d/15Xs0iBzzhajzIAgfyVm7kYP7AGIY_qG-/view?usp=sharing\">https://drive.google.com/file/d/15Xs0iBzzhajzIAgfyVm7kYP7AGIY_qG-/view?usp=sharing</a></p>\r\n\r\n<p>Besar harapan pelaksanaan PPDB di Provinsi Jawa Timur dapat berjalan dengan lancar dan sukses. Semoga ALLAH SWT memudahkan, Aamiiin.</p>\r\n\r\n<p>Terimakasih.</p>\r\n\r\n<p>&nbsp;</p>', 1, 0, NULL, '26fd3dee99dec9e1f679bf70387fd60a.jpg', 0, NULL, 3381),
(76, 'PENGUMUMAN KELULUSAN SISWA KELAS XII - Tahun Pelajaran 2020/2021', '2021-05-03', 'pengumuman', '<p style=\"text-align:center\">&nbsp;</p>\r\n\r\n<p style=\"text-align:center\">&nbsp;</p>\r\n\r\n<p style=\"text-align:center\">&nbsp;</p>\r\n\r\n<p style=\"text-align:center\">&nbsp;</p>\r\n\r\n<p style=\"text-align:center\"><span style=\"font-size:26px\">PENGUMUMAN</span></p>\r\n\r\n<p style=\"text-align:center\"><span style=\"font-size:26px\">KELULUSAN SMA NEGERI 3 SURABAYA</span></p>\r\n\r\n<p style=\"text-align:center\"><span style=\"font-size:26px\">TAHUN PELAJARAN 2020 / 2021</span></p>\r\n\r\n<p style=\"text-align:center\">&nbsp;</p>\r\n\r\n<p style=\"text-align:center\"><span style=\"font-size:24px\">KETERANGAN :</span></p>\r\n\r\n<p style=\"text-align:center\"><span style=\"font-size:24px\">JUMLAH 350 SISWA KELAS XII &quot;<strong>LULUS 100%</strong>&quot;</span></p>\r\n\r\n<p>&nbsp;</p>', 1, 0, NULL, '3238a93d54809c6e4fbac357a1950bd2.jpg', 0, NULL, 2899),
(78, 'Berkibar Darma Wanita SMAN 3 Surabaya', '2021-06-08', 'post', '<p style=\"text-align: justify;\">Sejarah Dharma Wanita Persatuan berawal pada 5 Agustus 1974 saat organisasi para Isteri Pegawai Republik Indonesia pada masa Pemrintahan Orde Baru itu dibentuk dengan nama Dharma Wanita. Organisasi ini didirikan oleh Ketua Dewan Pembina KORPRI saat itu, Amir Machmud, atas prakarsa Ibu Tien Soeharto sebagai Ibu Negara, pada waktu itu Dharma Wanita beranggotakan para Istri Pegawai Republik Indonesia, Anggota ABRI yang dikaryakan dan Pegawai BUMN.</p>\r\n\r\n<p style=\"text-align: justify;\">Pada Era Reformasi tahun 1998, organisasi wanita ini melakukan perubahan mendasar, tidak ada lagi muatan politik dari Pemerintah. Dharma Wanita menjadi organisasi sosial kemasyarakatan yang netral dari politik, Independen dan Demokrasi</p>\r\n\r\n<p style=\"text-align: justify;\">Nama Dharma Wanita kemudian berubah menjadi Dharma Wanita Persatuan, penambahan kata &ldquo;Persatuan&rdquo; disesuaikan dengan nama Kabinet Persatuan Nasional dibawah kepemimpinan Presiden Abdurrahman Wahid. Perubahan organisasi ini tidak terbatas pada penambahan kata Persatuan namun juga berubah menjadi organisasi yang mandiri dan Demokrasi.</p>\r\n\r\n<p style=\"text-align: justify;\">Pada Munas Luar Biasa (Munaslub) Dharma Wanita yang diselenggarakan pada tanggal 6 &ndash; 7 Desember 1999, seluruh rancangan Anggaran Dasar disahkan dan menetapkan Ketua Umum Dharma Wanita Persatuan terpilih, Ny. Dr. Nila F. Moeloek. Pokok-pokok perubahan organisasi Dharma Wanita yang ditetapkan pada Munaslub antara lain :</p>\r\n\r\n<ol>\r\n	<li>Nama organisasi&nbsp;&nbsp; berubah&nbsp;&nbsp; menjadi&nbsp;&nbsp; Dharma&nbsp;&nbsp; Wanita Persatuan;</li>\r\n	<li>Istilah Istri Pegawai Republik Indonesia diganti menjadi Istri Pegawai Negeri Sipil Republik Indonesia;</li>\r\n	<li>Penegasan sebagai organisasi sosial kemasyarakatan yang bergerak dibidang Pendidikan, Ekonomi dan Sosial Budaya</li>\r\n	<li>Penegasan sebagai organisasi non politik;</li>\r\n	<li>Penerapan demokrasi dalam organisasi dalam organisasi (Ketua Umum dan Ketua pada Unsur Pelaksana dipilih secara Demokrasi).</li>\r\n</ol>\r\n\r\n<p style=\"text-align: justify;\">Sebagai salah satu organisasi masyarakat (ormas) perempuan terbesar di Indonesia, sudah selayaknya Dharma Wanita Persatuan memiliki&nbsp;<em>Standing Position&nbsp;</em>dan mengambil peran strategis dalam konstalasi pembangunan nasional, sebagaimana ormas lainnya, Dharma Wanita Persatuan memiliki peluang untuk berkiprah lebih luas dengan mengoptimalisasikan peran sertanya sebagaimana yang diatur pada pasal 5 Undang-undang Nomor 17 Tahun 2013 Tentang Organisasi Kemasyrakatan, (&ldquo;UU No.17 Th. 2013&rdquo;) yang menyebutkan bahwa pembentukan ormas bertujuan :</p>\r\n\r\n<ol>\r\n	<li>Meningkatkan partisipasi dan keberdayaan masyarakat;</li>\r\n	<li>Memberikan pelayanan kepada masyarakat;</li>\r\n	<li>Menjaga nilai agama dan kepercayaan terhadap Tuhan Yang Maha Esa;</li>\r\n	<li>Melestarikan dan memelihara norma, nilai, moral, etika dan budaya yang hidup dalam masyarakat;</li>\r\n	<li>Melestarikan sumber daya alam dan lingkungan hidup;</li>\r\n	<li>Mengembangkan kesetiakawanan&nbsp; sosial,&nbsp; gotong&nbsp; royong dan bertoleransi dalam kehidupan bermasyarakat;</li>\r\n</ol>\r\n\r\n<p>&nbsp;</p>', 1, 0, 1, 'e96334f3b6e8d515cb149d9e13574425.jpeg', 0, 'berkibar-darma-wanita-sman-3-surabaya', 3473),
(79, 'PENGUMUMAN DAFTAR ULANG PPDB 2021 - SMA NEGERI 3 SURABAYA', '2021-06-19', 'pengumuman', '<p style=\"text-align:justify\"><span style=\"font-size:16px\"><span style=\"font-family:times new roman,times,serif\">Sehubungan semakin tinggi / meningkat kasus virus Covid-19, untuk menghindari kerumunan massa dan di takutkan menambah cluster baru, maka dengan ini Pengumuman Daftar Ulang PPDB 2021 ini, diatur sesuai dengan Jalur yang siswa pilih, dan Loket Daftar Ulang diatur sesuai dengan Huruf Depan Nama Siswa sesuai dengan SESI dan Jam daftar Ulang, untuk lebih jelasnya bisa melihat link dibawah ini ;</span></span></p>\r\n\r\n<p style=\"text-align:justify\">&nbsp;</p>\r\n\r\n<p style=\"text-align: center;\"><span style=\"font-size:20px\"><a href=\"https://drive.google.com/file/d/1OKjxTYhIBUbzytSu3ou8beyWv8fwE9Kl/view?usp=sharing\">https://drive.google.com/file/d/1OKjxTYhIBUbzytSu3ou8beyWv8fwE9Kl/view?usp=sharing</a></span></p>\r\n\r\n<p style=\"text-align:justify\">&nbsp;</p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px\"><span style=\"font-family:times new roman,times,serif\">Berikut beberapa Berkas yang Wajib dibawah Orang Tua Wali Murid dan Siswa Baru :</span></span></p>\r\n\r\n<p><span style=\"font-size:16px\"><strong><span style=\"font-family:times new roman,times,serif\">1. Bukti Penerimaan Siswa</span></strong></span></p>\r\n\r\n<p><span style=\"font-size:16px\"><strong><span style=\"font-family:times new roman,times,serif\">2. Surat Keterangan Lulus dari SMP yang bersangkutan (SKL SMP)</span></strong></span></p>\r\n\r\n<p><span style=\"font-size:16px\"><strong><span style=\"font-family:times new roman,times,serif\">3. Fotocopy Rapot dari Semester - 1&nbsp; s.d.&nbsp; Semester 5.</span></strong></span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style=\"font-size:16px\"><span style=\"font-family:times new roman,times,serif\">Mohon kepada semua wali murid dan siswa, menaaati aturan sesuai yang Jadwal diatas.</span></span></p>\r\n\r\n<p><span style=\"font-size:16px\"><span style=\"font-family:times new roman,times,serif\">Jangan Lupa : Selalu memakai MASKER, Selalu Cuci Tangan sebelum masuk di wilayah sekolah, dan Selalu Menjaga Jarak.&nbsp;</span></span></p>\r\n\r\n<p><span style=\"font-size:16px\"><span style=\"font-family:times new roman,times,serif\">Terima Kasih ................. Tetap Sehat dan Selalu Sehat.</span></span></p>\r\n\r\n<p>&nbsp;</p>', 1, 0, NULL, '4146b8427efa4f2ab8e8a3fe15999ac3.JPG', 0, NULL, 2423),
(91, 'TEST PENJURUSAN PEMINATAN KLAS X 2021 - SMA NEGERI 3 SURABAYA', '2021-06-24', 'post', '<p style=\"text-align: justify;\">Kepada</p>\r\n\r\n<p style=\"text-align: justify;\">Yth. Bapak Ibu Wali Murid Siswa Kelas X</p>\r\n\r\n<p style=\"text-align: justify;\">di&nbsp; &nbsp;-&nbsp;</p>\r\n\r\n<p style=\"text-align: justify;\">&nbsp; &nbsp; &nbsp;Tempat</p>\r\n\r\n<p style=\"text-align: justify;\">&nbsp;</p>\r\n\r\n<p style=\"text-align: justify;\">Sehubungan dengan pembentukan Jurusan (MIPA, IPS, &amp; Bahasa) maka dengan ini SMA Negeri 3 Surabaya mengadakan Test Penjurusan Peminatan. Test Peminatan ini dibagi menjadi 2 hari yaitu 50% Jumlah Siswa kelas X dan 1 ruang maksimal terisi 17 siswa, mengingat Wajib Mentaati Protokol Kesehatan yang telah dihimbau oleh pemerintah.&nbsp;</p>\r\n\r\n<p style=\"text-align: justify;\">Pada Saat Siswa datang ke sekolah WAJIB : Memakai Masker, Membawa Hand Sanitiser, Mencuci Tangan di tempat yang telah disediakan setiap saat, dan Menjaga Jarak minimal 1,5 meter. serta siswa datang ke sekolah 30 menit sebelum pelaksanaan dimulai.</p>\r\n\r\n<p style=\"text-align: justify;\">Siswa diperkenankan memakai baju yang rapi dan bersepatu, TIDAK BOLEH memakai Kaos Oblong dan Bersandal.</p>\r\n\r\n<p style=\"text-align: justify;\">Demikian pemberitahuan ini, atas perhatian dan kerjasamanya kami ucapkan terima kasih.</p>\r\n\r\n<p style=\"text-align: justify;\">&nbsp;</p>', 1, 0, 1, '73ef1dabac376d4cf00ef86ba899425a.JPG', 0, 'test-penjurusan-peminatan-klas-x-2021-sma-negeri-3-surabaya', 3901),
(105, 'Sekolah Tatap Muka SMAN 3 Surabaya - Januari 2022', '2022-01-19', 'sekilas_info', 'Januari 2022, Sekolah Tatap Muka mulai berlaku. Hal ini, didasarkan pada penerbitan Surat Keputusan Bersama (SKB) 4 Menteri terbaru tentang Panduan Penyelenggaraan Pembelajaran di Masa Pandemi Coronavirus Disease 2019 (Covid-19). Dalam SKB terbaru, satuan pendidikan wajib menggelar Pembelajaran Tatap Muka (PTM) terbatas. Sehingga, semua satuan pendidikan pada level 1,2 dan 3 pada PPKM wajib melaksanakan PTM terbatas, Pemda tidak boleh melarang PTM terbatas bagi yang memenuhi kriteria dan tidak boleh menambahkan kriteria yang lebih berat. \r\nPengaturan kapasitas peserta didik dan durasi pembelajaran dalam penyelenggaraan PTM terbatas diatur berdasarkan cakupan vaksinasi dosis 2 pendidik dan tenaga kependidikan masing-masing satuan pendidikan. Termasuk vaksinasi warga masyarakat lansia di tingkat kabupaten/kota, dikecualikan bagi satuan pendidikan pada daerah khusus karena kondisi geografis sesuai Kepmendikbud 160/p/2021. \r\nOrangtua atau wali peserta didik dapat memilih PTM terbatas atau Pembelajaran Jarak Jauh (PJJ) bagi anaknya sampai semester satu tahun ajaran/tahun akademik 2021/2022 berakhir. Satuan pendidikan yang terbukti melanggar protokol kesehatan diberikan sanksi administratif dan dibina oleh satgas penanganan Covid 19 atau tim pembina UKS. \r\nAturan PTM terbatas sesuai \r\n\r\nPPKM PPKM Level 1-2 \r\n1.	Satuan pendidikan dengan capaian vaksinasi dosis2 pada pendidik dan tenaga kependidikan di atas 80 persen dan capaian vaksinasi dosis 2 pada warga masyarakat lansia di atas 50 persen dan peserta didik sesuai ketentuan peraturan perundang-undangan di tingkat kabupaten/kota, pembelajaran tatap muka dilaksanakan: \r\na.	Setiap hari \r\nb.	Jumlah peserta didik 100 persen dari kapasitas ruang kelas \r\nc.	Lama belajar paling banyak 6 (enam) jam pelajaran per hari \r\n\r\n2.	Satuan pendidikan dengan capaian vaksinasi dosis 2 pada pendidik dan tenaga kependidikan sebanyak 50 persen sampai dengan 80 persen dan capaian vaksinasi dosis 2 pada warga masyarakat lansia sebanyak 40-50 persen dan peserta didik sesuai ketentuan peraturan perundang-undangan di tingkat kabupaten/kota, pembelajaran tatap muka dilaksanakan: \r\na.	Setiap hari secara bergantian; \r\nb.	Jumlah peserta didik 50 persen dari kapasitas ruang kelas \r\nc.	Lama belajar paling banyak 6 jam pelajaran per hari \r\n\r\n3.	Satuan pendidikan dengan capaian vaksinasi dosis 2 pada pendidik dan tenaga kependidikan di bawah 50 persen dan capaian vaksinasi dosis 2 pada warga masyarakat lansia di bawah 40 persen di tingkat kabupaten/kota, pembelajaran tatap muka dilaksanakan: \r\na.	Setiap hari secara bergantian \r\nb.	Jumlah peserta didik 50 persen dari kapasitas ruang kelas \r\nc.	Lama belajar paling banyak 4 jam pelajaran per hari. \r\n\r\nPPKM Level 3 \r\n1.	Satuan pendidikan dengan capaian vaksinasi dosis 2 pada pendidik dan tenaga kependidikan paling sedikit 40 persen dan capaian vaksinasi dosis 2 pada warga masyarakat lansia paling sedikit 10 persen di tingkat kabupaten/kota, pembelajaran tatap muka terbatas dilaksanakan: \r\na.	Setiap hari secara bergantian \r\nb.	Jumlah peserta didik 50 persen dari kapasitas ruang kelas \r\nc.	Lama belajar paling banyak 4 jam pelajaran per hari.\r\n2.	Satuan pendidikan dengan capaian vaksinasi dosis 2 pada pendidik dan tenaga kependidikan di bawah 40 persen dan capaian vaksinasi dosis 2 pada warga masyarakat lansia di bawah 10 persen di tingkat kabupaten/kota, dilaksanakan pembelajaran jarak jauh.\r\n\r\nPPKM Level 4 \r\nSatuan pendidikan yang berada pada PPKM level 4, dilaksanakan pembelajaran jarak jauh. \r\n\r\nDaerah khusus 3 T \r\nSatuan pendidikan yang berada pada daerah 3 T dilaksanakan pembelajaran tatap muka dengan kapasitas 100 persen dengan jam belajar maksimal 6 jam. Namun, dalam aturan tersebut ada tiga aktivitas yang diatur ketat. Antara lain kantin, pedagang sekitar institusi dan olahraga serta ekstrakurikuler.\r\n1.	Kantin belum diperbolehkan beroperasi.\r\n2.	Pedagang yang berada di luar gerbang di sekitar lingkungan satuan pendidikan diatur oleh satuan tugas penanganan Covid 19 wilayah setempat bekerja sama dengan satuan tugas penanganan Covid 19 pada satuan pendidikan.\r\n3.	Kegiatan olahraga dan ekstrakurikuler di dalam dan di luar ruangan dilaksanakan sesuai dengan pengaturan pembelajaran di ruang kelas. Pemberhentian PTM terbatas sementara Penghentian sementara PTM terbatas di satuan pendidikan sekurang-kurangnya 14x24 jam apabila terjadi: \r\na.	Klaster penularan Covid 19 di satuan pendidikan tersebut.\r\nb.	Angka positivity rate hasil ACF diatas 5 persen.\r\nc.	Warga satuan pendidikan yang masuk dalam notifikasi kasus hitam diatas 5 persen. Apabila setelah dilakukan survelans, bukan merupakan klaster PTM terbatas atau angka positivity di bawah 5 persen, PTM terbatas hanya diberhentikan pada kelompok belajar yang terdapat kasus konfirmasi dan atau kontak erat Covid 19 selama 5x24 jam.', 1, 0, NULL, NULL, 0, NULL, 1884),
(106, 'Pemilihan Putra dan Putri SMA Negeri 3 Surabaya', '2022-03-27', 'post', '<p style=\"text-align:center\">Ajang Menemukan Panutan Teman Sebaya</p>\r\n\r\n<p style=\"text-align:justify\">Putra-Putri Sekolah merupakan ajang pemilihan untuk mencari pasangan peserta didik yang akan menjadi duta atau lambang sekolah. Ajang ini memang bukan hal yang baru dilakukan di berbagai sekolah. Hampir setiap tahun ajang bergengsi ini diselenggarakan oleh sekolah. Begitu juga SMA Negeri 3 Surabaya.</p>\r\n\r\n<p style=\"text-align:justify\">Kegiatan pemilihan putra-putri sekolah tahun ini masih tetap digawangi oleh OSIS/ MPK dengan tajuk 3B : Brain, Behavior, Beauty. Diharapkan, duta atau lambang yang terpilih adalah pasangan peserta didik yang memiliki keelokan yang terpancar dari dalam. Dengan demikian putra-putri smaga yang terpilih bisa membawa nama baik SMA Negeri 3 Surabaya melalui keelokan karakternya dan keelokan berpikirnya (kreatif, kritis, dan berwawasan luas).</p>\r\n\r\n<p style=\"text-align:justify\">Serangkaian seleksi telah dilakukan sejak Januari sampai Maret 2022 yang meliputi pendaftaran, seleksi awal, semi final hingga final. Serangkaian kegitan tersebut ada yang dilakukan secara daring, ada pula yang dilakukan secara luring.</p>\r\n\r\n<p style=\"text-align:justify\">Peserta yang mengikuti seleksi tersebut merupakan perwakilan kelas X dan XI yang telah melewati serangkaian tes akademik, wawasan nusantara serta kepribadian melalui wawancara.</p>\r\n\r\n<p style=\"text-align:justify\">Tahap awal masing-masing pasangan calon (paslon) Putra-Putri SMAGA memaparkan identitas diri dan alasan mengapa mereka mengikuti pemilihan Putra-Putri SMAGA. Peserta yang lolos selanjutnya harus mengikuti tes tahap dua.</p>\r\n\r\n<p style=\"text-align:justify\">Pada tahap kedua, masing-masing Paslon mendapat tantangan untuk menguji kecerdasan berfikir maupun kecerdasan berperilaku (Brain, Behavior, Beauty ) mereka. Tantangannya adalah para paslon harus mampu memaparkan pendapat, argumen, serta solusi terhadap suatu permasalahan. Tahap dua ini dilakukan untuk menjaring delapan paslon yang akan lanjut di tahap tiga.</p>\r\n\r\n<p style=\"text-align:justify\">Sedangkan tahap tiga atau semi final, masing-masing paslon dituntut untuk memaparkan karakteristik daerah yang ada di Indonesia. Penguasaan materi, kecerdasan bertutur (Public Speaking) dan kekompakan merupakan kriteria utama dalam penilaian. Selain itu, keterampilan mereka dalam menggunakan media juga merupakan poin tambahan dalam penilaian. Tahap tiga diharapkan dapat menemukan tiga paslon yang tidak hanya mampu berpikir kritis dan berwawasan luas, juga kreatif. Tiga paslon inilah yang akan maju di tahap final.&nbsp;</p>\r\n\r\n<p style=\"text-align:justify\">Pada tahap final, paslon dituntun memiliki kepercayaan diri yang kuat saat tampil di muka umum. Hal tersebut harus mereka buktikan pada acara fesyen yang merupakan bagian dari serangkaian seleksi Putra-Putri SMAGA. Pada puncak acara ini mereka kembali harus diuji keelokan paripurna mereka (3B: Brain, Behavior, Beauty). Para paslon kembali saling beradu keterampilan berpikir kritis mereka terhadap persoalan yang terkini. Persoalan disampaikan acak oleh juri terpilih. Kecepatan, ketepatan, serta kekritisan jawaban menjadi poin dalam penilaian.</p>\r\n\r\n<p style=\"text-align:justify\">&nbsp;Akhirnya, dinobatkan Haza Pratama (X MIPA 5) dan Joana Adrey (XI MIPA 3) sebagai Putra Putri SMAGA. M. Al Parsya Hakim perwakilan kelas XI MIPA 3 yang berpasangan dengan Prasita Keizha dari kelas XI MIPA1, mendapat peringkat kedua. Sedangkan, juara ketiga diraih oleh pasangan perwakilan kelas X MIPA3, Bagas Ariyoga dan Nanda Aliefira.</p>\r\n\r\n<p style=\"text-align:justify\">Demikian serangkaian acara pemilihan Putra dan Putri SMAGA. Semua warga SMA Negeri 3 berharap peserta didik yang terpilih sebagai Putra dan Putri SMAGA mampu memberikan motivasi dan panutan (role model) bagi teman-temannya, serta menjadi pelopor yang dapat membawa SMA Negeri 3 Surabaya ke arah yang lebih baik lagi.</p>\r\n\r\n<p style=\"text-align:center\">HUMAS SMAGA&nbsp;</p>', 1, 0, 1, '6e4dcc74c297c95dae2ea03475855955.jpg', 0, 'pemilihan-putra-dan-putri-sma-negeri-3-surabaya', 10318),
(107, 'PTM 100 % di SMA Negeri 3 Surabaya', '2022-03-27', 'pengumuman', '<p>Assalamu&#39;alaikum Wr. Wb</p>\r\n\r\n<p>Selamat Pagi.</p>\r\n\r\n<p style=\"text-align:justify\">Yth. Bapak/Ibu Guru/ Pegawai/Karyawan SMAN 3 Surabaya.</p>\r\n\r\n<p style=\"text-align:justify\">Menyingkapi Inmendagri tanggal 21 Maret 2022, bahwa&nbsp; Surabaya sudah masuk level 1, sehingga mulai Hari Senin Tanggal 28 Maret 2022 siswa kelas X dan XI PTM 100%, Maka berlaku hal berikut:</p>\r\n\r\n<p style=\"text-align:justify\">1.&nbsp; Jam kerja (datang-pulang) sesuai peraturan perundang-undangan&nbsp; dan presensi kehadiran WFO</p>\r\n\r\n<p style=\"text-align:justify\">&nbsp;2.&nbsp; Guru/Pegawai/Karyawan dan siswa Tetap harus mematuhi PROKES&nbsp;</p>\r\n\r\n<p style=\"text-align:justify\">&nbsp;3. Bagi Guru/Pegawai dan siswa yang berhalangan hadir ke Sekolah&nbsp; dikarenakan sakit maka wajib menyertakan surat keterangan&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;resmi&nbsp; dari Dokter</p>\r\n\r\n<p style=\"text-align:justify\">&nbsp; Sekian pemberiatuan ini untuk diperhatikan.</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Ttd. Waka Humas</p>', 1, 0, NULL, '7e18af67d0ca2af8c701f1ce0a46c77c.jpg', 0, NULL, 1185),
(108, 'PENERIMAAN RAPOR TENGAH SEMESTER GENAP SMAN 3 SURABAYA  TAHUN PELAJARAN 2021-2022', '2022-04-03', 'post', '<p>Kamis, 31 Maret 2022 merupakan hari yang mungkin ditunggu-tunggu oleh sebagian peserta didik SMAN 3 Surabaya. Hari itu sedang dilaksanakan penerimaan rapor tengah semester untuk kelas X dan XI. Ini merupakan waktu yang pas untuk berbenah diri dalam menghadapi penilaian akhir tahun yang akan segera mereka hadapi. Pengambilan Rapor Tengah Semester Genap&nbsp; ditujukan kepada orang tua/wali peserta didik. Ketegangan terlihat dari raut wajah orang tua maupun peserta didik. Rasa cemas dan was-was akan hasil pencapaian belajar tampak di raut wajah mereka.</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Penerimaan rapor tersebut dibagi menjadi dua sesi, yaitu: sesi pertama pukul 08.00-09.30 diawali kelas X dan sesi kedua pukul 10.00-11.30 WIB untuk kelas XI. Berbagai pengarahan berkaitan hasil belajar serta info pembelajaran di awal puasa juga disampaikan pada kesempatan tersebut. Tak sedikit orang tua yang &lsquo;curhat&rsquo; berkaitan permasalahan putra-putrinya karena mendapatkan hasil belajar yang kurang memuaskan. Ada juga orang tua dengan senyum yang mengembang di sepanjang penerimaan rapor dikarenakan putra-putrinya mendapatkan hasil yang memuaskan. Apapun hasil yang telah didapatkan semoga tidak menjadikan besar hati atas hasil bagus yang telah didapat, juga tidak menjadi kecil hati atas hasil yang kurang memuaskan.&nbsp;</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Sebagai tindak lanjut dari penerimaan rapor tersebut, peserta didik diberi waktu satu minggu untuk perbaikan nilai. Pada dasarnya rapor tengah semester ini dijadikan pengingat serta kontrol apabila dalam semester genap ini masih ada nilai tugas maupun penilaian harian yang masih kurang optimal. Harapannya hasil rapor semester genap kedepannya nanti bisa maksimal sehingga dapat dijadikan pertimbangan dalam kenaikan jenjang berikutnya.</p>', 1, 0, 2, '5b8dc1a6a68c3a6c6f9a9674d16c0765.jpg', 0, 'penerimaan-rapor-tengah-semester-genap-sman-3-surabaya-tahun-pelajaran-2021-2022', 2878),
(109, 'Workshop Kurikulum Merdeka  - Sebuah Upaya Membangun SMAGA Menjadi Lebih Baik', '2022-04-08', 'pengumuman', '<p>&nbsp;</p>\r\n\r\n<p style=\"text-align: justify;\">Seperti pepatah mengatakan tidak ada yang abadi di dunia selain perubahan. Begitu juga dengan dunia pendidikan di Indonesia. Dinamika perubahan kurikulum di Indonesia nyatanya sudah mengalami pergantian setidaknya sepuluh kali sejak merdeka hingga saat ini. Bahkan, kabar terbaru saat ini pemerintah sudah mendesain kurikulum baru yang digadang-gadang menjadi kurikulum yang memerdekakan siswanya. Sesuai dengan namanya, Kurikulum Merdeka esensinya adalah menyajikan pembelajaran yang dapat mengakomodir semua modalitas belajar siswa (visual, audiotori dan kinestetik). Untuk merespon adanya perubahan kurikulum tersebut, maka SMA Negeri 3 Surabaya mengadakan Workhop dengan materi &ldquo;Sosialisasi Kurikulum Merdeka&rdquo;. Workshop tersebut disampaikan oleh pemateri jebolan program pemerintah Guru Penggerak yaitu: Bapak Theo Gunawan Wahana, S.S., M.Pd dan Bapak Aries Afandri, S.Pd.</p>\r\n\r\n<p style=\"text-align: justify;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Kegiatan workhop Kurikulum Merdeka ini dilaksanakan selama dua hari yaitu 4-5 April 2022 yang bertepatan dengan awal ramadan. Berdasarkan pemaparan dari pemateri, perubahan kurikulum tersebut mengikuti alur substansi kurikulum yang berubah disesuaikan dengan perkembangan zaman. Kurikulum merdeka juga tidak lepas dari filosofi Bapak Pendidikan Indonesia yaitu Ki Hajar Dewantara yaitu: &lsquo;<em>Ing Ngarsa Sung Tulada, Ing Madya Mangun Karsa, Tut Wuri Handayani</em>&rsquo;. Semboyan tersebut pada akhirnya bertujuan untuk mencetak manusia yang beriman dan berkualitas dengan pendidikan yang menghamba ke anak atau sesuai dengan kebutuhan anak.</p>\r\n\r\n<p style=\"text-align: justify;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Ada perbedaan Kurikulum Merdeka dengan kurikulum sebelumnya. Pada kurikulum sebelumnya terdapat jenjang SD, SMP, SMA dari Kelas 1 sampai Kelas 12, maka dalam Kurikulum Merdeka tingkatan tersebut dikelompokkan menjadi Fase A-F. Fase A untuk Kelas 1-2 SD, Fase B untuk Kelas 3-4 SD, Fase C untuk Kelas 5-6 SD, Fase D untuk Kelas 7-9 SMP, Fase E untuk Kelas 10 SMA, dan Fase F untuk Kelas 11-12 SMA. Setiap Fase memiliki Capaian Pembelajaran (CP) sesuai dengan kompetensi dan ruang lingkup masing-masing. Capaian Pembelajaran ini dalam kurikulum 2013 hampir mirip dengan Kompetensi Inti dan Kompetensi Dasar (KI/KD). Tidak lupa dalam menghasilkan generasi yang beriman dan berkualitas maka dalam Kurikulum Merdeka ini wajib menyisipkan &lsquo;Profil Pelajar Pancasila&rsquo; yaitu: beriman dan berakhlak mulia, berkhebinnekaan global, gotong royong, mandiri, bernalar kritis, dan kreatif.</p>\r\n\r\n<p style=\"text-align: justify;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Kurikulum Merdeka ini memberikan paradigma baru yaitu sekolah bukan pabrik yang dapat mencetak siswa sesuai dengan keinginan guru atas nama kurikulum. Setiap siswa memiliki keunikan masing-masing. Setiap siswa bisa mengeksplor bakat dan minat mereka sesuai dengan modalitas belajar mereka (visual, auditori, dan kinestetik). Untuk itu setiap guru harus memahami dan memberikan pembelajaran yang terdiferensiasi yaitu pembelajaran yang mengakomodasi semua perbedaan siswa. Harapannya, siswa bisa lebih optimal dalam belajar karena disesuaikan dengan karakteristik masing-masing.</p>', 1, 0, NULL, 'ca643861e5df3ed7d5c83568ed82dd7b.jpg', 0, NULL, 1333);
