(110, 'SMAGA Berbagi  Berkah Takjil dalam Bulan Ramadhan', '2022-04-23', 'post', '<p style=\"text-align: justify;\">Di bulan Suci yang penuh berkah, Ramadhan merupakan bulan penuh berkah. Inilah saat yang tepat untuk terus meningkatkan amal dan perbuatan dalam hal kebaikan dengan mengharapkan pahala dan ridho-Nya karena dibulan Ramadan ini setiap amal dan perbuatan yang sesuai dengan tuntunan&nbsp; Rasul akan digandakan nilai pahalanya. Oleh karenanya, tak heran jika setiap muslim akan semakin meningkatkan amal ibadah mereka &ndash; baik yang wajib maupun yang sunnah.</p>\r\n\r\n<p style=\"text-align: justify;\">Hal ini seperti yang dikatakan oleh Rasulullah shallallahu &lsquo;alaihi wa sallam yang bersabda, &ldquo;Siapa yang memberi makan orang yang berpuasa, maka baginya pahala seperti orang yang berpuasa tersebut, tanpa mengurangi pahala orang yang berpuasa itu sedikit pun juga.&rdquo; <em>(HR. Tirmidzi no. 80, Ibnu Majah no.1764, dan Ahmad 5:192. Al-Hafizh Abu Thahir mengatakan bahwa hadits ini shahih).</em></p>\r\n\r\n<p style=\"text-align: justify;\">Pada bulan Ramadhan ada banyak amalan yang bisa dilakukan oleh muslim untuk mendapatkan pahala yang berlimpah. Ibadah puasa dilakukan pada Ramadhan, puasa diwajibkan kepada seluruh umat Islam yang sudah baligh dan memenuhi syarat. Bulan Ramadhan bukan tentang puasa Ramadan saja, tapi di dalamnya umat Islam dianjurkan untuk memperbanyak amalan-amalan sunnah lainnya.&nbsp;</p>\r\n\r\n<p style=\"text-align: justify;\">Keutamaan bulan Ramadhan lainnya adalah Syahrun Mubarak atau bulan penuh keberkahan. Pada bulan ini semua jenis amalan baik akan dilipat gandakan pahalanya.</p>\r\n\r\n<p style=\"text-align: justify;\">Pada hari Jum&rsquo;at tanggal 22 April 2022&nbsp;SMA Negeri 3 Surabaya tidak mau kalah, gabungan dari anggota Dharma Wanita Persatuan(DWP), siswa Sie Kerohanian Islam dan Pramuka bersatu padu mengisi Ramadhan dengan berbagi Takjil.</p>\r\n\r\n<p style=\"text-align: justify;\">Kegiatan ini diselenggarakan serentak dalam satu tempat, yakni di SPBU Kedung Cowek, pelaksanaan dimulai pada pukul 16.00 WIB, dan diakhiri dengan berbuka &nbsp;Bersama dengan ibu lurah di Kantor&nbsp; kelurahan Bulak. Semoga kegiatan ini mendapat&nbsp; Ridho Allah SWT dan memberi manfaat kepada masyarakat muslim&nbsp;umumnya.</p>', 1, 0, 2, 'eb93aa4481153d097317f68e6f15ac6a.jpg', 0, 'smaga-berbagi-berkah-takjil-dalam-bulan-ramadhan', 2647),
(111, 'PENGUMUMAN KELULUSAN SISWA KELAS XII - Tahun Pelajaran 2021/2022', '2022-05-05', 'pengumuman', '<p><span style=\"background-color:rgb(243, 244, 245); font-family:source sans pro,sans-serif; font-size:14px\">&nbsp;&nbsp; &nbsp; PENGUMUMAN KELULUSAN SMA NEGERI 3 SURABAYA TAHUN PELAJARAN 2021&nbsp;/ 2022&nbsp;&nbsp; KETERANGAN : JUMLAH 339&nbsp;SISWA KELAS XII &quot;LULUS 100%&quot;</span></p>', 1, 0, NULL, '28fece228ea5e4cfb9ac97c8dff0fa8b.png', 0, NULL, 2354),
(112, 'Momen Haru Pelepasan Kelas 12 SMA Negeri 3 Surabaya Tahun Pelajaran 2021-2022', '2022-05-13', 'post', '<p style=\"text-align:center\">&nbsp;</p>\r\n\r\n<p style=\"text-align:justify\">Selasa, 10 Mei 2022 merupakan hari yang istimewa bagi &nbsp;peserta didik kelas 12 SMAN 3 Surabaya. Hari itu adalah&nbsp; hari pelepasan&nbsp; mereka sebagai peserta didik di Smagabaya.Tidak terasa tiga tahun penuh suka-duka telah mereka lalui. Pembelajaran secara daring/luring juga melengkapi warna-warni masa putih abu-abu mereka. Momen pelepasan yang dilaksanakan penuh khidmat dalam Gedung Convention Hall, Keputih Surabaya ini menjadi saksi bahwa Bapak/Ibu guru SMAN 3 Surabaya dengan doa dan harapan melepas peserta didik kelas 12 menuju jenjang berikutnya.</p>\r\n\r\n<p style=\"text-align:justify\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Prosesi kirab wisuda yang dibuka dengan formasi dari pasukan pengibar bendera (Paskib) semakin membuat momen pelepasan lebih sakral. Serangkaian acara ini dimulai dari prosesi kirab, pengalungan tanda lulus (Gordon), penganugerahan peserta didik berprestasi hingga pengembalian peserta didik kepada orang tua secara simbolis. Berdasarkan nilai tertinggi penggabungan ujian EHB_USP BKS, penganugerahan peserta didik berprestasi diraih oleh: Eagan Guinter Pattirane untuk Program Bahasa, Nabilah Ayu Ash-shidiqi untuk Program MIPA, dan Laurence Benedicta Rugian untuk Program IPS.</p>\r\n\r\n<p style=\"text-align:justify\">Wisuda dengan tema &ldquo;Teruslah Belajar dan Berkarya untuk Bangsa&rdquo; ini menandakan bahwa momen wisuda bukan merupakan akhir dari perjuangan. Selepas ini mereka akan menemui kehidupan yang sebenarnya. Ada yang melanjutkan studi ke jenjang yang lebih tinggi dan ada juga yang fokus mengejar cita-cita di jalan mereka masing-masing. Beberapa dari mereka sudah diterima di perguruan tinggi negeri melalui jalur undangan dan ada juga yang tengah mempersiapkan diri untuk menempuh jalur tes. Tidak sedikit juga yang sudah mantap melatih fisik dan psikis mereka untuk menjadi prajurit TNI maupun POLRI dan ada juga yang memilih profesi lain.</p>\r\n\r\n<p style=\"text-align:justify\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Perasaan bangga sekaligus haru nampak terlihat dari wajah para wisudawan. Bangga karena telah bekerja keras menuntaskan serangkaian ujian dengan hasil yang terbaik. Namun, tidak bisa dipungkiri ada perasaan sedih karena harus berpisah dengan teman-teman seperjuangan yang telah mewarnai tiga tahun perjuangan di SMAN 3 Surabaya. Momen perpisahan ini menjadi pintu awal menuju tanggung jawab yang lebih besar lagi. Apapun jalan yang mereka pilih, doa terbaik Bapak/Ibu guru selalu mengiringi untuk kesuksesan mereka.</p>', 1, 0, 2, '0261690d9d61c5caefd30c394c9587c6.jpg', 0, 'momen-haru-pelepasan-kelas-12-sma-negeri-3-surabaya-tahun-pelajaran-2021-2022', 3085),
(113, 'Visi Misi SMA Negeri 3 Surabaya (Kurikulum Merdeka)', '2022-06-22', 'pengumuman', '<p><strong>VISI SMA NEGERI 3 SURABAYA KURIKULUM MERDEKA</strong></p>\r\n\r\n<p>Terwujudnya sekolah unggul, berkarakter, peduli lingkungan, berwawasan nasional dan global berlandaskan keimanan dan ketaqwaan.</p>\r\n\r\n<p>Indikator visi SMA Negeri 3 Surabaya:</p>\r\n\r\n<ol>\r\n	<li>Memiliki budi pekerti dan akhlaq mulia</li>\r\n	<li>Bersikap kritis, kreatif, komunikatif dan kolaboratif , dan berwawasan luas</li>\r\n	<li>Membudidayakan rasa cinta terhadap budaya membaca dan menulis dimanapun berada</li>\r\n	<li>Memiliki rasa kemandirian belajar dan suka berorganisasi</li>\r\n	<li>Menghargai kebhinekaan budaya nasional</li>\r\n	<li>Membudayakan pengurangan sampah di lingkungan sekolah dan di luar sekolah</li>\r\n</ol>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>MISI SMA NEGERI 3 SURABAYA KURIKULUM MERDEKA</strong></p>\r\n\r\n<p>Untuk mencapai visi dan membentuk Karakter Profil Pelajar Pancasila, maka SMA Negeri 3 Surabaya menciptakan misi sebagai berikut:</p>\r\n\r\n<ol>\r\n	<li>Membentuk peserta didik yang beriman, bertanggung jawab dan bertaqwa kepada Tuhan Yang Maha Esa</li>\r\n	<li>Mewujudkan lulusan yang unggul dalam bidang akademik dan non akademik</li>\r\n	<li>Mengembangkan karakter peserta didik untuk cinta tanah air</li>\r\n	<li>Meningkatkan budaya literasi</li>\r\n	<li>Mengikuti Pendidikan dan atau pelatihan yang relevan dengan mata pelajaran yang diampu untuk dapat meningkatkan kualitas pengetahuan, keterampilan dan wawasan guru agar lebih profesional</li>\r\n	<li>Mewujudkan pendidikan yang mengedepankan pembentukan Profil Pelajar Pancasila baik untuk guru maupun siswa</li>\r\n</ol>\r\n\r\n<ol style=\"list-style-type:lower-alpha\">\r\n	<li>Melaksanakan proyek Profil Pelajar Pancasila untuk seluruh peserta didik</li>\r\n	<li>Mengintegrasikan nilai Profil Pelajar Pancasila dalam perencanaan pembelajaran, pelaksanaan pembelajaran, dan penilaian</li>\r\n</ol>\r\n\r\n<ol>\r\n	<li>Memfasilitasi pembelajaran dengan mengedepankan persamaan hak</li>\r\n	<li>Membimbing pelajar menghasilkan suatu karya ilmiah yang dapat dipertanggung jawabkan dan tepat guna</li>\r\n</ol>\r\n\r\n<p>Meningkatkan pembelajaran yang dapat mengembangkan peserta didik yang unggul dalam ilmu pengetahuan dan teknologi dengan memanfaatkan kemajuan teknologi informasi</p>', 1, 0, NULL, '744348f88d01e59650152f82216def54.png', 0, NULL, 19021),
(114, 'Pengumuman Daftar Ulang Peserta Didik Baru', '2022-07-05', 'pengumuman', '<p style=\"text-align:center\">&nbsp;</p>\r\n\r\n<p style=\"text-align:center\">&nbsp;</p>\r\n\r\n<p style=\"text-align:center\">&nbsp;</p>\r\n\r\n<p style=\"text-align:center\">&nbsp;</p>\r\n\r\n<p style=\"text-align:center\">&nbsp;</p>\r\n\r\n<p style=\"text-align:center\">&nbsp;</p>\r\n\r\n<p style=\"text-align:center\"><strong>Pengumuman</strong></p>\r\n\r\n<p style=\"text-align:center\">Daftar ulang Calon Peserta Didik Baru</p>\r\n\r\n<p style=\"text-align:center\">Hari: Kamis-Jum&rsquo;at</p>\r\n\r\n<p style=\"text-align:center\">Tanggal:7-8 Juli 2022</p>\r\n\r\n<p style=\"text-align:center\">Waktu : 07.30 WIB- Selesai</p>\r\n\r\n<p style=\"text-align:center\">Tempat : SMAN 3 Surabaya</p>\r\n\r\n<p style=\"text-align:center\">Catatan : 1. wajib membawa cetak bukti penerimaan</p>\r\n\r\n<p style=\"text-align:center\">2. Mematuhi protocol kesehatan</p>', 1, 0, NULL, 'aaa36d704d76022e346f60324e5c30e6.png', 0, NULL, 1568),
(115, 'PABRASGA SABET TIGA PIALA DALAM LKBB COMANDO II 2022', '2022-07-09', 'prestasi_sekolah', 'PABRASGA SABET TIGA PIALA DALAM LKBB COMANDO II 2022\r\n\r\n	Prestasi membanggakan kembali diukir  oleh Pasukan Pengibar Bendera  SMAN 3 (Pabrasga) dalam even paskibra LKBB COMANDO II 2022 yang diselenggarakan oleh Universitas Adi Buana Surabaya. Lomba bergengsi tingkat provinsi ini dilaksanakan pada hari Minggu, 3 Juli 2022 di lapangan Universitas Adi Buana Surabaya. Pada kompetisi tersebut, pasukan Smaga mengirim satu pleton yang dikomandani oleh Dyanti Rahayu Ningtyas (X MIPA 5) dan 15 anggota lainnya. Dengan gagah dan penuh percaya diri akhirnya mereka berhasil menyabet tiga piala sekaligus yaitu: Juara 1 Utama, Best PBB, dan Best Formasi Variasi tingkat SMA/K sederajat se-Provinsi Jawa Timur.\r\n	Pencapaian tersebut berkat latihan dengan giat oleh tim Pabrasga di bawah bimbingan sang pelatih ekskul paskib, Pak Sakti. Even yang seharusnya dilaksanakan pada bulan Mei ini sempat ditunda dan baru terlaksana 3 Juli 2022. Penundaan tersebut tidak membuat Pabrasga bermalas-malasan. sebaliknya, mereka semakin mengencangkan sabuk semangat dalam berlatih sehingga di event LKBB COMANDO II 2022 ini mereka kembali dapat menorehkan prestasi . Sebelumnya Pabrasga telah menyabet  juara dalam beberapa even di antaranya: Juara Madya 2 dalam LKBB Janur SMAN 17 Surabaya tingkat Nusantara yang dilaksanakan secara virtual pada 19 September 2021, Juara Harapan 1 dalam LKBB SAHARA MAN Kota Surabaya tingkat Jawa Timur secara virtual yang dilaksanakan pada 12 Februari 2022, Juara Madya 2 dalam LKBB Hormat SMA Sejahtera Surabaya tingkat Jawa Timur yang dilaksanakan di SMA Sejahtera pada 13 Maret 2022. \r\n	Ekstrakurikuler Paskibra Smaga di bawah pembina Bapak Agus Setiadi, S.Pd ini semakin memberikan warna dalam menorehkan prestasi bagi nama besar Smaga. Bagi Smaga, prestasi ini cukup membanggakan karena semua peserta Pabrasga yang mengikuti lomba adalah siswa kelas X. Mereka tetap berusaha secara maksimal dan perjuangan mereka terbayar dengan menyabet tiga piala sekaligus.\r\n Berikut nama-nama peserta Pabrasga yang mengikuti event LKBB COMANDO II 2022, yaitu:\r\n1.	Dyanti Rahayu Ningtyas (X MIPA 5, Danton)\r\n2.	Novia Farah Harwati (X MIPA 3)\r\n3.	Imas Cahya Ningrum (X MIPA 3)\r\n4.	Alcanin Laana Anbiya (X MIPA 3)\r\n5.	Shafa Aulia Rahmadhani (X MIPA 3)\r\n6.	Marsha Azzahra Ramadhania (X MIPA 4)\r\n7.	Zahra Arijah Salsabila (X MIPA 4)\r\n8.	Amira Dzakiyyah Khairunnisa (X MIPA 4)\r\n9.	Khofifah Naila Masruroh (X MIPA 4)\r\n10.	Dwi Ferianto Hamzah (X MIPA 4)\r\n11.	Rivaldo Eka Pratama (X MIPA 4)\r\n12.	Hanny Angel Iriene Adellia (X MIPA 5)\r\n13.	Danu Maryanto Putra (X MIPA 5)\r\n14.	Irma Anggun Firnanda Santri (X MIPA 6)\r\n15.	Moch. Haqqul Yaqin Alif Riadi (X MIPA 6)\r\n16.	Aby Yovan Listianto (X IPS 1)\r\n\r\nAsisten Pelatih:\r\n1.	Christian Alexander Andries (XI MIPA 4)\r\n2.	Aisyah Wahyu Ardhani (XI MIPA 2)', 1, 0, NULL, '6eb2cda41fe4d14a50d8440c0e295ea0.png', 0, NULL, 6),
(116, 'PABRASGA SABET TIGA PIALA DALAM LKBB COMANDO II 2022', '2022-07-09', 'pengumuman', '<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Prestasi membanggakan kembali diukir &nbsp;oleh Pasukan Pengibar Bendera &nbsp;SMAN 3 (Pabrasga) dalam even paskibra &ldquo;LKBB COMANDO II 2022&rdquo; yang diselenggarakan oleh Universitas Adi Buana Surabaya. Lomba bergengsi tingkat provinsi ini dilaksanakan pada hari Minggu, 3 Juli 2022 di lapangan Universitas Adi Buana Surabaya. Pada kompetisi tersebut, pasukan Smaga mengirim satu pleton yang dikomandani oleh Dyanti Rahayu Ningtyas (X MIPA 5) dan 15 anggota lainnya. Dengan gagah dan penuh percaya diri akhirnya mereka berhasil menyabet tiga piala sekaligus yaitu: <strong>Juara 1 Utama, Best PBB, dan Best Formasi Variasi</strong> tingkat SMA/K sederajat se-Provinsi Jawa Timur.</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Pencapaian tersebut berkat latihan dengan giat oleh tim Pabrasga di bawah bimbingan sang pelatih ekskul paskib, Pak Sakti. Even yang seharusnya dilaksanakan pada bulan Mei ini sempat ditunda dan baru terlaksana 3 Juli 2022. Penundaan tersebut tidak membuat Pabrasga bermalas-malasan. sebaliknya, mereka semakin mengencangkan sabuk semangat dalam berlatih sehingga di event LKBB COMANDO II 2022 ini mereka kembali dapat menorehkan prestasi . Sebelumnya Pabrasga telah menyabet&nbsp; juara dalam beberapa even di antaranya: Juara Madya 2 dalam LKBB Janur SMAN 17 Surabaya tingkat Nusantara yang dilaksanakan secara virtual pada 19 September 2021, Juara Harapan 1 dalam LKBB SAHARA MAN Kota Surabaya tingkat Jawa Timur secara virtual yang dilaksanakan pada 12 Februari 2022, Juara Madya 2 dalam LKBB Hormat SMA Sejahtera Surabaya tingkat Jawa Timur yang dilaksanakan di SMA Sejahtera pada 13 Maret 2022.</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Ekstrakurikuler Paskibra Smaga di bawah pembina