(117, 'Merah Putih Berkibar dengan Gagah di Langit SMAGA dalam Peringatan  Kemerdekaan ke 77 RI', '2022-08-22', 'pengumuman', '<p style=\"text-align: justify;\">Perngatan detik-detik proklamasi 17 Agustus 2022 merupakan hari yang istimewa bagi bangsa Indonesia. Berbagai lomba digelar sebelum peringatan Hari Kemerdekaan Republik Indonesia. Serangkaian kegiatan lomba&nbsp; diadakan &nbsp;di berbagai tempat, sekolah, dan instansi. . Begitu juga dengan SMA Negeri 3 Surabaya. Setelah dua tahun kita tidak menyelenggarakan berbagai kegiatan dan kemeriahan akhirnya tahun ini kita bersyukur kehadirat Allah karena bisa melaksanakan upacara seperti tahun-tahun sebelumnya/</p>\r\n\r\n<p style=\"text-align: justify;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Pada upacara kali ini, SMAN 3 Surabaya berkesempatan menjadi tuan rumah dalam upacara bendera dalam Peringatan Kemerdekaan ke -77 RI. Peserta upacara berasal &nbsp;dari berbagai pihak se- Kecamatan Bulak. Mereka adalah perwakilan dari SMPN 18 Surabaya, SMPN 54 Surabaya, pihak Kelurahan Kedung Cowek, Kelurahan Bulak, Kecamatan Bulak, KUA Bulak, Polsek Kenjeran-Bulak, Koramil Bulak, dan&nbsp; Satpol PP. Pejabat dan petugas upacara pun berasal dari&nbsp; perwakilan&nbsp; instansi tersebut.</p>\r\n\r\n<p style=\"text-align: justify;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Persiapan ekstra dilakukan khususnya dari tim Paskibra dan Paduan Suara SMAN 3 Surabaya agar bisa menyajikan penampilan yang terbaik pada upacara peringatan Kemerdekaan ke-77 Republik Indonesia. Letih dalam latihan tersebut terbayar dengan berkibarnya bendera merah putih dengan gagah dalam upacara bendera peringatan kemerdekaan ke-77 RI.</p>\r\n\r\n<p style=\"text-align: justify;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Upacara bendera dalam peringatan kemerdekaan ke-77 RI ini merupakan salah satu bentuk manifestasi kita dalam mencintai tanah air. Tanpa adanya perjuangan para pejuang, kita tidak akan bisa melakukan aktivitas dengan nyaman seperti saat ini. Kemerdekaan ini merupakan anugrah yang patut kita syukuri. Mari terus kita pertegas jati diri kita sebagai bangsa yang besar dengan mencintai &nbsp;tanah air kita , Indonesia.</p>', 1, 0, NULL, '665f04bf8a6e9fcff702ff6c5ad44a51.jpg', 0, NULL, 1235),
(118, 'Sang Jawara P5 SMAGA dalam Momentum Peringatan Hari Pahlawan  10 November 2022', '2022-11-11', 'prestasi_siswa', 'Proyek Penguatan Profil Pelajar Pancasila atau yang lebih akrab disebut P5 merupakan salah satu program khas dari kurikulum merdeka belajar. Kurikulum yang digadang-gadang sebagai konsep pendidikan yang sesuai dengan filsafat Ki Hadjar Dewantara ini memiliki dua konsep penting, yaitu kemerdekaan dan kemandirian. Konsep ini memberikan keleluasaan bagi sekolah untuk mendesain pembelajaran melalui kegiatan proyek sehingga mampu memberikan kesempatan bagi peserta didik untuk aktif dan mengeksplorasi kreativitas mereka sesuai dengan tema dalam proyek tersebut.\r\n	SMA Negeri 3 Surabaya menyambut baik kurikulum merdeka belajar tersebut yang saat ini berlaku bagi kelas X atau dalam kurikulum merdeka berada pada fase E. Setidaknya terdapat tiga tema proyek yang harus dilakukan dalam setahun. Untuk tema pertama, Berekayasa dan Berteknologi untuk Membangun NKRI dengan topik merancang karya dan narasi digital adalah tema yang dirasa paling relevan untuk mengawali P5 ini. Proyek pada tema ini diharapkan mampu mengeksplorasi kreativitas peserta didik untuk membuat sebuah inovasi dengan memaksimalkan teknologi yang diharapkan mampu dikembangkan di kehidupan sehari-hari. \r\n	Proyek pertama ini sudah berlangsung dari bulan Juli hingga akhir Oktober 2022. Serangkaian kegiatan proyek mulai dari materi, penyusunan proposal, pembuatan video dokumentasi  hingga presentasi produk sudah tuntas dilakukan semua. Tibalah momentum Hari Pahlawan 10 November 2022  yang dipilih untuk mengumumkan para jawara proyek pada tema 1 ini. Terdapat dua katagori juara dalam tema ini, yaitu: juara produk terbaik dan juara video favorit berdasarkan banyaknya viewers. Semua video yang terpilih  telah diunggah dalam akun resmi youtube SMAGA.\r\n	Berbagai karya luar biasa dapat dihasilkan dari proyek ini. Dari beberapa karya terbaik tersebut terpilihlah empat produk yang memiliki skor paling tinggi. Fan Automatic Sensor dari kelas X-6 merupakan juara 1 produk terbaik pada tema ini. Disusul oleh Charger Portabel Panel Surya dari kelas X-12 menjadi juara 2. Selanjutnya terdapat dua produk yang mendapat poin sama sehingga untuk juara 3 yang pertama diraih oleh produk dengan judul Sistem Operasi Vending Machine dari kelas X-10 dan Dispenser Sederhana dari kelas X-10 menjadi juara 3 yang kedua. Sedangkan juara video favorit 1 diraih oleh kelas X-4 dengan judul Penyiram Tanaman Otomatis. Juara video favorit 2 diraih kelas X-12 dengan judul Powerbank Panel Surya dan juara video favorit 3 diraih oleh kelas X-10 dengan judul Perangkap Nyamuk Otomatis.\r\n	Hasil refleksi pada proyek tema 1 ini dapat dikatakan bagus dan mampu memunculkan kreativitas peserta didik untuk membuat berbagai karya yang luar biasa. Hal tersebut juga senada dengan yang disampaikan oleh  Kepala SMAN 3 Surabaya, Drs. Moh. Zainuri, M.Si dalam penyerahan piala juara P5 pada peringatan Hari Pahlawan 10 November 2022. Hasil karya kalian semua sangat luar biasa dan ternyata melampaui ekspektasi saya. Teruslah berkarya dan kembangkan kreativitas kalian di proyek-proyek berikutnya, tuturnya.', 1, 0, NULL, '99c1d305833f2b05bc00111d7d9eea20.jpg', 0, NULL, 3),
(119, 'Sang Jawara P5 SMAGA dalam Momentum Peringatan Hari Pahlawan  10 November 2022', '2022-11-11', 'pengumuman', '<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Proyek Penguatan Profil Pelajar Pancasila atau yang lebih akrab disebut P5 merupakan salah satu program khas dari kurikulum merdeka belajar. Kurikulum yang digadang-gadang sebagai konsep pendidikan yang sesuai dengan filsafat Ki Hadjar Dewantara ini memiliki dua konsep penting, yaitu &ldquo;kemerdekaan&rdquo; dan &ldquo;kemandirian&rdquo;. Konsep ini memberikan keleluasaan bagi sekolah untuk mendesain pembelajaran melalui kegiatan proyek sehingga mampu memberikan kesempatan bagi peserta didik untuk aktif dan mengeksplorasi kreativitas mereka sesuai dengan tema dalam proyek tersebut.</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; SMA Negeri 3 Surabaya menyambut baik kurikulum merdeka belajar tersebut yang saat ini berlaku bagi kelas X atau dalam kurikulum merdeka berada pada fase E. Setidaknya terdapat tiga tema proyek yang harus dilakukan dalam setahun. Untuk tema pertama, &ldquo;Berekayasa dan Berteknologi untuk Membangun NKRI&rdquo; dengan topik merancang karya dan narasi digital adalah tema yang dirasa paling relevan untuk mengawali P5 ini. Proyek pada tema ini diharapkan mampu mengeksplorasi kreativitas peserta didik untuk membuat sebuah inovasi dengan memaksimalkan teknologi yang diharapkan mampu dikembangkan di kehidupan sehari-hari.</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Proyek pertama ini sudah berlangsung dari bulan Juli hingga akhir Oktober 2022. Serangkaian kegiatan proyek mulai dari materi, penyusunan proposal, pembuatan video dokumentasi &nbsp;hingga presentasi produk sudah tuntas dilakukan semua. Tibalah momentum Hari Pahlawan 10 November 2022&nbsp; yang dipilih untuk mengumumkan para jawara proyek pada tema 1 ini. Terdapat dua katagori juara dalam tema ini, yaitu: juara produk terbaik dan juara video favorit berdasarkan banyaknya &lsquo;<em>viewers</em>&rsquo;. Semua video yang terpilih&nbsp; telah diunggah dalam akun resmi youtube SMAGA.</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Berbagai karya luar biasa dapat dihasilkan dari proyek ini. Dari beberapa karya terbaik tersebut terpilihlah empat produk yang memiliki skor paling tinggi. <em>Fan Automatic Sensor</em> dari kelas X-6 merupakan juara 1 produk terbaik pada tema ini. Disusul oleh Charger Portabel Panel Surya dari kelas X-12 menjadi juara 2. Selanjutnya terdapat dua produk yang mendapat poin sama sehingga untuk juara 3 yang pertama diraih oleh produk dengan judul Sistem Operasi <em>Vending Machine </em>dari kelas X-10 dan Dispenser Sederhana dari kelas X-10 menjadi juara 3 yang kedua. Sedangkan juara video favorit 1 diraih oleh kelas X-4 dengan judul Penyiram Tanaman Otomatis. Juara video favorit 2 diraih kelas X-12 dengan judul Powerbank Panel Surya dan juara video favorit 3 diraih oleh kelas X-10 dengan judul Perangkap Nyamuk Otomatis.</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Hasil refleksi pada proyek tema 1 ini dapat dikatakan bagus dan mampu memunculkan kreativitas peserta didik untuk membuat berbagai karya yang luar biasa. Hal tersebut juga senada dengan yang disampaikan oleh &nbsp;Kepala SMAN 3 Surabaya, Drs. Moh. Zainuri, M.Si dalam penyerahan piala juara P5 pada peringatan Hari Pahlawan 10 November 2022. &ldquo;Hasil karya kalian semua sangat luar biasa dan ternyata melampaui ekspektasi saya. Teruslah berkarya dan kembangkan kreativitas kalian di proyek-proyek berikutnya&rdquo;, tuturnya.</p>', 1, 0, NULL, '449c8ac11b27d9e3f8e2210df37018b8.jpg', 0, NULL, 1725),
(120, 'Semarak Pesta Demokrasi dalam Pemilihan OSIS/MPK 2022-2023 SMAN 3 Surabaya', '2022-11-15', 'pengumuman', '<p>Organisasi Siswa Intra Sekolah (OSIS) merupakan organisasi resmi sekolah yang dapat mewadahi aspirasi peserta didik untuk aktif berkontribusi di sekolah. Memasuki masa akhir kepengurusan OSIS dan MPK 2021-2022, sudah semestinya tongkat estafet kepengurusan harus segera diserahkan kepada generasi di bawahnya. Merespon hal tersebut, Smaga juga merayakan miniatur demokrasi tersebut dengan mengadakan pemilihan OSIS/MPK.</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Bertepatan dengan peringatan Hari Pahlawan 10 November 2022 Smaga merayakan pesta demokrasi dalam pemilihan OSIS/MPK. Terdapat dua paslon (pasangan calon) ketua dan wakil OSIS maupun MPK yang sebelumnya sudah memaparkan visi, misi ,dan rencana program kerja. Beberapa tanggapan dari audiens juga sudah mengisi sesi tanya jawab pada orasi visi-misi yang telah disampaikan pada Senin, 7 November 2022. Paslon 1 untuk OSIS yaitu: Elsa Duwi Lamhot Siagian dari kelas XI MIPA 6 dan Lathifatun Niswah dari kelas XI MIPA 5. Untuk paslon 2 yaitu: Allayl Rizqi Mufidah dari kelas XI MIPA 1 dan M. Haqqul Yaqin dari kelas XI MIPA 6. Sementara itu untuk paslon 1 MPK yaitu: Marsha Azzahra Ramadhania dari kelas XI MIPA 4 dan Elsa Olivia Sianturi dari kelas XI MIPA 1. Dan paslon 2 yaitu: Imas Cahya Ningrum dari kelas XI MIPA 3 dan Amanda Nuzulul Rahma dari kelas XI MIPA 2.</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Seluruh peserta didik beserta guru turut berpartisipasi dalam menentukan ketua dan wakil OSIS/MPK masa bakti 2022-2023. Ruang aula sekolah yang dijadikan panggung di desain layaknya pemilu pada umumnya. Secara bergiliran, baik guru maupun peserta didik diarahkan untuk menuju bilik suara dan menentukan pilihan dengan mencoblos kartu suara sesuai dengan pilihannya masing-masing. Setelah itu, para pemilih diharuskan untuk membubuhkan tinta di jari kanan sebagai bukti bahwa mereka telah berpartisipasi dalam pemilu OSIS/MPK.</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;Hasil akhir penghitungan suara menyatakan untuk paslon 1 OSIS yakni: Elsa dan Niswah memperoleh suara lebih unggul dibanding paslon 2. Begitu juga untuk MPK, perolehan suara paslon 1 yakni: Marsha dan Elsa juga lebih unggul dibanding kandidat lawan pada paslon 2. Hasil tersebut menandakan tongkat estafet telah bergeser kepada Elsa dan Niswah sebagai ketua dan wakil OSIS, sedangkan Marsha dan Elsa sebagai ketua dan wakil MPK. Harapannya OSIS/MPK periode 2022-2023 ini mampu membawa angin segar perubahan bagi kemajuan SMAN 3 Surabaya menjadi lebih baik lagi.</p>', 1, 0, NULL, 'a5bccaa510beb6b4b2a9c25657329e10.JPG', 0, NULL, 1645),
(121, 'PERINGATAN KE-77 HARI GURU NASIONAL DI SMA NEGERI 3 SURABAYA', '2022-11-26', 'pengumuman', '<p>Hari Guru merupakan hari istimewa untuk mengakui peran seorang guru dalam kehidupan siswa-siswinya. Sebagai penghormatan kepada guru, pemerintah Republik Indonesia melalui Keputusan Presiden Nomor 78 Tahun 1994 menetapkan tanggal 25 November selain sebagai HUT PGRI juga sebagai Hari Guru Nasional. Tema Hari Guru Nasional tahun ini adalah &ldquo;Serentak Berinovasi Wujudkan Merdeka Belajar&rdquo;.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Peringatan Hari Guru kali ini berbeda dari tahun sebelumnya karena sudah melewati masa pandemi. Pembelajaran pada masa pandemi dilaksanakan secara daring Sedangkan saat ini sistem pembelajaran sudah tatap muka secara menyeluruh. Sosok guru memegang peran yang sangat penting bagi siswa-siswinya. Mereka telah menjadi pembimbing, teladan, inspirasi, dan figur orang tua di luar rumah yang mengajari banyak pelajaran tentang kehidupan.</p>\r\n\r\n<p>Untuk menghormati semangat serta jasa luar biasa para guru, peringatan Hari Guru di SMA Negeri 3 Surabaya dirayakan secara sukacita namun tetap dilaksanakan secara khidmat. Kegiatan diawali dengan upacara bendera.&nbsp;&nbsp;</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Salah satu harapan yang disampaikan oleh pembina upacara dalam amanatnya adalah &ldquo;<em>guru adalah sosok pembelajar. Mereka akan terus belajar mengikuti dinamika perkembangan zaman. Membersamai siswa-siswinya mulai dari generasi mesin ketik, komputer pentium 1-4, laptop bahkan hingga tablet. Tetap memberikan pelayanan prima bagi siswa-siswinya ditengah gempuran segudang tugas administrasi yang tak kunjung henti. </em><em>S</em><em>atu hal yang mungkin tidak diketahui siswa-siswinya, Guru akan senantiasa berjuang mencerdaskan anak bangsa. </em><em>Guru</em><em> ikut bersuka cita atas keberhasilan yang kalian raih dan merasa ikut bertanggung jawab atas belum berhasilnya kalian</em>&rdquo;, ucap Danang Agus Prastiyo, S.Pd.I .</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Rangkaian acara berikutnya adalah pembacaan puisi oleh perwakilan siswa kemudian dilanjutkan dengan pemberian bunga dan hadiah bagi seluruh Bapak dan Ibu guru. Acara ditutup dengan pembacaan doa dilanjutkan&nbsp; dengan pemotongan tumpeng disertai harapan untuk masa depan pendidikan yang lebih baik.</p>', 1, 0, NULL, '530ef3b5347f5d123b3fbb227f7a9eb2.jpg', 0, NULL, 1907),
(122, 'Pisah Sambut Kepala SMA Negeri 3 Surabaya', '2022-12-11', 'post', '<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Rabu, 7 Desember 2022 merupakan momen haru bagi keluarga besar SMAN 3 Surabaya. Kurang lebih tiga setengah tahun Bapak Drs. Moh. Zainuri, M.Si menjadi nakhoda, memimpin sekolah kita, &nbsp;Dengan kerja keras dan dedikasi yang tinggi, Beliau berhasil mengantarkan Smaga menjadi sekolah dengan berbagai prestasi.</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Perputaran atau rotasi &nbsp;adalah hal biasa dalam sebuah institusi/organisasi. Begitu pun dengan Smaga yang hari ini mengadakan kegiatan pisah sambut kepala SMAN 3 Surabaya dari&nbsp; Bapak Drs. Moh. Zainuri, M.Si kepada Bapak Sunawan Hadi Santoso, S.Pd., M.Pd. Kegiatan ini dilaksanakan di Hotel Dafam Pacific Caesar Surabaya.</p>\r\n\r\n<p>Selama menjabat kepala sekolah&nbsp; banyak pelajaran dan teladan yang diberikan kepada bapak ibu guru, karyawan, serta siswa siswi&nbsp; untuk kemajuan bersama dan meningkatkan kinerja sekolah.. Tiga setengah tahun merupakan waktu yang relatif singkat namun kebersamaan bersama beliau memberikan kenangan tersendiri bagi keluarga besar SMAN 3 Surabaya.</p>\r\n\r\n<p>&ldquo;Saya mengenal Bapak Sunawan, beliau adalah orang hebat dan saya yakin langkahnya bisa membawa SMAN 3 Surabaya lebih maju dan berkembang. Saya titip SMAN 3 Surabaya, walaupun posisinya berada di pinggiran tapi SMAN 3 bukanlah sekolah pinggiran&rdquo;, sepatah kata dari Bapak Drs. Moh. Zainuri, M.Si dalam sambutannya.</p>\r\n\r\n<p>Selamat bergabung dan selamat mengemban tugas baru untuk Bapak Sunawan Hadi Santoso, S.Pd., M.Pd. Semoga bisa menjalankan amanah dengan baik dan mampu membawa kemajuan bagi&nbsp; SMAN 3 Surabaya.</p>', 1, 0, 2, 'f78915c09aedb568063066cfc9a108af.png', 0, 'pisah-sambut-kepala-sma-negeri-3-surabaya', 2658),
(123, 'Pelaksanaan Ujian Praktik Berbasis Kolaborasi di SMAN 3 Surabaya', '2023-02-14', 'pengumuman', '<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Surabaya, 13 Februari 2023 - Sekolah Menengah Atas (SMA) Negeri 3 Surabaya melaksanakan ujian praktik kelas 12 dengan kolaborasi beberapa mata pelajaran. Ujian praktik kolaborasi ini mengambil tema pernikahan dan melibatkan mata pelajaran Pendidikan Agama Islam, Bahasa Daerah, Seni Budaya, Prakarya dan Kewirausahaan, serta Bahasa Indonesia.</p>\r\n\r\n<p>Penilaian ujian praktik ini meliputi beberapa hal, seperti pelafalan ijab kabul dan doa dalam &nbsp;mata pelajaran Pendidikan Agama Islam, prosesi adat temu temanten dalam mata pelajaran Bahasa Daerah, pertunjukan musik dalam mata pelajaran Seni Budaya, ragam makanan yang dimodifikasi dalam mata pelajaran Prakarya dan Kewirausahaan, serta hasil laporan akhir dalam mata pelajaran Bahasa Indonesia.</p>\r\n\r\n<p>Pembukaan ujian praktik &nbsp;dilakukan oleh Kepala SMAN 3 Surabaya, Bapak Sunawan Hadi Santoso, S.Pd., M.Pd. Dalam sambutannya, beliau menyampaikan bahwa ujian praktik merupakan salah satu syarat kelulusan dan harus dikerjakan dengan serius oleh siswa. Beliau juga menyampaikan bahwa setelah mengalami pandemi covid-19, sekarang siswa memiliki kesempatan untuk mengekspresikan hal-hal yang sempat tertunda.</p>\r\n\r\n<p>&quot;Salah satu syarat kelulusan ditentukan dari ujian praktik, tanpa ujian praktik ini maka kalian tidak akan bisa lulus. Dua tahun lalu kita menghadapi pandemi covid, dan hari ini kita bisa mengekspresikan hal-hal yang kemarin sempat tertunda. Harapannya dengan ini kalian dapat mengambil esensi dari uprak ini, bukan uforianya, bukan kemewahannya, tapi esensi dari praktiknya yang harus kalian pahami lebih dalam,&quot; ujar Bapak Sunawan.</p>\r\n\r\n<p>Ujian praktik ini diharapkan dapat membantu siswa dalam memahami konsep dan praktik dari masing-masing mata pelajaran dan menjadi bagian dari proses belajar yang menyenangkan dan berkesan bagi siswa.</p>\r\n\r\n<p>&nbsp;</p>', 1, 0, NULL, '3fbceed7f6f6a2e0e721a91d1af886d6.jpg', 0, NULL, 1986),
(124, 'Mutiara Pesisir dalam Pemilihan Putra-Putri SMAGA 2023', '2023-02-16', 'post', '<div>\r\n<p style=\"text-align:justify\">Rabu, 15 Februari 2023 di pagi hari yang cerah suasana di lapangan SMAN 3 Surabaya ( smaga ) begitu meriah. Terlihat para pasangan calon Putra-Putri SMAGA 2023 dengan pakaian adat terbaik dan rapi berjajar di barisan kursi yang tersusun rapi. Mereka bersiap untuk melangkah di babak final Pemilihan Putra-Putri SMAGA 2023. Ada empat pasangan calon yang lolos babak final dan nantinya hanya akan dipilih satu Putra dan Putri SMAGA 2023. <em>Coast Pearl </em>atau mutiara pesisir adalah tema yang diambil pada pemilihan Putra-Putri SMAGA tahun ini.</p>\r\n\r\n<p style=\"text-align:justify\">Pagi itu para finalis telah mempersiapkan diri dengan baik. Sebelumnya mereka telah melalui serangkaian tahapan seleksi yang meliputi: seleksi berkas di tahap 1, wawancara individu pada tahap 2, presentasi pasangan sesuai dengan tema yang telah diundi (ecopreneur, nasionalisme, manajemen waktu, <em>strict parents, attitude</em> bermasyarakat, kenakalan remaja ,serta <em>mental health</em>). Pada tahap 3 &nbsp;menyisakan 8 pasangan calon dari total pendaftar awal 23 pasangan calon. Selanjutnya tahap 4 seleksi hobi hingga menyisakan 4 paslon.</p>\r\n\r\n<p style=\"text-align:justify\">Acara dimulai dengan sambutan dari kepala SMAN 3 Surabaya, Bapak Sunawan Hadi Santoso, S.Pd., M.Pd. Dalam sambutannya, beliau menyampaikan harapan agar para siswa-siswi tidak hanya memandang remeh para finalis, tetapi juga mengambil sisi positif dari penampilan mereka.</p>\r\n\r\n<p style=\"text-align:justify\">&quot;Dalam even ini harapannya kalian tidak &nbsp;meremehkan teman-teman kalian, pasangan calon yang masuk final ini adalah putra-putri pilihan yang telah melalui serangkaian tahapan seleksi yang tidak mudah. Semoga kalian dapat mengambil sisi-sisi positif dari penampilan teman-teman kalian&quot;, ujar Bapak Sunawan.</p>\r\n\r\n<p style=\"text-align:justify\">Setelah itu, acara dilanjutkan dengan penampilan <em>fashion show</em> dari para finalis. Tidak hanya sekadar berlenggang di atas panggung dengan berbusana adat daerah yang ada di Indonesia tetapi juga &nbsp;memaparkan filosofi dari busana adat yang dibawakannya.</p>\r\n\r\n<p style=\"text-align:justify\">&nbsp;Selanjutnya penampilan debat terbuka. Pasangan calon&nbsp;&nbsp; mengajukan pertanyaan secara langsung kepada para finalis lain. Debat ini diberikan dua mosi yaitu mosi pertama tentang kurikulum merdeka dan mosi kedua tentang gelar pendidikan memengaruhi kesuksesan. Masing-masing paslon memaparkan pendapat mereka sesuai dengan kelompok afirmasi dan oposisi yang telah mereka dapatkan melalui undian. Debat terasa sangat menarik karena penonton yang notabene adalah siswa-siswi Smaga bisa menilai&nbsp; kecerdasan dan keluasan wawasan masing-masing pasangan calon.</p>\r\n\r\n<p style=\"text-align:justify\">Hasil penilaian para juri pun diputuskan. Pasangan yang terpilih adalah Andhika Daffa dari kelas X-11 dan Jessica Dyra dari kelas XI MIPA 6. Keduanya terlihat bahagia dan merasa bangga atas pencapaian mereka. Andhika dan Jessica berhasil memenangkan hati para juri dengan kemampuan debat dan penguasaan materi yang memukau. Tak hanya itu, dalam prosesnya mereka tampak saling mengisi dan melengkapi setiap pendapat yang telah disampaikan.</p>\r\n</div>\r\n\r\n<p style=\"text-align:justify\">Kepala SMAN 3 Surabaya, Bapak Sunawan Hadi Santoso, S.Pd., M.Pd. menyampaikan ucapan selamat kepada Andhika dan Jessica atas kemenangan mereka. Beliau juga mengucapkan terima kasih kepada semua siswa-siswi yang telah berpartisipasi dalam Pemilihan Putra-Putri SMAGA 2023.</p>', 1, 0, 2, 'e03f4ed38e5de71f7b8c7f9f0d69c856.png', 0, 'mutiara-pesisir-dalam-pemilihan-putra-putri-smaga-2023', 2100),
(125, 'PELINDO Mengajar: Menguatkan Generasi Penerus dan Menghubungkan Bangsa di SMAN 3 Surabaya', '2023-02-25', 'pengumuman', '<p>Rabu, &nbsp;22 Februari 2023, sebuah program bernama Pelindo Mengajar telah sukses dilaksanakan di SMAN 3 Surabaya. Program dengan tema <em>&#39;Empowering the next generation, connecting the nation</em>&#39; ini bertujuan untuk memberdayakan generasi penerus demi menghubungkan dan memperkuat bangsa.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Acara ini dibuka oleh Kepala SMAN 3 Surabaya, Bapak Sunawan Hadi Santoso, S.Pd., M.Pd. Pemaparan materi sosialisasi disampaikan oleh Direktur Strategi Pelindo, Bapak Prasetyo. Dalam penyampaian materinya, Bapak Prasetyo menjelaskan bahwa program ini difokuskan pada siswa-siswi&nbsp; SMA. Sebagai &nbsp;generasi penerus, mereka diberdayakan untuk menguatkan fondasi bangsa.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Hal ini sejalan dengan amanat Menteri BUMN RI, Bapak Erick Thohir, yang menyatakan bahwa &ldquo;generasi muda harus mempersiapkan 3 hal agar dapat menjadi generasi yang unggul di masa depan, yaitu memiliki kapabilitas yang baik, bekerja dengan sungguh-sungguh, dan tidak pernah berhenti belajar&rdquo;.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Dalam program ini peserta diberi materi tentang berbagai hal terkait dunia kerja dan maritim, serta pelatihan keterampilan. Melalui program ini, diharapkan generasi muda akan semakin memahami potensi yang dimiliki oleh negara Indonesia terutama dalam sektor maritim.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Kegiatan ini sangat bermanfaat bagi peserta karena dapat membantu meningkatkan keterampilan dan wawasan mereka dalam berbagai bidang. Program Pelindo Mengajar juga diharapkan dapat membantu menciptakan generasi muda yang lebih tangguh, berkualitas, dan mampu berkontribusi positif bagi bangsa dan negara. Semoga kegiatan serupa dapat terus dilaksanakan di masa depan untuk membantu membentuk generasi penerus yang lebih baik dan lebih siap menghadapi tantangan di masa depan.</p>', 1, 0, NULL, '4d6c25cf2ecabced669125d0b937cb29.jpg', 0, NULL, 1370),
(127, 'ANTUSIAS SISWA SMAGA DALAM PERINGATAN ISRA\' MIJRA\' DI SMAN 3 SURABAYA', '2023-02-27', 'post', '<p>Selasa (21/2) SMAN 3 Surabaya mengadakan Isra Mi&#39;raj sebagai wujud peringatan kejadian bersejarah bagi umat Islam. Peringatan isra&#39; mi&#39;raj yang dibuka oleh Kepala SMAN 3 Surabaya, Bapak Sunawan Hadi Santoso, S.Pd, M.Pd. ini telah sukses digelar di aula SMAN 3 Surabaya. Isra&#39; mi&#39;raj kali ini mengusung tema &quot;Perjalanan Rasulullah.&quot;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Mengutip mauidoh hasanah yang disampaikan al ustadz H. Husein Haris A. Md S.Pdi &ldquo;di mana isra&#39; mi&#39;raj merupakan peristiwa Nabi Muhammad Salallahu alaihi wassalam melaksanakan perjalanan ke langit ketujuh untuk menunaikan perintah salat lima waktu&rdquo;. Perintah ini yang kemudian menjadi kewajiban bagi setiap muslim untuk dilaksanakan setiap hari dengan tujuan salat dapat mencegah dari perbuatan keji dan munkar.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Acara peringatan isra&#39; mi&#39;raj tahun ini dihadiri bapak/ibu guru serta siswa-siswa dari kelas X, XI, dan XII. Keseruan acara ini ditampilkan ketika al ustadz berceramah dan mengajak siswa-siswi untuk bersalawat bersama. Mereka pun cepat mengikuti dan spontan menyalakan flash pada gawai masing-masing.</p>', 1, 0, 2, 'b191f0d9acf264797dec1836c1a6a3e8.JPG', 0, 'antusias-siswa-smaga-dalam-peringatan-isra-mijra-di-sman-3-surabaya', 1938),
(128, 'Gelar Karya Projek P5 di SMAN 3 Surabaya: Sukses Gugah Semangat Gotong Royong dan Tanggung Jawab', '2023-03-18', 'post', '<p>SMAN 3 Surabaya mengadakan pagelaran karya Projek Penguatan Profil Pelajar Pancasila (P5) dengan tema kearifan lokal sebagai implementasi dari kurikulum merdeka. Acara yang dilaksanakan pada tanggal 16-17 Maret 2023 di aula SMAN 3 Surabaya ini melibatkan seluruh siswa kelas 10 yang berjumlah 12 kelas.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Hari pertama Gelar Karya menampilkan lima karya dari dua belas kelas, yaitu: Sarip Tambak Oso dari kelas X-11, Asal-usul Kawah Si Kidang Dieng dari kelas X-12, Keong Emas dari kelas X-3, Bawang Merah dan Bawang Putih dari kelas X-2, serta Jaka Tarub dari kelas X-9.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Hari kedua terdapat tujuh kelas yang menampilkan pagelaran dengan judul sebagai berikut: Roro Jonggrang dari kelas X-6, Si Pitung dari kelas X-8, Pandan Berduri dari kelasX-10, Asal-usul Banyuwangi dari kelasX-7, Cindelaras dari kelas X-5, Ken Arok dan Ken Dedes dari kelas X-6, serta penutup penampilan dari kelas X-4 dengan judul Calon Arang.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Gelar karya P5 ini mendapatkan respon positif dari berbagai pihak, terbukti dari sekolah yang menfasilitasi &nbsp;gelar karya ini. Hal lain yang perlu dicatat adalah antusias dari wali murid yang hadir untuk memberikan dukungan langsung terhadap penampilan putra-putrinya. Acara ini juga disiarkan secara langsung melalui YouTube streaming Humas SMAN 3 Surabaya.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Kepala SMAN 3 Surabaya, Bapak Sunawan Hadi Santoso, S.Pd.,M.Pd berpesan agar anak-anak terus berkarya dan mengembangkan potensi, serta menanamkan karakter Profil Pelajar Pancasila yang sejati.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Puncak pagelaran karya ini menunjukkan bahwa seluruh siswa kelas 10 telah memberikan penampilan yang sangat luar biasa, baik dari kreativitas, alur cerita, akting yang memukau, serta properti yang menarik yang terbuat dari bahan-bahan sederhana. Dari tema kearifan lokal ini, diharapkan dapat membentuk karakter gotong royong, kreatif, dan tangggung jawab yang tercermin dalam Profil Pelajar Pancasila.</p>', 1, 0, 2, 'f4b212aec4bf5a18a8a674728a5f0a50.JPG', 0, 'gelar-karya-projek-p5-di-sman-3-surabaya-sukses-gugah-semangat-gotong-royong-dan-tanggung-jawab', 2286),
(131, 'PENGUMUMAN KELULUSAN SISWA TAHUN 2023', '2023-05-05', 'pengumuman', '<p style=\"text-align:justify\">Puji syukur kami panjatkan ke hadirat Allah SWT atas berkat, rahmat serta hidayah-Nya sehingga SMA Negeri 3 Surabaya telah dapat menjadi bagian dari komponen pendidikan yang dapat melangkah memenuhi tuntutan era globalisasi serta mempersiapkan diri untuk menghadapi berbagai tantangannya. Dunia pendidikan sudah seharusnya mengikuti pesatnya perkembangan ilmu pengetahuan informasi dan teknologi. Tahap demi tahap, SMA Negeri 3 Surabaya berupaya ingin menggapai cita-citanya, yakni meningkatkan kualitas anak didiknya yang berarti pula meninggikan derajat manusia Indonesia agar setara dengan bangsa lain.</p>\r\n\r\n<p style=\"text-align:justify\">Maka dari itu, dengan tuntasnya Kegiatan Belajar Mengajar Kelas XII di SMA Negeri 3 Surabaya, dengan ini Pengumuman Kelulusan sebagai berikut ;</p>\r\n\r\n<p style=\"text-align:justify\">Silahkan klik link dibawah ini !</p>\r\n\r\n<p style=\"text-align:justify\"><a href=\"http://athaa11study.blogspot.com\">http://athaa11study.blogspot.com</a></p>', 1, 0, NULL, 'a1af46bd8cd365d25ac036f87d0ea53b.png', 0, NULL, 1923),
(132, 'Pengumuman Kelulusan Siswa Kelas XII TP 2022-2003', '2023-05-07', 'pengumuman', '<p>PENGUMUMAN KELULUSAN SMA NEGERI 3 SURABAYA TAHUN PELAJARAN 2022 / 2023 KETERANGAN : JUMLAH 351 SISWA KELAS XII &quot;LULUS 100%&quot;</p>', 1, 0, NULL, '4abfc90929fa61a61728832ad7b55894.png', 0, NULL, 1555),
(133, 'Pra MPLS Smaga 2023', '2023-07-15', 'post', 'PRA MPLS SMA NEGERI 3 SURABAYA 2023\r\n\r\nSurabaya, 14 Juli 2023 - SMA Negeri 3 Surabaya telah mengadakan kegiatan Pra Masa Pengenalan Lingkungan Sekolah (MPLS) sebagai bagian dari persiapan menyambut para peserta didik baru. Acara tersebut dilaksanakan pada hari Jumat, 14 Juli 2023, dimulai pukul 06.30 hingga 10.00. Kegiatan Pra MPLS diawali dengan pembukaan resmi yang dipimpin oleh pembina OSIS/MPK diikuti  seluruh peserta MPLS. Dalam sambutannya, Bapak Theo Guawan memberikan motivasi dan arahan kepada para peserta didik baru agar dapat beradaptasi dengan baik di lingkungan sekolah yang baru.\r\nSelain itu, dalam kegiatan Pra MPLS ini juga dilakukan pengenalan wali gugus. Setiap gugus akan didampingi oleh seorang wali gugus selama kegiatan MPLS berlangsung. Wali gugus memiliki peran penting dalam memberikan bimbingan dan pendampingan kepada peserta didik selama menjalani MPLS. Kegiatan Pra MPLS dilanjutkan dengan orientasi sekolah. Dalam rangkaian orientasi ini, para peserta didik baru diajak untuk melakukan school tour, yaitu mengunjungi setiap ruangan dan gedung yang ada di SMAN 3 Surabaya. Tujuannya adalah agar para peserta didik dapat mengenal secara lebih mendalam ruangan serta fasilitas-fasilitas sekolah dan memahami tata tertib yang berlaku.\r\nMeskipun Pra MPLS hanya bersifat sebagai persiapan teknis, namun tata aturan yang harus diperhatikan selama kegiatan MPLS juga disampaikan kepada para peserta didik. Hal-hal seperti atribut yang harus dikenakan, tata tertib, serta aturan-aturan lainnya dijelaskan agar para peserta didik dapat mempersiapkan diri secara optimal.\r\nMPLS sesungguhnya akan dilaksanakan dalam rentang waktu tiga hari, yaitu pada tanggal 17, 18, dan 20 Juli 2023. Rangkaian kegiatan MPLS tersebut meliputi beberapa agenda penting. Pada hari pertama, tanggal 17 Juli 2023, para peserta didik akan mendapatkan pemaparan materi dari para guru sebagai pembicara. Materi tersebut akan membahas topik-topik yang relevan dengan kehidupan sekolah dan kegiatan belajar mengajar.\r\nHari kedua, tanggal 18 Juli 2023, akan dilakukan demonstrasi kegiatan ekstrakurikuler. Peserta didik-peserta didik baru akan diperkenalkan kepada berbagai kegiatan ekstrakurikuler yang ada di SMA Negeri 3 Surabaya. Hal ini bertujuan untuk memperkenalkan pilihan-pilihan yang tersedia dan mendorong peserta didik untuk mengembangkan minat dan bakat di bidang yang diminati.\r\nPada hari terakhir, tanggal 20 Juli 2023, akan dilaksanakan rangkaian kegiatan senam, Peraturan Baris-Berbaris (PBB), dan acara penutupan (closing ceremony). Kegiatan ini bertujuan untuk mempererat hubungan antar peserta didik, menciptakan semangat kebersamaan, serta memberikan pengalaman yang berkesan bagi para peserta didik baru.', 1, 0, 1, '691bc7f9a727071b8225e7820fd0480c.jpg', 0, 'pra-mpls-smaga-2023', 1859),
