(137, 'SATPOL PP GOES TO SCHOOL', '2024-01-11', 'sekilas_info', 'Dengan seksama siswa-siswi kelas X mendengarkan paparan tentang Perda dan seputar kenakalan Remaja. Acara ini sangat menarik karena juga dihadiri seorang Mahasiswa dari Afrika yang ingin mengetahui lebih dekat Sekolah yang ada di Surabaya. terutama SMA Negeri 3 Surabaya', 1, 0, NULL, NULL, 0, NULL, 1055);
INSERT INTO `posts` (`post_id`, `post_title`, `post_date`, `post_type`, `post_content`, `user_id`, `post_parent`, `category_id`, `post_image`, `order_pages`, `slug`, `counter`) VALUES
(138, 'ROAD SHOW JAKSA MASUK  SEKOLAH 2024', '2024-01-23', 'post', '<p>Hari Rabu, 17 Januari 2024 adalah hari yang membanggakan bagi SMA Negeri 3 Surabaya.&nbsp;<br />\r\nPada umumnya, seorang jaksa tidak secara rutin atau formal masuk ke sekolah sebagai bagian dari tugas mereka. Jaksa biasanya terlibat dalam penegakan hukum, penyelidikan, dan pengadilan, fokus pada kegiatan di lingkungan hukum dan pidana.</p>\r\n\r\n<p>Namun, ada beberapa inisiatif di berbagai negara di mana jaksa atau petugas hukum terlibat dalam program pendidikan di sekolah-sekolah. Inisiatif ini bertujuan untuk meningkatkan pemahaman masyarakat, terutama pelajar, tentang sistem hukum dan pentingnya kepatuhan terhadap hukum.</p>\r\n\r\n<p>Beberapa kegiatan yang mungkin dilakukan oleh jaksa dalam konteks pendidikan sekolah termasuk:</p>\r\n\r\n<p>1. **Pelatihan Hukum untuk Siswa:** Jaksa dapat memberikan ceramah atau pelatihan hukum di sekolah-sekolah untuk meningkatkan pemahaman siswa tentang prinsip-prinsip hukum, hak dan kewajiban, serta konsekuensi tindakan hukum.</p>\r\n\r\n<p>2. **Program Pendidikan Anti-Bullying atau Anti-Narkoba:** Jaksa mungkin terlibat dalam program-program pendidikan yang bertujuan untuk mencegah perilaku merugikan seperti perundungan (bullying) atau penyalahgunaan narkoba. Mereka dapat memberikan wawasan hukum kepada siswa tentang konsekuensi hukum dari perilaku tersebut.</p>\r\n\r\n<p>3. **Kunjungan ke Sekolah:** Beberapa jaksa mungkin mengunjungi sekolah-sekolah sebagai bagian dari upaya untuk membangun hubungan dengan masyarakat dan mempromosikan pemahaman yang lebih baik tentang sistem hukum. Ini dapat mencakup sesi tanya jawab atau diskusi tentang hukum dan keadilan.</p>\r\n\r\n<p>4. **Simulasi Pengadilan di Sekolah:** Untuk memberikan pengalaman langsung kepada siswa tentang bagaimana sistem hukum beroperasi, jaksa dapat membantu mengorganisir simulasi pengadilan di sekolah. Ini memberikan siswa kesempatan untuk memahami proses hukum secara praktis.</p>\r\n\r\n<p>5. **Program Magang atau Praktik Kerja:** Beberapa sekolah mungkin menjalin kemitraan dengan kantor jaksa setempat untuk menyediakan program magang atau praktik kerja bagi siswa yang berminat mengenal lebih dalam tentang sistem hukum.</p>\r\n\r\n<p>Meskipun tidak umum bagi jaksa untuk secara rutin masuk ke sekolah, tetapi melibatkan mereka dalam program pendidikan dapat membantu membangun pemahaman yang lebih baik tentang hukum di kalangan generasi muda.</p>', 1, 0, 2, 'fe860cd52778b5d67994237f82b6f233.jpeg', 0, 'road-show-jaksa-masuk-sekolah-2024', 1485),
(139, 'Penerimaan Tamu Ambalan di Pangkalan SMA Negeri 3 Surabaya Memukau dengan Kegiatan Multidimensi', '2024-01-27', 'post', '<div>\r\n<p>Surabaya, 26 Januari 2024 dilaksanakan kegiatan Penerimaan Tamu Ambalan Pangkalan SMA Negeri 3 Surabaya. Kegiatan tersebut berlangsung meriah dengan partisipasi penuh dari seluruh siswa kelas 10. Acara ini diresmikan oleh Kamabigus pangkalan SMAN 3 Surabaya, Sunawan Hadi Santoso, S.Pd., M.Pd, yang membuka serangkaian upacara yang penuh semangat.</p>\r\n\r\n<p>Setelah seremoni pembukaan, anak-anak kelas 10 diberikan materi di empat pos berbeda. Pos 1 memberikan materi tentang Peraturan Baris-Berbaris (PBB), pos 2 membahas kepenegakan, pos 3 fokus pada daur ulang, sementara pos 4 mengajarkan keterampilan penampilan, kreasi, dan seni. Para peserta dengan antusias mengikuti kegiatan di setiap pos, menyerap pengetahuan yang bervariasi dalam suasana yang penuh semangat.</p>\r\n\r\n<p>Kegiatan ini menarik perhatian banyak karena mencakup aspek-aspek yang berbeda dari pendidikan karakter dan peningkatan keterampilan siswa. Materi yang diajarkan mencakup nilai-nilai kepatuhan, keadilan, keberlanjutan lingkungan, serta ekspresi kreatif dan seni.</p>\r\n\r\n<p>Setelah selesainya kegiatan di pos-pos tersebut, acara ditutup sementara untuk memberikan kesempatan peserta untuk melaksanakan sholat Jumat. Setelah sholat, kegiatan dilanjutkan pada pukul 13.00 dengan kegiatan outbound. Kegiatan outbound, yang dipandu oleh trainer dari Kwarcab, menjadi momen yang sangat dinantikan.</p>\r\n\r\n<p>Outbound ini tidak hanya berhasil memperkuat rasa kebersamaan di antara siswa kelas 10, tetapi juga menghadirkan kegembiraan sejati. Meskipun terpaksa harus diakhiri lebih cepat dari yang direncanakan karena turunnya hujan, namun antusiasme dan semangat dari anak-anak kelas 10 SMA Negeri 3 Surabaya tetap terlihat.</p>\r\n\r\n<p>Acara Penerimaan Tamu Ambalan ini tidak hanya menjadi bentuk integrasi antara kegiatan pembelajaran formal dan non-formal, tetapi juga menjadi momen berkesan yang akan dikenang oleh seluruh peserta. Dengan demikian, SMA Negeri 3 Surabaya terus berkomitmen untuk memberikan pendidikan yang holistik dan mendukung pengembangan karakter siswa.</p>\r\n</div>', 1, 0, 2, '7c33c919eacfd2f8ef7f5de6edca4084.jpg', 0, 'penerimaan-tamu-ambalan-di-pangkalan-sma-negeri-3-surabaya-memukau-dengan-kegiatan-multidimensi', 1339),
(140, 'Smaga Campus Fair 2024', '2024-01-27', 'post', '<div>\r\n<div>\r\n<p>Pada hari Jumat tanggal 26 Januari 2024 di SMA Negeri 3 Surabaya terdapat acara yang luarbiasa dimana mendatangkan kampus dari perguruan Tinggi Negeri maupun suasta yang ternama di Surabaya, diantaranya : UNESA, ITS, UPN, Unair, PPNS, UWM, Stesia, UINSA, UTM dan masih banyak lagi.</p>\r\n\r\n<p>Campus fair di sekolah merupakan acara yang dapat memberikan berbagai manfaat bagi siswa dan institusi pendidikan. Berikut adalah beberapa manfaat dari mengadakan atau menghadiri campus fair di sekolah:</p>\r\n</div>\r\n\r\n<div style=\"margin-left:-18.0pt;\">\r\n<p><strong>&nbsp; &nbsp; &nbsp; &nbsp; Informasi Pendidikan:</strong></p>\r\n</div>\r\n\r\n<div style=\"margin-left:18.0pt;\">\r\n<ul>\r\n	<li>Siswa dapat mendapatkan informasi mendalam tentang berbagai program studi dan jurusan yang ditawarkan oleh perguruan tinggi atau universitas.</li>\r\n	<li>Mereka dapat bertemu langsung dengan perwakilan dari institusi pendidikan dan mendapatkan jawaban atas pertanyaan mereka mengenai program, kurikulum, dan fasilitas.</li>\r\n</ul>\r\n</div>\r\n\r\n<div style=\"margin-left:-18.0pt;\">\r\n<p><strong>&nbsp; &nbsp; &nbsp; &nbsp; Pandangan Karir:</strong></p>\r\n</div>\r\n\r\n<div style=\"margin-left:18.0pt;\">\r\n<ul>\r\n	<li>Campus fair dapat membantu siswa untuk memahami lebih baik mengenai berbagai jalur karir yang dapat diambil setelah menyelesaikan pendidikan tinggi.</li>\r\n	<li>Siswa dapat berbicara dengan perwakilan perusahaan atau organisasi yang hadir, mendapatkan informasi tentang peluang pekerjaan, dan memahami persyaratan yang dibutuhkan untuk masuk ke industri tertentu.</li>\r\n</ul>\r\n</div>\r\n\r\n<div style=\"margin-left:-18.0pt;\">\r\n<p><strong>&nbsp; &nbsp; &nbsp; &nbsp; Networking:</strong></p>\r\n</div>\r\n\r\n<div style=\"margin-left:18.0pt;\">\r\n<ul>\r\n	<li>Acara ini menciptakan kesempatan untuk siswa membangun jaringan dengan perwakilan perguruan tinggi, perusahaan, dan bahkan sesama siswa.</li>\r\n	<li>Koneksi yang dibuat di acara tersebut dapat membantu siswa ketika mereka mencari magang, pekerjaan setelah lulus, atau peluang kolaborasi di masa depan.</li>\r\n</ul>\r\n</div>\r\n\r\n<div style=\"margin-left:-18.0pt;\">\r\n<p><strong>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Pemberdayaan Pilihan:</strong></p>\r\n</div>\r\n\r\n<div style=\"margin-left:18.0pt;\">\r\n<ul>\r\n	<li>Siswa dapat mengeksplorasi berbagai pilihan pendidikan dan karir yang mungkin belum mereka pertimbangkan sebelumnya.</li>\r\n	<li>Campus fair membantu siswa untuk membuat keputusan yang lebih terinformasi tentang jalur pendidikan dan karir yang sesuai dengan minat dan bakat mereka.</li>\r\n</ul>\r\n</div>\r\n\r\n<div style=\"margin-left:-18.0pt;\">\r\n<p><strong>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Promosi Sekolah:</strong></p>\r\n</div>\r\n\r\n<div style=\"margin-left:18.0pt;\">\r\n<ul>\r\n	<li>Bagi institusi pendidikan, campus fair adalah kesempatan untuk mempromosikan program dan fasilitas mereka kepada calon mahasiswa.</li>\r\n	<li>Mereka dapat meningkatkan visibilitas dan menarik minat siswa potensial untuk mendaftar.</li>\r\n</ul>\r\n</div>\r\n\r\n<div style=\"margin-left:-18.0pt;\">\r\n<p><strong>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Motivasi dan Inspirasi:</strong></p>\r\n</div>\r\n\r\n<div style=\"margin-left:18.0pt;\">\r\n<ul>\r\n	<li>Menghadiri campus fair dapat memberikan dorongan motivasi kepada siswa untuk mengejar impian pendidikan dan karir mereka.</li>\r\n	<li>Menyaksikan berbagai pilihan yang tersedia dapat memberikan inspirasi dan membangkitkan semangat untuk meraih kesuksesan akademis dan profesional.</li>\r\n</ul>\r\n</div>\r\n\r\n<div>\r\n<p>Dengan demikian, campus fair di sekolah dapat menciptakan pengalaman berharga yang mendukung perkembangan siswa dan memfasilitasi koneksi antara dunia pendidikan dan dunia kerja.</p>\r\n</div>\r\n\r\n<p>&nbsp;</p>\r\n</div>', 1, 0, 2, '9a56f6d08f842ea77e2fbabb178248fe.jpg', 0, 'smaga-campus-fair-2024', 1659),
(141, '\"Mengembangkan Kreatifitas dan Inovatif: Implementasi Kewirausahaan dalam Ujian Praktik PKWU\"', '2024-02-14', 'post', 'Pada tanggal 5-7 Februari dan 12 Februari 2024, siswa-siswa kelas XII SMAN 3 Surabaya telah melaksanakan Ujian Praktik Mata Pelajaran PKWU. Ujian Praktik kali ini, mereka dihadapkan pada praktik mengolah dan memodifikasi masakan sehingga dapat memunculkan jiwa kreatifitas mereka utamanya dalam kewirausahaan. Dalam suasana yang penuh antusiasme, mereka menghadirkan kreativitas dan keterampilan memasak untuk diuji oleh para pengajar dan juri. \r\n\r\nUjian praktik ini menuntut para siswa untuk tidak hanya menguasai teknik dasar memasak, tetapi juga menonjolkan inovasi dalam penyajian hidangan. Dengan tema kewirausahaan, siswa diharapkan mampu menghadirkan hidangan yang tidak hanya lezat tetapi juga memiliki nilai jual yang tinggi. \r\n\r\nSetiap siswa diberikan kesempatan untuk menyajikan hidangan khas mereka, mulai dari konsep hingga eksekusi. Juri tidak hanya memperhatikan rasa dan presentasi visual, tetapi juga aspek-aspek kewirausahaan seperti daya saing di pasar dan potensi bisnis. \r\n\r\nUjian praktik kewirausahaan memasak ini tidak hanya menjadi ajang pengujian keterampilan kuliner, tetapi juga kesempatan untuk melatih siswa dalam mengelola aspek bisnis di dunia kuliner. Melalui ujian ini, diharapkan para siswa dapat merangkul wirausaha kuliner dengan penuh semangat dan kreativitas.', 1, 0, 2, 'bd867599650d1aeedd836b2d003d546d.jpg', 0, 'mengembangkan-kreatifitas-dan-inovatif-implementasi-kewirausahaan-dalam-ujian-praktik-pkwu', 1478),
(142, 'Pemilihan Putra-Putri SMAGA 2024', '2024-02-19', 'post', '<p>Surabaya, 19 Februari 2024 - Pemilihan Putra-Putri SMAN 3 Surabaya telah sukses dilaksanakan. Kegiatan ini menampilkan serangkaian proses seleksi yang ketat hingga memunculkan empat finalis terbaik. Dari puluhan siswa yang berpartisipasi, akhirnya terpilihlah Muhammad Parisyarayya dari kelas XI-7, Salahudin Sasmita Bagus Ajie dari kelas XI-5, Karina Nayyataka dari kelas X-7, dan Clara Joe Paris dari kelas XI-5 sebagai finalis teratas.</p>\r\n\r\n<p><br />\r\nProses seleksi meliputi beragam tahapan, dimulai dari penilaian visi misi program, bakat dan minat, wawancara dan tahap final berupa debat. Keseluruhan proses ini dilaksanakan dengan cermat oleh seluruh anggota OSIS/MPK serta Bapak/Ibu guru yang terlibat.</p>\r\n\r\n<p>Pada tahap final, para finalis ditantang untuk memberikan orasi serta berpartisipasi dalam sesi debat. Mereka diberikan mosi berkaitan dengan kepemimpinan generasi muda. Pertanyaan-pertanyaan yang diajukan oleh panelis terkait dampak digitalisasi, peningkatan keberanian dan percaya diri, peningkatan kedisiplinan, serta upaya branding sekolah tersebut bertujuan untuk menguji kemampuan berpikir kritis dan pandangan mereka terhadap isu-isu penting dalam pendidikan.</p>\r\n\r\n<p><br />\r\nPuncak acara pemilihan putra-putri SMAN 3 Surabaya ditentukan melalui pemilihan suara, di mana seluruh siswa dan guru memiliki kesempatan untuk berpartisipasi aktif dalam menentukan pilihan mereka. Pemilihan putra-putri SMAN 3 Surabaya ini dilakukan melalui pemungutan suara hal tersebut sebagai manifestasi dari sistem demokrasi di lingkungan SMAN 3 Surabaya. Hasilnya, putra SMAN 3 Surabaya kali ini adalah Salahudin Sasmita Bagus Ajie dari kelas XI-5, sementara putri SMAN 3 Surabaya adalah Clara Joe Paris dari kelas XI-5.</p>\r\n\r\n<p>Semoga putra-putri SMAN 3 Surabaya yang terpilih kali ini dapat mengemban amanah dengan baik dan mampu menjadikan citra sekolah yang lebih baik di masa depan. Dengan semangat dan dedikasi mereka, diharapkan SMAN 3 Surabaya dapat terus berkembang dan memberikan kontribusi positif bagi masyarakat pendidikan di Surabaya.</p>', 1, 0, 2, '7861d6e5474c070f431dc7554a8fdf25.jpg', 0, 'pemilihan-putra-putri-smaga-2024', 1851),
(143, 'Peringatan Isra Mi\'raj di SMAN 3 Surabaya: Generasi Hebat, Tidak Pernah Meninggalkan Sholat\"', '2024-02-21', 'post', '<p>Peringatan Isra Mi&#39;raj Nabi Muhammad SAW di SMAN 3 Surabaya hari ini menggelora dengan antusiasme yang membara. Pada Selasa, 20 Februari 2024, seluruh siswa Muslim kelas 10 dan 11 berkumpul di aula sekolah dengan semangat yang tinggi, untuk mengikuti kegiatan peringatan isra mi&rsquo;raj dengan mengusung tema &quot;Generasi Hebat, Tidak Pernah Meninggalkan Sholat&quot;. Sementara itu, siswa kelas 12 berkumpul untuk istighosah di masjid SMAN 3 Surabaya.</p>\r\n\r\n<p>Suasana di aula dipenuhi dengan lantunan sholawat yang memikat hati. Kepala SMAN 3 Surabaya bapak Sunawan Hadi Santoso, S.Pd., M.Pd kemudian membuka acara dengan kata-kata yang menggugah, &quot;Sepintar apapun kalian, apabila tanpa akhlak, maka tidak akan ada gunanya.&quot; Pesan ini tidak hanya menekankan pentingnya acara hari itu, tetapi juga menegaskan pentingnya akhlak dalam kehidupan sehari-hari.</p>\r\n\r\n<p>Acara inti dilanjutkan dengan pengajian, di mana pembicara membahas tentang tiga orang yang wajib dimuliakan, mengaitkannya dengan nilai-nilai agama dan moral yang harus dipegang teguh. Pesan untuk tetap beribadah sesuai dengan tema hari ini, yakni &quot;Generasi Hebat Tidak Pernah Meninggalkan Sholat&quot;, disampaikan dengan penuh kehangatan.</p>\r\n\r\n<p>Semangat yang menggebu-gebu dari seluruh peserta acara menandakan betapa pentingnya peringatan Isra Mi&#39;raj dalam menjaga keimanan dan meningkatkan kualitas spiritualitas generasi muda. Melalui kegiatan ini, diharapkan generasi penerus bangsa semakin kuat dalam menjalankan kewajiban agama dan membawa manfaat bagi masyarakat serta negara.</p>', 1, 0, 2, '031d07c380661ada41abaa1e877ae413.jpg', 0, 'peringatan-isra-miraj-di-sman-3-surabaya-generasi-hebat-tidak-pernah-meninggalkan-sholat', 1523),
(145, 'PONDOK RAMADHAN 2024', '2024-04-01', 'agenda', '', 1, 0, NULL, NULL, 0, NULL, NULL),
