(147, 'KEGIATAN BULAN SUCI RAMADHAN DI SMA NEGERI 3 SURABAYA: Indahnya Toleransi Beragama di SMA Negeri 3 Surabaya', '2024-04-25', 'post', '<p style=\"text-align:justify\">Seperti tahun-tahun lalu, untuk memupuk karakter mulia, religius, peserta didik SMA Negeri 3 Surabaya pada bulan suci Ramadhan,&nbsp;kegiatan bernuasa religi tidak hanya didominasi peserta didik muslim, peserta didik nonmuslim juga berkegiatan.&nbsp;&nbsp;Pondok Ramadhan diadakan bagi peserta didik yang beragama Islam&nbsp;dan kegiatan Pondok Kasih bagi peserta didik beragama Nasrani.&nbsp;Kegiatan tersebut berlangsung selama empat hari, mulai dari tanggal 1 hingga 4 April 2024. Keberadaan dua kegiatan tersebut berjalan&nbsp;secara aman dan damai.&nbsp;</p>\r\n\r\n<p style=\"text-align:justify\">Kepala SMAN 3 Surabaya, Bapak Sunawan Hadi Santoso, S.Pd., M.Pd, secara resmi membuka dua kegiataan tersebut.&nbsp;Adapun tema untuk Kegiatan Pondok Ramadhan adalah&nbsp;&quot;Puasaku Totalitas, Ramadhanku Berkualitas, Belajarku Tuntas, Masa Depanku Mumtaz&quot;. Pesan-pesan kebijaksanaan dan keagamaan disampaikan dalam pembukaan ini,&nbsp; Hal tersebut mengingatkan seluruh peserta untuk menjalankan ibadah dengan penuh keikhlasan dan dedikasi.</p>\r\n\r\n<p style=\"text-align:justify\">Hari pertama kegiatan diawali dengan sholat Dhuha berjamaah dan pemaparan dua materi penting, yakni materi puasa dan materi kenakalan remaja. Peserta didik&nbsp;juga melaksanakan sholat Dhuhur&nbsp;berjamaah sebelum kembali ke rumah masing-masing. Perlu dicatat, jadwal kegiatan pada hari pertama berlangsung dari jam 07.00 hingga 12.30.</p>\r\n\r\n<p style=\"text-align:justify\">Sementara itu, pada hari kedua, kegiatan dimulai dengan sholat Ashar berjamaah diikuti dengan khotmil Qur&#39;an bersama. Menjelang adzan Maghrib, peserta didik melakukan refleksi atas materi yang telah dipelajari pada hari sebelumnya dengan mengerjakan soal refleksi/evaluasi. Kegiatan berlanjut dengan buka puasa bersama diikuti sholat Tarawih berjamaah di Masjid Imaddudin SMAN 3 Surabaya. Jadwal pada hari kedua dimulai dari jam 14.30 hingga 20.00.</p>\r\n\r\n<p style=\"text-align:justify\">Adapun kegiatan peserta didik Nasrani pada Pondok Kasihnya, mereka mengusung tema &quot;God&#39;s Eternal Love&quot;, Kegiatan ini bertujuan untuk meningkatkan rasa kasih kepada Tuhan, menghadirkan nuansa spiritual yang mendalam dalam keragaman agama di lingkungan sekolah.</p>\r\n\r\n<p style=\"text-align:justify\">Kegiatan Pesantren Ramadhan dan Pondok Kasih ini tidak hanya sekadar memperdalam ibadah, namun juga memupuk nilai-nilai kebersamaan, toleransi, dan kasih sayang di antara seluruh siswa-siswi SMAN 3 Surabaya. Semoga semangat kegiatan ini membawa kebaikan dan keberkahan bagi semua yang terlibat.</p>', 1, 0, 2, '043fb8ce06a8eb056318d623403346c5.png', 0, 'kegiatan-bulan-suci-ramadhan-di-sma-negeri-3-surabaya-indahnya-toleransi-beragama-di-sma-negeri-3-surabaya', 1974),
(148, 'SMAN 3 Surabaya Gelar Halal Bihalal, Wujud Persaudaraan Tak Lekang Oleh Waktu', '2024-04-28', 'post', '<p style=\"text-align: justify;\"><strong>Surabaya, </strong><strong>18</strong><strong>April 2024 </strong>&ndash; SMAN 3 Surabaya menggelar acara Halal Bihalal yang meriah pada Kamis&nbsp;(18/4). Acara yang diadakan di lapangan belakang SMA Negeri 3 Surabaya dan aula sekolah tersebut. Acara Halal Bihalal tersebut dihadiri oleh&nbsp;beberapa pendidik SMA Negeri 3 Surabaya yang sudah purna bakti, perwakilan Ikatan Alumni (IKA) SMA Negeri 3 Surabaya, perwakilan komite&nbsp;SMA Negeri 3 Surabaya, serta semua warga SMA Negeri 3 Surabaya&nbsp;yang masih bertugas.</p>\r\n\r\n<p style=\"text-align: justify;\">Acara ini merupakan wujud dari semangat kebersamaan dan persaudaraan di antara warga SMAN 3 Surabaya, Mereka berkumpul untuk saling memaafkan dan mempererat tali silaturahmi setelah melewati bulan suci Ramadan.</p>\r\n\r\n<p style=\"text-align: justify;\">Kegiatan Halal Bihalal ini diisi dengan berbagai rangkaian acara yang menarik, mulai dari sambutan kepala sekolah, sambutan perwakilan undangan, pembacaan ayat suci Al-Quran beserta terjemahannya, ceramah keagamaan, dan berhalal bihalal (bersalam-salaman, saling memaafkan) Selain itu, tidak ketinggalan pula hidangan lezat yang disajikan dalam suasana yang penuh keakraban.</p>\r\n\r\n<p style=\"text-align: justify;\">Menurut Kepala Sekolah SMAN 3 Surabaya, Bapak Sunawan Hadi Santoso,S.Pd., M.Pd.,&nbsp;acara Halal Bihalal ini tidak hanya sekadar ajang untuk bersenang-senang, tetapi juga sebagai momentum untuk memperkuat ikatan kekeluargaan di antara seluruh warga sekolah.</p>\r\n\r\n<p style=\"text-align: justify;\">&quot;Kami berharap dengan adanya acara seperti ini, dapat tercipta suasana yang lebih harmonis di antara para pendidik yang sudah purna bakti, alumni, komite, tenaga kependidikan yang masih bertugas, tenaga nonkependidikan yang juga masih bertugas, serta para peserta didik SMA Negeri 3 Surabaya. &nbsp;Halal Bihalal bukan hanya sekadar tradisi, tetapi juga sebagai implementasi dari nilai-nilai keagamaan dan sosial yang kami tanamkan di SMAN 3 Surabaya,&quot; ujar Bapak Sunawan Hadi Santoso,S.Pd., M.Pd.</p>\r\n\r\n<p style=\"text-align: justify;\">Dengan digelarnya acara Halal Bihalal yang meriah ini, diharapkan semangat persaudaraan dan kebersamaan di SMAN 3 Surabaya semakin terjaga dan terpelihara dengan baik, serta mampu menjadi contoh bagi sekolah lainnya dalam mewujudkan kehidupan beragama dan berbangsa yang harmonis.</p>', 1, 0, 2, '0bee7ccaeab422bda38313f34e781a9b.png', 0, 'sman-3-surabaya-gelar-halal-bihalal-wujud-persaudaraan-tak-lekang-oleh-waktu', 1447),
(150, 'PENGUMUMAN KELULUSAN SMA NEGERI 3 SURABAYA TAHUN PELAJARAN 2023-2024', '2024-05-06', 'pengumuman', '<p>SILAKAN KLIK LINK DI BAWAH INI, KEMUDIAN DOWNLOAD UNTUK MELIHAT HASILNYA</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style=\"font-size:48px\"><a href=\"http://athaa11study.blogspot.com\">http://athaa11study.blogspot.com</a></span></p>\r\n\r\n<p>&nbsp;</p>', 1, 0, NULL, 'a9867bfc867a73ce5cb0d274f56d6e44.jpg', 0, NULL, 1336),
(151, 'KELUARGA BESAR SMA NEGERI 3 SURABAYA, MENGUCAPKAN SELAMAT KEPADA SISWA-SISWI YANG LULUS DAN TELAH SUKSES MENYELESAIKAN PEMBELAJARAN DI SMA NEGERI 3 SURABAYA', '2024-05-06', 'post', '<p><a href=\"http://athaa11study.blogspot.com\">http://athaa11study.blogspot.com</a></p>', 1, 0, 1, '60250e14006e8764dafbcfb8a7e16c08.jpeg', 0, 'keluarga-besar-sma-negeri-3-surabaya-mengucapkan-selamat-kepada-siswa-siswi-yang-lulus-dan-telah-sukses-menyelesaikan-pembelajaran-di-sma-negeri-3-surabaya', 1507),
(152, 'Kelas X SMAN 3 Surabaya Menyelami Kearifan Lokal Melalui Kegiatan  Outdoor Learning P5 di Yogyakarta', '2024-05-07', 'post', '<p style=\"text-align:justify\">Peserta didik&nbsp;SMAN 3 Surabaya, kelas X, telah melaksanakan kegiatan <em>outdoor learning</em>&nbsp;P5 (Projek Penguatan Profil Pelajar Pancasila) dengan tema kearifan lokal, yang berlangsung pada tanggal 1-2 Mei 2024 di Yogyakarta. Kegiatan ini merupakan upaya untuk memperkenalkan dan memperkuat pemahaman siswa tentang budaya dan kearifan lokal Indonesia.</p>\r\n\r\n<p style=\"text-align:justify\">Peserta didik diajak untuk menjelajahi keberagaman budaya batik di Batik Yudhistira, yang terletak di Jalan Taman Siswa No. 150A Wirogunan, Kecamatan Mergangsan, Kota Yogyakarta. Sebelumnya, mereka juga belajar tentang dampak letusan Gunung Merapi di Museum Sisa Hartaku di Merapi, sebagai bagian dari upaya untuk memahami keragaman alam dan budaya Indonesia.</p>\r\n\r\n<p style=\"text-align:justify\">Pada hari kedua kegiatan, peserta didik secara intensif mempelajari beragam jenis batik, dengan harapan agar mereka dapat memahami nilai-nilai kearifan lokal yang terkandung dalam budaya batik. Melalui sesi praktik, mereka diberi kesempatan untuk mencoba membuat batik tulis secara berkelompok, dengan tujuan agar dapat mencintai serta melestarikan warisan budaya bangsa.</p>\r\n\r\n<p style=\"text-align:justify\">Kegiatan <em>outdoor learning</em>&nbsp;P5 ini diharapkan dapat meningkatkan rasa kecintaan siswa terhadap budaya Indonesia, khususnya dalam hal melestarikan batik sebagai salah satu kekayaan budaya yang membanggakan. SMAN 3 Surabaya terus berkomitmen untuk memberikan pengalaman belajar yang mendalam dan berkesan bagi peserta didik, sehingga mereka dapat menjadi generasi yang cerdas, berbudaya, dan bertanggung jawab dalam menghargai warisan budaya bangsa.</p>', 1, 0, 2, '73381fbf73bda6a2233e0c0fe3bf7003.png', 0, 'kelas-x-sman-3-surabaya-menyelami-kearifan-lokal-melalui-kegiatan-outdoor-learning-p5-di-yogyakarta', 1852),
(153, 'Menggali Literasi Dunia Perguruan Tinggi: Kunjungan Kampus di Jogja, Sarana tuk Menata Masa Depan Peserta Didik Kelas XI SMA Negeri 3 Surabaya', '2024-05-08', 'post', '<p style=\"text-align: justify;\">Puluhan peserta didik SMA Negeri 3 Surabaya, kelas XI, &nbsp;menyelami pengalaman belajar yang tak lazim, 29-30 April 2024. Mereka tidak duduk di kelas atau berbincang di perpustakaan, melainkan merajut pengetahuan mereka di bawah langit terbuka dalam sebuah kunjungan kampus yang menarik, kampus Universitas Negeri Yogyakarta (UNY).</p>\r\n\r\n<p style=\"text-align: justify;\">Acara ini diadakan dengan tujuan untuk memberikan wawasan tentang berbagai pilihan karir yang tersedia setelah lulus. Melalui tur kampus, peserta didik SMA Negeri 3 Surabaya dapat melihat langsung fasilitas dan program yang ditawarkan oleh perguruan tinggi atau universitas, serta berinteraksi dengan mahasiswa dan staf akademik untuk memahami lebih dalam tentang jalur karir yang mereka minati.</p>\r\n\r\n<p style=\"text-align: justify;\">&ldquo;Dengan memperoleh pemahaman yang lebih baik tentang berbagai perguruan tinggi, peserta didik dapat termotivasi untuk pengembangan diri. Selain itu, tur kampus dapat memperkaya wawasan, sehingga peserta didik dapat membuat keputusan pendidikan yang lebih terinformasi.&rdquo; Jelas Sunawan Hadi Santoso, M.Pd, selaku kepala SMA Negeri 3 Surabaya saat memberangkatkan rombongan tur kampus Jogja, 29 April 2024.</p>\r\n\r\n<p style=\"text-align: justify;\">Selain itu, tur kampus juga memiliki tujuan untuk meningkatkan kesadaran akademik. Melalui juru bicara yang ditunjuk oleh Kampus UNY, Peserta tur, peserta didik SMA Negeri 3 Surabaya, kelas XI, lebih memahami persyaratan masuk, dan tantangan akademik yang mungkin mereka hadapi saat UNY menjadi pilihan mereka untuk melanjutkan sekolah setelah lulus. . Melalui sesi informasi dan diskusi dengan perwakilan universitas, peserta didik SMA Negeri 3 Surabaya lebih memperoleh pemahaman yang lebih baik tentang langkah-langkah yang perlu mereka ambil untuk mempersiapkan diri secara akademik dan pribadi untuk sukses di perguruan tinggi.</p>\r\n\r\n<p style=\"text-align: justify;\">&ldquo;Kegiatan tur kampus ini merupakan kesempatan bagi saya untuk menanyakan pertanyaan dan memperoleh saran tentang cara meningkatkan prestasi akademik saya. Dengan demikian, kunjungan kampus dapat membantu saya merencanakan langkah-langkah menuju masa depan yang sukses dan memuaskan,&rdquo; tanggapan Rivansa, peserta didik kelas XI-10 akan&nbsp;&nbsp;kegiatan tur kampus Jogja, 29-30 April 2024.</p>', 1, 0, 2, 'de83d29108f72344a4446ca82aeb1879.png', 0, 'menggali-literasi-dunia-perguruan-tinggi-kunjungan-kampus-di-jogja-sarana-tuk-menata-masa-depan-peserta-didik-kelas-xi-sma-negeri-3-surabaya', 1701),
(154, 'MPLS di SMAN 3 Surabaya: Menciptakan Suasana Kondusif dengan Generasi Anti-Bullying', '2024-07-15', 'post', '<p><strong>Surabaya, 15 Juli 2024</strong> - SMAN 3 Surabaya kembali mengadakan kegiatan Masa Pengenalan Lingkungan Sekolah (MPLS) untuk menyambut siswa-siswi baru tahun ajaran 2024/2025. Acara yang berlangsung selama tiga hari ini mengusung tema &quot;Ciptakan Suasana Kondusif di Lingkungan Satuan Pendidikan dengan Menjadi Generasi Anti-<em>Bullying</em>&quot;.</p>\r\n\r\n<p>Hari pertama MPLS kali ini berbeda dengan tahun lalu. &nbsp;MPLS tahun ini secara resmi dibuka langsung oleh Pj Gubenur Jawa Timur, Bapak Adhy Karyono, secara daring (dalam jaringan). Adhy Karyono dalam sambutannya menyatakan mendukung gerakan anti-bullying dalam satuan Pendidikan. Beliau mengajak peserta MPLS SMA/ SMK/ SLB Se-Jatim menjadi generasi yang cerdas dalam akademis juga memiliki &nbsp;dan karakter yang tangguh menghadapi berbagai tantangan.</p>\r\n\r\n<p>Kegiatan MPLS tahun ini bertujuan untuk mengenalkan siswa baru pada lingkungan sekolah, sekaligus mengedukasi mereka mengenai pentingnya menciptakan suasana yang kondusif dan bebas dari perilaku bullying. Bapak Agus Setiadi,S.Pd, selaku wakil kepala sekolah bagian kesiswaan dalam sambutannya saat penyematan tanda peserta kepada perwakilan siswa&nbsp;juga mengungkapkan&nbsp;pentingnya menciptakan lingkungan yang aman dan nyaman bagi semua siswa dengan cara berhenti merundung (stop bullying).</p>\r\n\r\n<p>&ldquo;Kami berharap dengan adanya kegiatan MPLS ini, siswa baru dapat merasa diterima dan terhindar dari tindakan bullying. Kami ingin menciptakan lingkungan sekolah yang aman, nyaman, dan kondusif untuk proses belajar mengajar,&rdquo; ujar Bapak Agus Setiadi.</p>\r\n\r\n<p>Selama MPLS, berbagai kegiatan positif dan edukatif diadakan, mulai dari pengenalan nilai-nilai anti-bullying, workshop tentang empati dan toleransi, hingga permainan yang mempererat rasa kebersamaan. Para siswa juga diajak untuk berpartisipasi dalam diskusi dan simulasi untuk memahami dampak negatif bullying dan cara mengatasinya.</p>\r\n\r\n<p>Dengan tema &quot;Ciptakan Suasana Kondusif di Lingkungan Satuan Pendidikan dengan Menjadi Generasi Anti-Bullying&quot;, diharapkan siswa baru SMAN 3 Surabaya dapat memulai tahun ajaran baru dengan semangat positif dan komitmen untuk menjaga kerukunan dan kebersamaan di sekolah.</p>', 1, 0, 2, '4a42932e11d6c451423f409e6a8f47e8.png', 0, 'mpls-di-sman-3-surabaya-menciptakan-suasana-kondusif-dengan-generasi-anti-bullying', 1662),
(156, 'Motivasi Psikologi Siswa oleh Prof. Dr. Suryanto, M.Si., Psikolog Dekan Fakultas Psikologi UNAIR di SMA Negeri 3 Surabaya', '2024-07-18', 'post', '<p style=\"text-align: justify;\"><strong>Surabaya, 18 Juli 2024 - </strong>SMA Negeri 3 Surabaya menyelenggarakan acara &quot;Motivasi&quot; yang dihadiri oleh Prof. Dr. Suryanto, M.Si. Kegiatan ini diadakan khusus untuk siswa kelas XI dengan tujuan memberikan dorongan semangat dan panduan untuk meraih prestasi akademik yang lebih baik di tahun ajaran baru.<br />\r\nProf. Dr. Suryanto, M.Si., seorang akademisi terkemuka dan motivator handal, menyampaikan pidato inspiratif yang menekankan pentingnya disiplin, kerja keras, dan fokus dalam mencapai tujuan pendidikan. Dalam paparannya, beliau berbagi berbagai pengalaman hidup serta kisah sukses yang memberikan inspirasi kepada para siswa untuk terus berjuang dan tidak mudah menyerah dalam menghadapi tantangan.<br />\r\n&quot;Setiap siswa memiliki potensi luar biasa. Kuncinya adalah bagaimana kalian mampu mengoptimalkan potensi tersebut melalui usaha yang sungguh-sungguh dan perencanaan yang matang,&quot; ujar Prof. Dr. Suryanto dalam sesi motivasinya. Beliau juga menekankan pentingnya memiliki tujuan yang jelas serta strategi yang efektif untuk mencapainya. Beliau mengatakan, &ldquo; Orang yang ingin sukses tanpa usaha&nbsp;dan perencanaan, bagai orang yang mencari semut hitam di kegelapan.&rdquo;&nbsp;<br />\r\nAcara yang berlangsung di aula sekolah ini disambut antusias oleh para siswa. Mereka tampak sangat tertarik dan termotivasi dengan materi yang disampaikan. Beberapa siswa mengungkapkan bahwa motivasi dari Prof. Dr. Suryanto telah membuka wawasan mereka mengenai pentingnya memiliki mindset yang positif dan tangguh.<br />\r\nKepala Sekolah SMA Negeri 3 Surabaya, Sunawan Hadi Santoso, S.Pd. M.Pd. dalam&nbsp;sambutannya menyampaikan rasa terima kasih atas kehadiran dan kontribusi Prof. Dr. Suryanto, M.Si. &quot;Kami berharap melalui acara ini, siswa-siswi kami semakin termotivasi untuk belajar dan meraih prestasi terbaik. Semoga semangat yang diberikan oleh Prof. Dr. Suryanto, M.Si. dapat menjadi bekal berharga bagi mereka,&quot; kata Sunawan Hadi Santoso, S.Pd., M.Pd.<br />\r\nAcara &quot;Motivasi Awal Tahun Pelajaran&quot; ini diharapkan menjadi momentum penting bagi siswa kelas XI untuk memulai tahun ajaran baru dengan semangat dan tekad yang kuat, sehingga dapat mencapai hasil belajar yang optimal dan membanggakan.</p>', 1, 0, 2, 'a8cd4f71688aa2561334ffa0a34d7bbc.jpeg', 0, 'motivasi-psikologi-siswa-oleh-prof-dr-suryanto-msi-psikolog-dekan-fakultas-psikologi-unair-di-sma-negeri-3-surabaya', 1788),
(157, 'Jumat Sedekah SMAN 3 Surabaya, Lebih dari Sekadar Nasi Bungkus', '2024-08-02', 'post', '<p style=\"text-align:justify\"><strong><em>Surabaya, 2 Agustus 2024</em> </strong>&mdash; SMAN 3 Surabaya melakukan Praktik Baik dan kembali menunjukkan komitmennya dalam membangun rasa kepedulian sosial melalui program Jumat Sedekah . Program ini merupakan bagian dari upaya sekolah dalam mendidik siswa untuk lebih peka terhadap lingkungan sekitar dan membantu mereka yang membutuhkan.</p>\r\n\r\n<p style=\"text-align:justify\">Jumat sedekah ini merupakan sedekah yang diberikan oleh siswa yang mampu berupa nasi bungkus atau sejenisnya. Pengurus OSIS SMA Negeri 3 Surabaya mengumpulkan sedekah di suatu tempat. Setelah terkumpul, siswa SMA Negeri 3 Surabaya yang membutuhkan nasi bungkus tersebut, diizinkan untuk mengambil nasi yang tersedia untuk&nbsp; sarapan, atau makan siang mereka.</p>\r\n\r\n<p style=\"text-align:justify\">Kegiatan Jumat Sedekah di SMAN 3 Surabaya tidak hanya memberikan manfaat bagi siswa, tetapi juga memiliki dampak yang lebih luas. Selain mendapatkan makanan gratis, siswa juga diajarkan tentang pentingnya berbagi dan saling membantu.</p>\r\n\r\n<p style=\"text-align:justify\">&quot;Jumat Sedekah ini membiasakan saya agar bisa berbagi untuk menumbuhkan kepedulian saya terhadap sesama,&quot; ujar Diandra Sarahputri kelas XII-8.</p>\r\n\r\n<p style=\"text-align:justify\">Selain itu, &nbsp;salah satu siswa dari kelas X, mengungkapkan rasa bahagianya bisa ikut berpartisipasi dalam program ini. &quot;Saya merasa diri saya bisa bermanfaat, &nbsp;bisa membantu orang lain. Program ini membuat saya &nbsp;bisa menyakinkan diri saya, Bahagia itu bisa saya dapatkan dengan berbagi,&quot; katanya.</p>\r\n\r\n<p style=\"text-align:justify\">Kegiatan ini juga diharapkan dapat meningkatkan rasa solidaritas di antara warga sekolah. Melalui kegiatan berbagi, siswa dapat saling mengenal dan membangun hubungan yang lebih erat.</p>\r\n\r\n<p style=\"text-align:justify\">Kepala Sekolah SMAN 3 Surabaya, Sunawan Hadi Santoso, S.Pd., M.Pd. &nbsp;menyatakan bahwa program ini bukan hanya sekadar kegiatan amal, tetapi juga sarana pendidikan karakter bagi siswa. &quot;Kami ingin menanamkan nilai-nilai kepedulian dan empati sejak dini. Dengan demikian, siswa tidak hanya berprestasi di bidang akademik, tetapi juga memiliki kepribadian yang baik dan peduli terhadap sesama,&quot; ujarnya.</p>\r\n\r\n<p style=\"text-align:justify\">Dengan adanya program Jumat Sedekah, SMAN 3 Surabaya tidak hanya menjadi institusi pendidikan yang unggul dalam prestasi akademik, tetapi juga sebagai pelopor dalam kegiatan sosial yang inspiratif. Semoga semangat kepedulian ini terus berkembang dan menginspirasi banyak pihak untuk selalu berbagi dengan sesama.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>', 1, 0, 2, '0b855980707f0227a96b01b9725c0f4e.jpeg', 0, 'jumat-sedekah-sman-3-surabaya-lebih-dari-sekadar-nasi-bungkus', 1608),
(158, 'KPAI dan WVI Gelar Dialog Politik Ramah Anak di SMAN 3 Surabaya', '2024-10-10', 'post', '<p style=\"text-align:justify\"><strong>Surabaya, 8 Oktober 2024</strong>&nbsp;&ndash; Potensi munculnya pelecehan, eksploitasi, dan kekerasan politik, serta perundungan dikhawatirkan bisa menyerang anak sehubungan dengan pemilihan kepala daerah (pilkada) setempat. Anak-anak, terutama mereka yang belum mempunyai hak pilih, berisiko menjadi sasaran kampanye politik yang tidak sehat. Pada saat yang sama, anak-anak yang telah mempunyai hak pilih juga harus diberikan kesempatan untuk berpartisipasi dan mendapatkan pendidikan politik yang sesuai.</p>\r\n\r\n<p style=\"text-align:justify\">Menyikapi situasi ini, Dewan Perlindungan Anak Indonesia (KPAI) bekerja sama dengan Wahana Bisi Indonesia (WVI) mengunjungi berbagai sekolah, termasuk Sekolah SMA Negeri 3 Surabaya, untuk menerapkan kebijakan ramah anak .Tujuan dari kegiatan ini adalah untuk memberikan pemahaman yang lebih baik kepada anak-anak tentang hak-hak politik mereka dan melindungi mereka dari kemungkinan dampak negatif gerakan politik. Kunjungan dan dialog dilaksanakan pada Selasa, 8 Oktober 2024 pukul WIB hingga pukul 13.00 WIB di aula SMA Negeri 3 Surabaya.</p>\r\n\r\n<p style=\"text-align:justify\">Dalam kegiatan tersebut, KPAI dan WVI tidak hanya mengedukasi peserta didik SMA Negeri 3 Surabaya tentang pentingnya pendidikan kewarganegaraan bagi anak, namun juga memastikan bahwa anak-anak di SMA Negeri 3 baik-baik saja. Peserta didik SMANegeri 3 Surabaya juga diberikan kesempatan berbagi rasa.</p>\r\n\r\n<p style=\"text-align:justify\">Acara ini diterima dengan baik oleh pihak sekolah. Sunawan Hadi Santoso, S.Pd., M.Pd., Kepala SMAN 3 Surabaya, &nbsp;menyampaikan bahwa kegiatan ini sangat penting dalam menanamkan nilai-nilai demokrasi dan keterlibatan politik yang sehat pada Peserta didik.</p>\r\n\r\n<p style=\"text-align:justify\">&ldquo;Kami sangat mendukung inisiatif ini dan berharap peserta didik mendapatkan pendidikan kewarganegaraan yang komprehensif dan bermanfaat tanpa ada unsur tekanan atau eksploitasi,&rdquo; ujar beliau.</p>', 1, 0, 2, '5ea0413622f09cc64546d419b63e2838.jpg', 0, 'kpai-dan-wvi-gelar-dialog-politik-ramah-anak-di-sman-3-surabaya', 1275),
(159, 'Perayaan Dies Natalis ke-59 SMAN 3 Surabaya: Sebuah Pesta Kreativitas dan Kebersamaan', '2025-01-16', 'post', '<p style=\"text-align: justify;\">Surabaya, 4 Januari 2025 &ndash; Untuk merayakan Dies Natalis ke-59 SMAN 3 Surabaya, sekolah mengadakan acara yang meriah di area lapangan depan pada pukul 07.35 hingga 16.00 WIB. Acara dimulai dengan kata sambutan yang bermakna dari Kepala Sekolah SMAN 3 Surabaya, Bapak Sunawan Hadi Santoso, S.Pd. M.Pd. Beliau mengungkapkan rasa terima kasih dan penghargaan kepada seluruh siswa, guru, serta semua pihak yang berkontribusi terhadap kemajuan sekolah.<br />\r\nAcara ini dimeriahkan dengan berbagai penampilan istimewa dari gabungan siswa kelas 1 sampai 12 yang menunjukkan kreativitas mereka yang luar biasa dalam bidang tari, musik, dan pertunjukan lainnya. Tidak kalah menarik, para guru juga meramaikan suasana dengan penampilan yang menghibur dan memberikan inspirasi.<br />\r\nSorak-sorai peserta semakin membahana dengan kedatangan Telu Mania, yang menghadirkan berbagai aktivitas menarik dan membuat acara semakin meriah. Sebagai puncak acara, perayaan Dies Natalis dimeriahkan oleh tamu istimewa, Titi Laras, yang menyanyikan lagu-lagu yang menawan dan berhasil memikat perhatian semua yang hadir.<br />\r\nHari Jadi SMAN 3 Surabaya bukan hanya sekadar perayaan, melainkan juga merupakan kesempatan untuk memperkuat ikatan serta mengembangkan potensi semua anggota sekolah. Dengan mengusung tema<strong> Dinasty X Medival</strong>, seluruh warga SMA Negeri 3 Surabaya berharap tahun ini dan tahun-tahun berikutnya, SMAN 3 Surabaya akan tetap sukses dan jaya&nbsp;bagi. Acara ini menjadi waktu yang tepat untuk merenung sekaligus memberi semangat untuk terus mencapai prestasi.<br />\r\nSelamat hari jadi, SMAN 3 Surabaya!</p>', 1, 0, 2, '9831a8ff5ea342ee4c2c86f482132748.png', 0, 'perayaan-dies-natalis-ke-59-sman-3-surabaya-sebuah-pesta-kreativitas-dan-kebersamaan', 1107),
(160, 'SMA Negeri 3 Surabaya Siapkan Siswa Eligible untuk Lolos SNBP ke Universitas Impian', '2025-02-11', 'post', '<p style=\"text-align: justify;\"><em><strong>Surabaya, 11 Februari 2025 </strong>&ndash;</em> Dalam rangka menghantarkan siswa-siswinya menuju perguruan tinggi impian melalui Seleksi Nasional Berdasarkan Prestasi (SNBP), SMA Negeri 3 Surabaya menggelar serangkaian kegiatan pendampingan bagi siswa <em>eligible</em>. Kegiatan ini dimulai dengan pengumuman daftar siswa yang masuk kategori eligible pada 3 hingga 31 Januari 2025, sekaligus pendampingan dalam pembuatan akun SNBP.</p>\r\n\r\n<p style=\"text-align: justify;\">Sebagai langkah strategis, SMA Negeri 3 Surabaya mengadakan kegiatan pemetaan universitas dan program studi pada 21 Januari 2025. Kegiatan ini bertujuan membantu siswa memahami peluang mereka dalam memilih perguruan tinggi dan jurusan yang sesuai dengan bakat serta minat mereka. Dalam kesempatan ini, sekolah menghadirkan psikolog Amanto Prayudisiono, S.Psi. untuk memberikan wawasan serta bimbingan kepada siswa agar dapat mengambil keputusan yang tepat.</p>\r\n\r\n<p style=\"text-align: justify;\">Tidak hanya fokus pada siswa, SMA Negeri 3 Surabaya juga mengadakan sosialisasi kepada orang tua siswa <em>eligible</em>. Sosialisasi ini bertujuan untuk menyelaraskan pilihan universitas dan program studi siswa dengan harapan orang tua, sehingga keputusan yang diambil menjadi lebih matang dan terarah. Dalam kegiatan ini, psikolog Amanto Prayudisiono, S.Psi. kembali dihadirkan untuk memberikan pemahaman mendalam terkait pemilihan jurusan yang sesuai dengan potensi dan karakter siswa.</p>\r\n\r\n<p style=\"text-align: justify;\">Komitmen SMA Negeri 3 Surabaya dalam mendampingi siswa tidak berhenti di sini. Saat pendaftaran SNBP berlangsung, sekolah juga memberikan bimbingan intensif bagi siswa <em>eligible</em>. Pendampingan dilakukan oleh guru BK serta wali kelas untuk memastikan setiap siswa mendapatkan arahan yang tepat dalam memilih universitas dan program studi yang paling sesuai dengan peluang mereka.</p>\r\n\r\n<p style=\"text-align: justify;\">Dengan berbagai upaya ini, SMA Negeri 3 Surabaya berharap siswa <em>eligible</em> dapat memaksimalkan kesempatan mereka dalam SNBP 2025 dan berhasil masuk ke perguruan tinggi yang diimpikan. Langkah ini merupakan bentuk nyata dari komitmen sekolah dalam mendukung keberhasilan akademik dan masa depan siswanya.</p>', 1, 0, 1, '696466168083f4769bff4523b1bc2822.png', 0, 'sma-negeri-3-surabaya-siapkan-siswa-eligible-untuk-lolos-snbp-ke-universitas-impian', 860),
(161, 'SMA Negeri 3 Surabaya Tanamkan Cinta Budaya melalui P5: Dari Tari Remo hingga Belajar Batik di Jogjakarta', '2025-02-11', 'post', '<p style=\"text-align:justify\"><em>Surabaya, 6 Februari 2025 &ndash;</em> Komitmen SMA Negeri 3 Surabaya dalam mencetak generasi muda yang mencintai budayanya terus diwujudkan melalui berbagai kegiatan. Mengusung semangat peribahasa <em>&quot;Tak Kenal maka Tak Sayang,&quot;</em> sekolah ini mengimplementasikan <strong>Projek Penguatan Profil Pelajar Pancasila (P5) dengan tema Kearifan Lokal</strong>, yang bertujuan mengenalkan dan menanamkan kecintaan siswa terhadap budaya daerah.</p>\r\n\r\n<p style=\"text-align:justify\">Sebagai bagian dari program ini, siswa kelas X diajak untuk mengenal dan mempelajari <strong>Tari Remo dan Tari Gandrung</strong>, dua tarian khas Jawa Timur yang sarat makna. Tidak berhenti pada tahap pengenalan, SMA Negeri 3 Surabaya juga memberikan kesempatan kepada para siswa untuk <strong>mementaskan tarian tersebut di Tebing Breksi, Yogyakarta</strong>. Pementasan ini bukan hanya menjadi ajang unjuk keterampilan, tetapi juga sebagai bentuk kebanggaan terhadap warisan budaya bangsa.</p>\r\n\r\n<p style=\"text-align:justify\">Selain mengasah kemampuan seni tari, SMA Negeri 3 Surabaya juga mengajak para siswa untuk mencintai <strong>produk lokal Indonesia</strong>. Salah satu caranya adalah dengan <strong>mengunjungi industri batik Benang Ratu di Yogyakarta</strong>. Di tempat ini, siswa tidak hanya melihat proses pembuatan batik secara langsung tetapi juga mendapat kesempatan untuk belajar membatik. Pengalaman ini memberikan wawasan mendalam kepada siswa mengenai kekayaan budaya lokal serta pentingnya melestarikan warisan nenek moyang.</p>\r\n\r\n<p style=\"text-align:justify\">Dalam kesempatan tersebut, <strong>Kepala Sekolah, Bapak Sunawan Hadi Santoso,S.Pd., M.Pd.</strong> menyampaikan pesan penting kepada siswa. Beliau menekankan bahwa generasi muda harus <strong>bersikap arif terhadap produk lokal</strong>, karena dengan menghargai dan menggunakan hasil karya bangsa sendiri, Indonesia dapat tetap menjadi negara yang mandiri dan sejahtera.</p>\r\n\r\n<p style=\"text-align:justify\">Melalui kegiatan ini, SMA Negeri 3 Surabaya berharap dapat menanamkan rasa cinta dan bangga terhadap budaya sendiri di kalangan peserta didik. Dengan mengenal, mempelajari, dan mempraktikkan budaya lokal, siswa diharapkan tumbuh menjadi generasi yang tidak hanya berprestasi secara akademik, tetapi juga memiliki karakter kuat dalam menjaga identitas bangsa.</p>', 1, 0, 1, '686513dc4d0007195c642b4b2499afb2.jpeg', 0, 'sma-negeri-3-surabaya-tanamkan-cinta-budaya-melalui-p5-dari-tari-remo-hingga-belajar-batik-di-jogjakarta', 890);
