(162, 'PENGUMUMAN KELULUSAN SMA NEGERI 3 SURABAYA TAHUN PELAJARAN 2024-2025', '2025-05-05', 'post', '<p><strong>PENGUMUMAN KELULUSAN</strong><br />\r\n<strong>SMA NEGERI 3 SURABAYA</strong><br />\r\nTahun Pelajaran 2024/2025</p>\r\n\r\n<p>Berdasarkan hasil rapat dewan guru SMA Negeri 3 Surabaya dan mengacu pada kriteria kelulusan yang telah ditetapkan oleh satuan pendidikan, dengan ini diumumkan bahwa:</p>\r\n\r\n<p><strong>Peserta didik kelas XII Tahun Pelajaran 2024/2025 dinyatakan: LULUS 100%</strong></p>\r\n\r\n<p>Demi menjaga ketertiban dan keamanan bersama, peserta didik <strong>tidak diperkenankan</strong> melakukan konvoi kendaraan, coret-coret seragam, atau perayaan lain yang berpotensi mengganggu ketertiban umum.<br />\r\nSMA Negeri 3 Surabaya mengajak seluruh siswa untuk merayakan kelulusan dengan cara yang positif, bermartabat, dan penuh rasa syukur.</p>\r\n\r\n<p>Surabaya, 5 Mei 2025<br />\r\nKepala SMA Negeri 3 Surabaya<br />\r\n<br />\r\n<strong>SUNAWAN HADI SANTOSO, S.Pd. M.Pd.</strong><br />\r\nNIP. 19791021 2003121 006</p>', 1, 0, 3, '9d180562fbc23aa04515896e97666daf.jpeg', 0, 'pengumuman-kelulusan-sma-negeri-3-surabaya-tahun-pelajaran-2024-2025', 1008),
(163, 'PPDB 2025', '2025-05-15', 'page', '<h1>Jadwal SPMB Jatim 2025</h1>\r\n\r\n<h3>Pra Pendaftaran SPMB Jatim 2025</h3>\r\n\r\n<ul>\r\n	<li>Entry Nilai Rapor oleh Kepala Satuan Pendidikan SMP/Sederajat: 19 - 24 Mei 2025, pukul 01.00 - 23.59 WIB &nbsp; &nbsp;</li>\r\n	<li>Verifikasi Nilai Rapor oleh Calon Murid Baru: 24 - 28 Mei 2025, pukul 01.00 - 23.59 WIB &nbsp; &nbsp;</li>\r\n	<li>Pembetulan Nilai Rapor oleh Kepala Satuan Pendidikan SMP/Sederajat: 27 - 31 Mei 2025, pukul 01.00 - 23.59 WIB</li>\r\n	<li>Pengambilan PIN oleh Calon Murid Baru: 2 - 13 Juni 2025, pukul 01.00 - 23:59 WIB &nbsp; &nbsp;</li>\r\n	<li>Verifikasi dan Validasi Dokumen oleh Operator SMA/SMK: 2 - 14 Juni 2025, pukul 08.00 - 16.00 WIB</li>\r\n	<li>Latihan Pendaftaran: 9 - 11 Juni 2025, pukul 01.00 - 23.59 WIB</li>\r\n	<li>Verifikasi dan validasi hasil tes kesehatan untuk syarat pendaftaran SMK pada konsentrasi keahlian tertentu: 2 - 14 Juni 2025, pukul 08.00 - 16.00 WIB &nbsp; &nbsp;</li>\r\n</ul>\r\n\r\n<ol>\r\n	<li>\r\n	<h3>SPMB &nbsp;Jatim 2025 Tahap I: Jalur Afirmasi, Jalur Mutasi Orang Tua/Wali, dan Jalur Prestasi Hasil Lomba SMA/SMK</h3>\r\n	</li>\r\n</ol>\r\n\r\n<ul>\r\n	<li>Pendaftaran: 16 - 17 Juni 2025, pukul 00.01 - 21.00 WIB &nbsp; &nbsp;</li>\r\n	<li>Penutupan: 17 Juni 2025, pukul 21.00 WIB &nbsp; &nbsp;</li>\r\n	<li>Verifikasi dan Validasi oleh SMA/SMK: 17 - 19 Juni 2025 &nbsp; &nbsp;s.d pukul &nbsp;16.00 WIB &nbsp; &nbsp;</li>\r\n	<li>Pengumuman: 20 Juni 2025, pukul 09.00 WIB &nbsp; &nbsp;</li>\r\n	<li>Cetak Bukti Penerimaan oleh Calon Murid Baru: &nbsp; &nbsp;20 Juni 2025, pukul 09.00 - 23.59 WIB &nbsp; &nbsp;</li>\r\n	<li>Daftar Ulang di SMA/SMK Negeri Tujuan: &nbsp; &nbsp;20 - 21 Juni 2025, pukul 09.00 - 16.00 WIB &nbsp; &nbsp;SMA/SMK Negeri yang dituju</li>\r\n</ul>\r\n\r\n<h3>2. SPMB Jatim 2025 Tahap II: Jalur Nilai Prestasi Akademik&nbsp;</h3>\r\n\r\n<ul>\r\n	<li>Pendaftaran: 22 - 23 Juni 2025, pukul 00.01 - 21.00 WIB</li>\r\n	<li>Penutupan: 23 Juni 2025, pukul 21.00 WIB &nbsp; &nbsp;</li>\r\n	<li>Pengumuman: 24 Juni 2025, pukul 08.00 WIB &nbsp; &nbsp;</li>\r\n	<li>Cetak Bukti Penerimaan oleh Calon Murid Baru: &nbsp; &nbsp;24 Juni 2025, pukul 09.00 - 23.59 WIB &nbsp; &nbsp;</li>\r\n	<li>Daftar Ulang di SMA Negeri Tujuan:24 - 25 Juni 2025, pukul 09.00 - 16.00 WIB</li>\r\n</ul>\r\n\r\n<p><strong><em>Baca juga:&nbsp;</em><a href=\"https://www.tribunnews.com/pendidikan/2025/05/06/4-jalur-pendaftaran-spmb-2025-jawa-barat-jenjang-smasmk-dan-cara-daftarnya-di-spmbjabarprovgoid\" style=\"padding: 0px; box-sizing: border-box; margin: 0px; outline: 0px; border: none; color: rgb(1, 111, 186); text-decoration-line: none; font-style: italic;\" title=\"4 Jalur Pendaftaran SPMB 2025 Jawa Barat Jenjang SMA/SMK dan Cara Daftarnya di spmb.jabarprov.go.id\">4 Jalur Pendaftaran SPMB 2025 Jawa Barat Jenjang SMA/SMK dan Cara Daftarnya di spmb.jabarprov.go.id</a></strong></p>\r\n\r\n<h3>3. SPMB &nbsp;Jatim 2025 Tahap III: Jalur Domisili SMA/SMK</h3>\r\n\r\n<ul>\r\n	<li>Pendaftaran: 26 - 27 Juni 2025, pukul 00.01 - 21.00 WIB &nbsp; &nbsp;</li>\r\n	<li>Penutupan: 27 Juni 2025, pukul 21.00 WIB &nbsp; &nbsp;</li>\r\n	<li>Pengumuman: 28 Juni 2025, pukul 08.00 WIB &nbsp; &nbsp;</li>\r\n	<li>Cetak Bukti Penerimaan oleh Calon Murid Baru: &nbsp; &nbsp;28 Juni 2025, pukul 09.00 - 23.59 WIB &nbsp; &nbsp;</li>\r\n	<li>Daftar Ulang di SMA/SMK Negeri Tujuan: 28 Juni dan 30 Juni 2025, pukul 09.00 - 16.00 WIB &nbsp; &nbsp;</li>\r\n	<li>Pengumuman Pemenuhan Kuota:1 Juli 2025, pukul 08.00 WIB</li>\r\n	<li>Cetak Bukti Penerimaan Pemenuhan Kuota: &nbsp; &nbsp;1 Juli 2025, pukul 09.00 - 16.00 WIB &nbsp; &nbsp;</li>\r\n	<li>Daftar Ulang Pemenuhan Kuota: 1 Juli 2025, pukul 09.00 - 16.00 WIB</li>\r\n</ul>\r\n\r\n<h3>4. SPMB Jatim 2025 TAHAP IV: Jalur Nilai Prestasi Akademik SMK</h3>\r\n\r\n<ul>\r\n	<li>Pendaftaran:2 - 3 Juli 2025, pukul 00.01 - 21.00 WIB</li>\r\n	<li>Penutupan: 3 Juli 2025, pukul 21.00 WIB &nbsp; &nbsp;</li>\r\n	<li>Pengumuman: 4 Juli 2025, pukul 08.00 WIB &nbsp; &nbsp;</li>\r\n	<li>Cetak Bukti Penerimaan oleh Calon Murid Baru: &nbsp; &nbsp;4 Juli 2025, pukul 09.00 - 23.59 WIB &nbsp; &nbsp;</li>\r\n	<li>Daftar Ulang di SMK Negeri Tujuan: 4 - 5 Juli 2025, pukul 09.00 - 16.00 WIB</li>\r\n</ul>', 1, 0, NULL, NULL, 0, 'ppdb-2025', 1759),
